  ('Abba', 'sing. Sumo sacerdote. Este nombre ha perdido su prefijo de Clase 1 : bo-, así como el de la Clase 2: ba-. Encontramos hoy los términos bOabba y baabba que significan "repartidor" y "repartidores" respectivamente. abba , v. repartir algo. distribuir. dar; conj. preso n-yo reparto, o 1 - tú repartes, a 1 él/ella reparte. Tb . o kaaba; ej . conj. preso ne - yo reparto, we - tú repartes, e - él/ella reparte. Pret. abbi, abessi. abbáa , v. ser culpable. no tener razón; conj. preso n - "soy culpable", o l "tú eres cul pable", a 1 - "él/ella es culpable". Tb. o aabá. Ej . conj. preso ne- yo no tengo razón, we tú no tie nes razón, e - él/ella no tiene razón. Pret. abbíi, abessi. abbi, pret. v. o abba ; n  distribuí, o -  distribuiste, a  distribuyó, to -  distribuimos, lO  distribuisteis, ba -  distribuyeron. abbíi, pret. v. o abbáa ; n -  f ui culpable, o -  fuiste culpable, a  fue culpable, to -  fuimos culpa bles, lO  fuisteis culpables, ba -  fueron culpables.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abbo', 'pI. brazos, antebrazos. Cl. 6 . 10. lobiJo. abé, mori adj. malo, mala, feo, fea. Concuerda con los nombres de las Cls. 2 y 6; batyo - personas malas; baatyé camas malas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abe''a', 'pi. nadadores, navegadores. Cl. 2 . abe''e, interrogo ¿cuánto/s, cuánta/s? Se utiliza con los nombres de las Clases 2, 4 Y 6 como baie , batté , boppé , etc. Ej . e xpr. he batyo - hállo? cuántas personas hay aquí?, he boppé - e eribba wela ¿cuánta agua hay en la piscina?', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abé''í', 'pI. llorones, quejumbrosos. Cl. 2 . 2 s. pI. llanto, lloro .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abébá', 'pi. cazadores. Cl. 2 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abebba', 'pi. tiempos de arrancar los ñames. Cl. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abebeppu', 'pi. machos cabríos. Cl. 6 . Tb. rimeme''e .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abébo', 'pi. carnicerías. Cl. 6 . abeem, pret. v. o abella ; n -  repartí para alguien, o -  repartiste algo para alguien, a -  repar tió algo para alguien, to -  repartimos algo para alguien, lo -  repartisteis algo para alguien, ba -  repartieron algo para alguien. Ej . expr. a batyo m ba - i kuua  a las personas les repartí la ropa.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abeki', 'pI. sacos, macutos, talegos. Cl. 6 ; n ka óttá''á - ba billo  voy a vender sacos de ñames.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('abekk', 'encerrona', NULL, 'Fuente: español-bubi', 'import-script'),
