  ('abela', 'pi. guías, anunciantes. Cl. 6 . Tb. abélla . abelessi, pret. v. o abella ; n -  distribuía algo para al guien, o -  distribuías algo para alguien, a -  distribuía algo para al guien, to -  distribuíamos algo para alguien, lo -  distribuíais algo para al guien, ba -  distribuían algo para alguien. abella , v. distribuir algo para alguien. repartir para alguien; conj. preso n-yo distribuyo para, o 1-tú distribuyes para , a 1 - él/ella distribu ye para, etc. Pret. abeem, abelessi. 10. o kabeela.', NULL, 'Fuente: bubi-español', 'import-script');
