INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('abulaella', 'pI. defensores, protectores. abogados. Cl. 2 ; a - bá e kobinna ba lá tówella e riberí wela  los abo gados del gobierno hablan en la radio.', NULL, 'Fuente: bubi-español', 'import-script'),
