  ('aburí', 'pI. salvaciones, protecciones. Cl. 6 . aburc), s. pI. defendidos, liberados. CI. 2 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('aburúm', 'pI. escobas. fregonas. Cl. 6 . Tb. baseseele , abetye . Achí , antrop. adv. que significa "otra vez, de nuevo". Se localiza en Rebola y Ehoko. Debería escribirse atyí. Acola , antrop. Proviene del verbo o ákóra . Está localizado en Basuala.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('aceite', 'con', NULL, 'Fuente: español-bubi', 'import-script'),
