  ('adquiero', 'adquirir', NULL, 'Fuente: español-bubi', 'import-script'),
  ('áelé', 'sí, de acuerdo. Tb. ee, eée. áessi, pret. v. o áa ; e ebari -la lóllá la mañana amanecía con lluvia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ahailo', 'prep. en el suelo. Tb. ahoi lo, anno, onno.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ahaotya', 'adv. al principio, al comienzo. Ej . e xp. - m pelesí ripotto al principio vivía en la ciudad. Tb. ahaossa.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ahasubbá', 'adv. al final, en último término.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('aho', 'ahí; -he eteppe ahí hay una pared, - bi''o ahí cerca.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ahoilo', 'pr ep . . en el suelo. Tb. ahailo, anno, onno. ahuaam, pret. v. o ahualla ; n ka - e ribotyo lÍl  me he acostumbrado a mi vida. ahualessi, pret. v. o ahualla ; be ammaa ba - e esubba  todos se acostumbraban a la época lluviosa. ahualla , v. acostumbrarse, aclimatarse. Pret. ahuaam, ahualessi; n-o bokeú bo áí  me acostumbro a su carácter. ahuara , v. acostumbrar, aclimatar. Pret. ahua riia, ahuaresiia; n la -a bOllá o sossa ello ebba  acostumbro a los niños a leer cada día. ahuaresiia, pret. v. o ahuara ; to - a batyo e ribotyo ri áó  acostumbrábamos nues tra vida a las personas. ahuariia, pret. v. o ahuara ; n-o pélla ne bullé bálla  me acostumbré a vivir solo. ái, pret. v. o áa ; e ebarí e - el día ama neció. áí, mor f . pos. suyo, suya; o botyo - su persona, su familiar. 2. Concuerda con la clase a la que per tenece el nombre o bompo bu -  su nariz. akaam, pret. v. o akalla ; n  até con, o  ataste con, a  ató con, to -  atamos con, lo  atasteis con, ba  ataron con. akólea / 61 akabia', NULL, 'Fuente: bubi-español', 'import-script'),
  ('aIebbáa', 'cada uno, cada cual. aleIessi, pret. v. o alella ; a batyo n ba - basoppo  a las personas les llevaba panes. alella , v. llevar por. cargar para; conj. preso n-yo cargo para, o 1-tú cargas para, a 1 éllella carga para. Pret. aleri, alelessi. alera V. enviar, remitir; o la alera o botyo l Í l isoppo  yo envío un pan a mi pariente. hacer llevar o hacer cargar para. Pret. aleriia, aleresiia. aleresiia, pret. V. o alera ; o bobellelÍl a le - ribúkku  mi hermano me enviaba un libro. aleri, pret. V. o alella ; o bOyol la a le - ba''u  el abuelo me trajo vino de palma. aleriia, pret. V. o alera ; o botukuá ri a le - boattaboasso  la jefa del pueblo me envió una carta. alessi, pret. V. o alláa ; o waísso - o bOllá e rokútta  la mujer llevaba al niño al médico. alláa , V. llevar, transportar. cargar sobre la cabeza. acarrear; conj. preso n-yo llevo, o la - tú llevas, a la - él/ella lleva. Ej . e.xpr. 0-tyoom avergonzarse. Pret. ari, alessi. Tb. o kalla.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('akákka', 'sing. vaso de coco. cubilete. vaso, copa. el. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('akakótte', 'sing. palmiste vacío, semilla vacía. el. 7 . akalessi, pret. v. o akalla ; n -  ataba con, o -  atabas con, a -  ataba con, to -  atábamos con, lo -  atabais con, ba  ataban con. ákálessi, pret. v. o ákálla ; o bOyolla - o bOllá  el anciano insuflaba/bendecía al niño. akalla , v. atar, ligar con, enfardar con. Pret. akaam, akalessi. ákálla , v. dar un masaje, insuflar, bendecir. Tb . o nkáála. Pret. ákári, ákálessi. Tb. ákám.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('akalOla', 'sing. escama de pez. el. 7 . ákám, pret. v. o ákálla ; o boyolla - o bollá  el anciano bendijo al niño. ákári, pret. v. o ákáIla ; to - mpári ayer bendecimos. 70. ákám. akátelessi, pret. v. o akátella ; e biulla be - a baísso  las doncellas guiaban a las mujeres. akátella , v. guiar, orientar; o waíribbo aó a la e - ello ebba  nuestro espíritu guardián nos guía cada día. Pret. akáteri, akátelessi. akáteri, pret. v. o akátella ; a bayol la ba áó ba e -  nuestros ancestros nos guiaron. akátessi, pret. v. o akátta ; a apanná ba - e esubba  los españoles iban delante en la época de lluvia. ir delante, destacar; o motóO bo la akátta , v.  el coche va delante. Pret. aká tyi, akátessi. akátyi, pret. v. o akátta ; e eos si -  el caballo fue delante. akea , v. atarse, endurecerse. Pret. akei, akeseei; n la sélla o -  me endurezco mucho. akeem,pret. v. o akella ; n -  até para alguien, o  ataste para alguien, a -  ató para alguien, to -  atamos para alguien, \0  atasteis para alguien, ba -  atar', NULL, 'Fuente: bubi-español', 'import-script'),
  ('akio', 'sing. réprobo, crítica. condena. el. 7 . akka , v. atar, ligar, liar, enfardar; 0-etebá endurecer el corazón, aguantar; - e  ete báo endurece tu corazón. Tb. o fóppa; - e etebáo  ¡aguanta!, o - e riakko  endurecer el incienso natural. casti gar. Pret. akki, akessi. akki, pret. v. o akka ; ti etébbáIÍ1 mi ánimo está bajo, mi corazón está atado. akkia , v. atar para, ligar para. Pret. akiia, akie siia; n la -  ato para, ligo para, o la -  atas para, ligas para, a la -  ata para, liga para, etc. akóIea , v. desligarse, desatarse. Pret. akólei, akóleseei; ti póríi e lá -  la cabra se desata. 62 / akólei akólei, pret. v. o akólea ; e setyi si -  el antílope se desató. akólesei , pret. v. o akólea ; e nabba e -  el animal se desataba akiilla , v. desatar, desligar, desembalar. Pret. akoom, akuessi; n la - o bO''Ml  desato mi fardo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ákóó', '¡oh!, ¡mil gracias!, ¡enhorabuena! akiiiim, pret. v. o akolla ; m bo - o bo''e  desaté el fardo. ákóra , v. perjudicar. Pret. ákória, ákóresiia. T b. o hákóra. ákóresiia, pret. v. o ákóra ; o le - la e nokonokko o  me perjudicabas con tu barullo. ákória, pret. v. o ákóra ; o wallá bo a bihó bo - e eriia  el grupo de los niños traviesos perjudicó al pueblo. akuessi, pret. v. o akolla ; e epo roporo e - a batyelemán  el guardia desataba a los presos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('akupí', 'pI. a) ofensas, afrentas. b) faltas de res peto, desobediencias. CI. 6 . Tb. apukké .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('alá', 'por; -Ruppé! ¡por Dios!', NULL, 'Fuente: bubi-español', 'import-script'),
  ('alabba', 'pI. las cosas; -Iá batyo las cosas de las personas, - lá Ruppé las cosas de Dios; Tb. apa rece bajo las formas labba de la Clase 6b, elabba de la Clase 7, bilabba de la Clase 8; e bilabba biá batyo las cosas de la gente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('alaiitya', 'primero, antes; alaba - lo primero, las primeras cosas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('alasubá', 'último, por último ale, suf. adv. también; 010 botyo - esta persona también. Tb . ae.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('alcalde', 'poderoso', NULL, 'Fuente: español-bubi', 'import-script'),
  ('alláa', 'transportar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('álle', 'también. Se utiliza sin morfema de CIa se: 010 botyo -  ésta es una perso na también, etc. alo, 1. adv. así, de esa manera; - kálo to la na''allá de esa manera lo queremos. 2. adj. dem. ese, esa, eso. Concuerda con las palabras de la CI. 6b; -Iab ba esas cosas, - la tyi labé eso no está mal, -la tyi lelle eso no está bien, -la pá''o sá eso puede ser. álo, mor{. adv. delante, delante de; belló boie ponte delante del señor. alolammaa, loe. conj. todo eso, por eso mismo.', NULL, 'Fuente: bubi-español', 'import-script'),
