  ('bo''á', 'de! agua salada. caldo, salsa. CI. 6; e súppu si okkíi - bíkebíke  la salsa tiene mucho caldo. bó''a , v. coger algo, tomar algo con la mano, sacar, liberar; o - boppé coger agua, o - ebari  acudir al botéribbo, o - bi''o despojar, coger, apartar. Pret. bó''i, bó''essi. biiallo / llS', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bo''e', 'fardo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bo''í', 'sing. putrefacción, podredumbre. Cl. 3 . bó''ía, pret. v. o bó''ia ; o boissó m bo - el fuego, lo encendí, ne - e láppo encendí la luz. bó''ia , v. encender, alumbrar, prender; o - o b iiissó  encender el fuego. Pret. bó''ía, bó''íesiia. bó''íera , v. encender para; n la - o bonánnaIÍl e láppo áí  a mi abuela le enciendo su luz. Pret. bó''íériia, bó ''íeresiia. bó''íeresiia, pret. v. o bó''íera ; o bosesepári a le - o boissó  la moza me encendía el fuego. bó''íeriia, pret. v. o bó''íera ; o bonánnalÍl n bii - e láppo áí  a mi abuela le encendí su luz. bó''íesiia, pret. v. o bó''ia ; o boissó m bo - el fuego, lo encendía.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bo''o', 'sing. calle, callejuela, avenida. CI. 3 . Tb . hokoo .', NULL, 'Fuente: bubi-español', 'import-script'),
