  ('boabba', 'repartidor', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Boabila', 'que debería escribirse Boabílla . Se localiza en Baney. biiabílla, 1. s. sing. palmeral. Cl. 3 . 2. antrop. localizado en Baney. Lleva el mismo significado que el sustantivo. Boahá , antrop. que debería escribirse Boa''á o bOakká . Se localiza en Basuala.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bOabílla', 'palmeral', NULL, 'Fuente: español-bubi', 'import-script'),
  ('boake', 'pI. partos, dolores de parto. Cl. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
