  ('bOallo', 'leñera', NULL, 'Fuente: español-bubi', 'import-script'),
  ('boalOri', 'sing. ceremonia ofrecida al difunto al tercer día de ser enterrado. En ella se prepara un gran ágape en el que participan todos y es presi dida por los familiares más directos. eL 3 . Tb. liiátóra. bóám, pret. V. o bóálla ; o bOie a le - o bOllá el hombre quitó al niño.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boambó', 'sing. natural de Annobón , annobonés, ámbo. eL 1 . Tb. Mhahá . boán, pret. V. o boánna ; o le - i kaaí me liberaste de las enfermedades, e kobinna a le - i tyokko lÍl  el gobierno me arrebató mi dinero]. boánessi, pret. v. o boánna ; a batyo ba - o a lokko lá bo [a batSo ba bóánesso á lokko la bOl a las personas les des prendían de sus cosas. boánna , v. liberar de, desprender de, arrancar de, arrebatar, despojar. Pret. boán, boánessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boaó', 'sing. deuda. gasto. eL 3 ; n okkí - wa mpuallo  tengo una deuda excesiva .', NULL, 'Fuente: bubi-español', 'import-script'),
