  ('boatyó', 'sing. buitrón. eL 3 ; o - el buitrón, bOlo - este buitrón, - bo e bullé  un buitrón.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boaúri', 'sing. claridad del día, a mediodía. eL 3 . Boba, an/rop. que significa tierra . Aplica do a las personas, se refiere a alguien que recibe. Se localiza en Baney. bobalessi, pret. V. o boballa ; n  me emborrachaba, o -  te emborrachabas, a -  se embo rrachaba, to -  nos emborrachába mos, 10 -  os emborrachabais, ba  se emborrachaban.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobaeba', 'sing. cucaracha. CI. 3 . Tb. ehMmo , bOebaeba . bóbeé, int. ¡oiga!, ¡oye!', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobali', 'bobalicón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('boballá', 'sing. humildad, modestia. eL 3 . boballa , V. emborracharse, embriagarse. Tb. o nkóba, o ribbá. Pret. bobari, bobalessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobao', 'sing. calva, calvicie. eL 3 . bobari, pret. V. o boballa ; n -  me emborraché, o -  te emborra chaste, a -  se emborrachó, to -  nos emborrachamos, 10 -  os em borrachasteis, ba -  se emborracharon.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobari', 'sing. bebedor. eL 1 . Tb. Mebba .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobb', 'hedor', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bobba', 'sing. suelo. país, tierra. eL 3 ; - wá botyo  la Bobuaumala / 117 tierra de uno, el país de uno; o - we Guinea Ecuatorial el país guineoecuatoriano. bóbba , v. ladrar, vociferar; e puá e la -  el perro ladra, 010 botyo a tá okkíi tyá 0- esta persona no hace más que vociferar. Pret. bóbbi, bóbessi. bobbáa , v. calmar, tranquilizar, conven cer; o - bóllá calmar a un niño. Pret. bobbí, bobessi. bobbe, arij. pI. macho, varón. Concuerda con las palabras de las Cls. 2 y 6: a bollá -  los hijos varones.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobbe', 'sing. 1. esposo, marido. CI. I . 2. macho, varón. Concuerda con las palabras de las Cl. 1 y 3: bollá -  hijo varón; bobbé -  árbol estéril de la atanga.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobbé', 'sing. árbol de la atanga, ciruelo. Cl. 3 . bobbí, pret. v. o bobbáa ; la o boatta lÍl m - a batyo bammaa  con mi his toria convencí a todas las personas. bóbbi, pret. v. o bóbba ; e puá e - bó botyíó  el perro ladró anoche.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobbo', 'pi. amuletos, fetiches. ritos, cere monias. Cl. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
