  ('Bobepari', 'formado por los términos bObbe y pári . Bobepári se refiere a alguien que ha llega do a su meta. Se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boberi', 'pI. pagadurías. pagadores. Cls. 6 y 2 . Tb. baoberi .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boberibbo', 'sing. espíritu guardián. hom bre que vela por alguien. protector. CI. I . bobessi, pret. v. o bobbáa ; o boie a - o bosesepári a bo lokanne  el hom bre convencía a la moza para acostarse con ella. bóbessi, pret. v. o bóbba ; e puá e -  el perro ladraba, 010 botyo a - esta persona vociferaba.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobetyoru', 'pi. carneros. Cl. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bobó', 'sing. duro, fuerte, poderoso. Concuerda con las palabras de las Cls. 1 y 3; o boitta - el jefe valiente, o boatta - la noticia interesante.', NULL, 'Fuente: bubi-español', 'import-script'),
