  ('bobora', 'sing. heredero, descendiente. CI. I . bobora , v. abrir grandemente los ojos , asombrarse. Pret. boboriia, boboresiia. boboresiia, pret. v. o bobora ; i nokkolÍl ni - yo me asombraba.', NULL, 'Fuente: bubi-español', 'import-script'),
