  ('Bobuakasi', 'formado por los términos bObbó y o ekasá . Puede traducirse por persona fuerte y ob servadora. Se localiza en Basakato de la Sagra da Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bobuanmala', 'que significa "la persona que va detrás de las piernas". A partir del verbo búbuanna y del sustantivo maálá se ha podido construir dicho antropóni mo. También significa "persona pobre hecha go bernante". Se localiza en Batoicopo. 1 1 H / hiihudl''ssi bobuelessi, prel v. o b6buella ; e rokút ta ri - e erutta  el médico palpaba el cadáver. bobuella , v. palpar; e ebOráookko e lá - o luua  el ciego palpa el tejido.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bobuelobo', 'que se obtiene a partir de la expresión bO bó ''a elabo . Debería escribirse Bobo''élObo. Se localiza en Bariobé. bobueri, pret. v. o bobuella ; o - e sottelÍl  yo palpé mi camisa. Bobuiché , antrop. que se obtiene a partir de la expresión bO bó ''a i tyé  . Debería escri birse Bobó''ityé. Se localiza en Rebola yen Basa kato de la Sagrada Familia. Bochapa , antrop. que se refiere al árbol de las suelas . Debe ría escribirse Botyappa. Se localiza en Rebola. Bochika , antrop. que debería escribir se Botyikka . Se localiza en Ba toicopo. Bochita , antrop. que se construye a par tir del verbo o tyitá . Debería escribir se Botyitá . Está localizado en Rebola. Bochopi , antrop. que se obtiene a partir del verbo o tyoppáa . Debería escribirse Botyopíi . Se loca liza en Baney. Bocosa , antrop. que debería escríbirse Bookossa , del verbo o akOssa . Se localiza en Bakake.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boé', 'sing. alma, espíritu, fantasma. el. 3 . Tb . moé. boea , v. afeitarse, cortarse el pelo. Pret. boei, boeesei .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boebaeba', 'sing. cucaracha. el. 3 . 10. ehMmo , bObaeba .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boebba', 'sing. persona que asiste a la mis ma reunión que otra. contertulio. el. 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
