  ('bOée', 'sing. miel. el. 3 . boeesei, pret. v. o boea ; elo ebari o - la siObbá  esta mañana me afeitaba con una cuchilla. boei, pret. v. o boea ; o - sé sibél1ó  me afeité hace un momentito.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('boekká', 'sing. 1. persona del clan de los gober nantes. 2. también es el nombre de un árbol gran de de hojas pequeñas. el. 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
