  ('Bokumá', 'análogo a bokubó, pero en este caso Biikúma se refiere a una pared que frena. Si se aplica a la persona se referirá a alguien que evita e interrumpe. Escrito Biikúmá significará "huerto"). Está localizado en Ruiché.', NULL, 'Fuente: bubi-español', 'import-script'),
