  ('bOlebóri', 'sing. 1. memoria, talento, ingenio, conciencia, recuerdo. 2. conocimiento. Cl. 3 . Boleche , antrop. formado a partir de la expresión bO olláa e tyé  . Debería escribirse BoIetyé. Está localizado en Moka y Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
