  ('bOleké', 'sing. mareo. trastorno mental. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bolekia', 'construido a partir del verbo o lekkia . Deberla escribirse Biilekia . Está localizado en Baney y en Basa kato de la Sagrada Familia. bOlekia, 1. s. sing. organizador, persona que diri ge u ordena, dirigente. Cl. 1 . 2. antrop. Se escribe Bolekia y se localiza en Baney y Basakato de la Sagrada Familia. bOlekka, 1. S. sing. persona que se pone en fila, persona dirigida. 2. antrop. que se escribe Boleká en castellano. Cl. 2 .', NULL, 'Fuente: bubi-español', 'import-script'),
