  ('Boleko', 'que hace referencia a las personas que custodiaban la arcilla sagrada de los orato rios bubis. También se refiere al guardián del ave bOleko . Está localizado en Basupú y en Sampaka . bolela , masticar para, rumiar para; o - pokom ma armarle la bronca a alguien. Pret. bOléri, bOlé lessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bOlele', 'sing. línea, raya. CI. 3 . Ej . e.xpr. o - bo''otya la primera línea. bolelessi, pret. v. o bóléla ; n -  masticaba para, o -  masti cabas para, a -  masticaba para, to  masticábamos para, 10 -  masticabais para, ba -  masti caban para.', NULL, 'Fuente: bubi-español', 'import-script'),
