  ('bOleppo', 'sing. espejo, cristal. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bOleri', 'sing. víctima. Cl. I . boleri, pret. v. o bóléla ; e puá e e sinoke o bokobbe  el perro masticó para el cachorro el plátano. bóleseei. pret. v. o bóléa ; a batyo ba - la ketya  las per sonas se abanicaban con helechos. bolessi, pret. v. o bolla ; e bihMma bi - e esubba  los frutos se pudrían en la época lluviosa. bOlessi, 1. pret. v. o boláa ; e somíoko si -  el gallo can taba. 2. pret. v. o bollá ; o bohiárúppe a le - e bilabba bi á o bokonno  el sacerdote me decía las cosas del MArs. bolessi, pret. v. o bólláa ; n -  masticaba, o -  masticabas, a -  masticaba, to -  masticába mos, lo -  masticabais, ba -  masticaban. bólessi. pret. v. o bólláa ; a batyo ba - i húúa  las personas aba nicaban al público.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Boleté', 'cuyo significado se relaciona con alguien que hace las cosas bien. También signifi ca saltamontes. Debería escribirse BOlete. Está localizado en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bóll', 'chaval', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bollá', 'sing. niño, hijo, muchacho, chaval, crío, prole. CI. 1 . Tb. boláe. bolla , v. pudrirse, fermentarse. Pret. bori, bolessi. Tb . o booa. bollá , v. decir, notificar, avisar. Pret. borí, bOléssi. lb. o túbaera.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bolláa', 'sing. portador, acarreador. Cl. 1 . bolláa, 1. s. sing. follón, jaleo. Cl. 3 . 2. - , v. cantar el gallo, piar. Pret. boríi, boléssi. bolláa , v. masticar, rumiar; n la - pokomma  mastico granos del paraíso. Pret. bOríi, bóléssi. bólláa , v. abanicar; o oberíi a la - o bOllá  la madre abanica al niño. Pret. bóríi, bóléssi.', NULL, 'Fuente: bubi-español', 'import-script'),
