INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('Boquetale', 'que debería escribirse Boke tale . Se localiza en Rebola. bora , v. pudrir, hacer pudrir; e húé e lá - ii boÓlrnua  el calor hace pudrir la carne. Pret. boriia, boresiia. bóra , v. alquilar. Pret. bóríia, bóresiia. Tb . o re1Ítibbia.', NULL, 'Fuente: bubi-español', 'import-script'),
