  ('Borabote', 'Construido a partir de o bora y Mtté . Borabiitté se refe rirá a aquella persona encargada de hacer desapa recer un árbol sin necesidad de talarlo. También se refiere a una persona enormemente orgullosa. Está localizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
