  ('borentya', 'sing. naranjo. CI. 3 . Tb. opippo . bóresiia, pret. v. o bóra ; ii waíssii a - e tyóbbo áí  la mujer alquilaba su casa. boresiia, pret. v. o bora ; e esubba e - billo  la época lluviosa hacía pudrirse los ñames.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bori', 'relacionado con bóri o con boorí . Se localiza en Sampaka . bori, pret. v. o bolla ; a lokkoÓl larnrnaa la -  todas mis cosas se pudrieron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('borí', 'sing. rico, adinerado. Cl. l . borí, pret. v. o bOllá ; ii biityii a e epatto a''a le -  el vecino me avisó.', NULL, 'Fuente: bubi-español', 'import-script'),
