  ('Boriesá', 'que puede traducirse por "al guien que suele ser dignatario de un pueblo". Está localizado en Rebola. boríi, pret. v. o bolláa ; e siirníOkii si tá -  el gallo no cantó. boríi, pret. v. o bólláa ; o boyol la a - i pornrna el abuelo masticó los granos del paraíso. bóríi. pret. v. o bólláa ; a batyo ba - o biihítáari  las personas abanicaron al rey. boriia, pret. v. o bora ; e bihMrna bi o bomrnáliitii rn bi  las piñas del cacao los hice pudrir. bóríia, pret. v. o bóra ; rn - ii rniitóii lÍl  alquilé mi coche.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Borikó', 'que se forma a partir de eriko . Este antropónimo se apli ca a las personas retorcidas y de carácter com plicado. Está localizado en Baney, Bahó y Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('borikora', 'sing. acusador, denunciante, delata doro Cl. I . bosawasawáa / 131 borikuera, s sing. 1. denunciante, acusador. 2. fiscal. el. l .', NULL, 'Fuente: bubi-español', 'import-script'),
