  ('Boya', 'que se forma a partir de buiá . También parece formarse a partir del verbo o ó ''ia . Escrito Bó''ia significará "persona que entiende" o "hace entender". Está localizado en Rebola. bóyállo, pret. v. o bóallo ; n ka o -  yo te saludé, n bo -  yo le saludé.', NULL, 'Fuente: bubi-español', 'import-script'),
