  ('buáám', 'sing. finca, campo. huerto. CI. 3 . Tb . báám.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buabaila', 'que se forma a partir de la expresión o bó ''a a bailá . Apli cado a las personas, se referirá a los analistas clí nicos. Está localizado en Rebola. Buachá , antrop. formado a partir de bO''atya . BO''atya es aquella persona que ayuda a alguien, le aúpa. Está localizado en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
