  ('Buala', 'formado a partir de wallá . Debería escribirse Buallá. Está localizado en Balachá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buale', 'que se refiere al árbol de la falsa cola . También puede traducirse por "fardo", "carga". En este último caso se escribirá Bo''aale. Está localizado en Baney y en Batoicopo. bualeem, pret. V. o bualella ; n la o beteIla obari o le - e bilabba  te espe ro mañana para que me cuentes las cosas en secreto. bu aleles si, pret. V. o bualella ; a batyo ba - a séi la abo o boitta  las per sonas cuchicheaban mientras estuvo allí el go bernador. bualella , V. hablar en secreto, cuchichear, hablar en voz baja. Pret. bualeem, bualelessi. UN I IJlllIll''ssi bualessi, ,,¡-<''l. 1''. II bual láa ; i puá i e tyal lá  los perros morían de hambre. buálessi, pret. v. o buálla ; m - lo lá o séí o bessé  cuando me criaban estaba en el pueblo.', NULL, 'Fuente: bubi-español', 'import-script'),
