  ('bualle', 'sing. 1. falsa cola . 2. antrop. escrito Buale. el. 3 . bu alIé, s. sing. enfado, enojo, descontento. el. 3 ; oe - sóté estoy muy enfadado.', NULL, 'Fuente: bubi-español', 'import-script'),
