  ('bueDDa', 'sing. grano en la cara. espinilla. orzuelo el. 3 . Buenohala , antrop. que puede tradu cirse por "alguien que me entiende" o "persona de fácil entendimiento". Parece provenir de bO e ne oálla. Debería escribirse Buenóalla. Está localizado en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buehá', 'sing. árbol que da el fruto llamado rehá parecido al melocotón. Cl. 3 . Tb. wehá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buehe', 'sing. envidia. odio. bejuco venenoso. Cl. 3 . buéi, pret. v. o buáa ; e elotyí e mpári  el siervo murió ayer, o oberíi lÍ1 a - ello esubbá ó buéá  mi madre murió el último día del mes. Bueichekú , antrop. formado a partir de la estructura bO ekkáa i tyekkú . Deberia escribirse Bue''ítyek kú. Está localizado en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bueka', 'sing. controversia. disputa. cuestación. Cl. 3 ; o peta -  contradecir, disputar, cuestionar. Tb. weka, buekka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buekéke', 'sing. caracol pequeño. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buekka', 'sing. Véase bueka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buekke', 'sing. árbol del serbal. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bueko', 'que deberia escribirse Boeko . Está localizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buel', 'otra', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buela', 'dentro de, en; e tyóbbo - dentro de la casa, e eriia -  en el pueblo. buelálabbé, 1. s. sing. desdicha, desgracia, infortunio. Cl. 3 . Tb. bOho''o . 2. adj. sing. desdichado, desgraciado, desafortunado. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buelálabb', 'desafortunado', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buelálelle', 'sing. dichoso, afortunado. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buele', 'que debería escribirse Boele . Se refiere a una persona pasiva o apática. Está localizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buelebó', 'construido a partir del verbo o bó ''a y el sustantivo elebbó . Debería escribirse Bo''elebbó . Está loca lizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buelekope', 'que se forma a partir de o elláa y kOppé . Debería escribirse Bue lékoppé . Está localizado en Bariobé y en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buelello', 'sing. deseado, amado. CI. I . buelessi, pret. v. o buelláa ; a baseseppe bá o bokonno ba - e bilabba bi á etyo  los jóvenes del maib morían por las cosas de la tradición. buelessi, pret. v. o buelláa ; o waísso l Í 1 m bO - e bihattá bimmaa  a mi mujer le decía todos los secretos. buellá, 1. s. sing. lágrima. Cl. 3 . 2. adj. indo otro, otra. Concuerda con las palabras de las Cls. 1 y 3; botyo - otra persona, bOatta otra historia. buellá, S. sing. vientre, barriga, panza. CI. 3 . buelláa , v. morir por alguien o por algo. Pret. bueríi, bueléssi. buelláa , v. avisar, comunicar, decir, objetar; we le buellee ollé nnálle  no me digas nada. Pret. bueríi, bueléssi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buell', 'panza', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buello', 'sing. 1. límite, frontera. 2. horizonte. CI. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buéllo', 'sing. pelea, disputa, contienda, camorra, combate. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buelo', 'que significa "límite", "frontera" . Está localizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buelo''o', 'sing. escorpión, langosta terrestre. Cl. 3 . Buelohá , antrop. que parece haberse construido a partir del sustantivo elo ''á . Debería escribirse Buelo''á . Está localizado en Basupú, en Batoicopo y en Baloeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buelope', 'cuyo significado hace referencia a la fu erza del bambú . Está localizado en Baloeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buem', 'sing. vino . Cl. 3 . Tb. wem , wüówíllo . 140 / bueDDa', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buena', 'avaricia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buenna', 'orzuelo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bueno', 'buen', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buenos', 'amorcito', NULL, 'Fuente: español-bubi', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('Buepano', 'cuya forma es bOepanno . Boepan no se refiere a alguien que siembra o planta el primero. Está localizado en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buepeppe', 'sing. planta de la berenjena. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buepoyó', 'Que debería escribirse Buepo yó . Significa "alguien que ha llegado". Está localizado en Basupú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buepp', 'pereza', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bueppo', 'sing. banquero. el. 1 ; i tyokko i o -  el dine ro del banquero.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buera', 'sing. quinientos. *mil. el. 3 . Tb. buerá . buera , V. alumbrar, iluminar, lucir. hallar, descubrir. Pret. bueriia, bueresiia. bueresiia, pret. V. o buera ; i láppo yá e eriia i - a batyo  las luces del pueblo alumbraban a las personas .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buerá', 'numo sing. quinientos. *mil. el. 3 . Tb. buera .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buerí', 'sing. hormiga grande y roja. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bueriberi', 'que se forma a partir de o bue ra i berí . Debería escribirse Boeríiberí. Está loca lizado en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buericopá', 'que se forma a partir del ver bo o buera y del sustantivo plural i koppá . Está localizado en Sampaka . bueríi, pret. V. o buelláa ; a ba seseppe bá - o walIá bo bokono  los jóvenes murieron por el grupo de la planta del maiz. bueríi,pret. V. o buelláa ; n-o bona tú''o ró ná o la púlóo  le dije a mi hermano mayor que venías. bueriia, pret. v. o buera ; e ehMma wela e tomólekke e le -  en la oscuridad la luciérnaga me alumbró.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buesee', 'sing. mosca jenjén. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buéso''o', 'sing. compañero, amigo, colega. el. 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buesobí', 'que debería escribirse BO''esobí . Se refiere a alguien que obra con rectitud. Está localizado en Basupú. buessi, pret. V. o buáa ; m - yo fallecia, o - tú fallecías, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buesuessu', 'sing. seta. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buesule', 'construido a partir de súlléii . Se refiere a alguien difícil de ver. Debería escribirse Buesúllée. Está localiza do en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bueta', 'formado a partir de bO''etta o de wetta . Está loca lizado en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buetáa', 'sing. inteligencia, mente. el. 3 . Tb. bOkuppá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buétáa', 'sing. inteligencia, conocimiento, men te; o bosalelle e - boto el bienhechor es muy inteligente. el. 3 . Tb. buitáa .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bueták', 'rector', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buetákíó', 'sing. rector. destacado, man damás. el. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buetta', 'sing. hermana, prima. el. 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buettya', 'sing. cabaña, choza, barraca. el. 3 . buetyekú, 1. s.fr. eres un ombligo. 2. antrop. efr. Bueichekú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buetyetyú', 'sing. lagarto, lagartija, sabandija. el. 3 . Tb. wetyetyú , esolésóli .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buetyíi', 'sing. silbido. el. 3 ; o - wá botyíó el silbido de la noche.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buhá', 'sing. hueso. el. 3 . Buhauri , antrop. que hace referencia al seguidor del personaje mitológico femenino Úri. Debería escribirse Boaúri. efr. Bohauri. Está localizado en Basupú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bui''é', 'sing. árbol de la nuez de cola. el. 3 . .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bui''o', 'sing. 1. señal, marca. 2. lunar, peca. el. 3 . Tb. bOi''o.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buía', 'sing. 1. finca de ñames. 2. muladar. 3. fin ca, bosque, campo. el. 3 . Bula / 141', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buih', 'díscolo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buihero', 'sing. preguntón. demandante de información. Cl. 1 . buihó, 1. s. sing. rebeldía, travesura, testarudez. 2. adj. cabezudo, cabezota, desobediente. Cl. 3 . Tb. wihó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buihéro', 'preguntón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Buika', 'que se forma a partir del verbo o ikka . Se refiere a alguien que insulta o maldice. Boikka está localizado en Rebola y en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buíki', 'sing. semana. mecha. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buikila', 'que se obtiene a partir del verbo o ikílla . El término Buikila se referirá a alguien que se mueve mucho. Boikí1la se refe rirá, pues, al movimiento. Está localizado en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buikka', 'sing. soporte, horca, sostén, etc. Cl. 3 . Ej . expr. boie ká - wá etob ba  el hombre es el soporte de la calabaza.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buiko', 'que se refiere al árbol del salchi chón . Está localizado en Bakake.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buila', 'que se forma a partir del verbo o illa . Se refiere a alguien a quien se echa de menos. Está localiza do en Batete y en Baloeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('builló', 'sing. negro, oscuro. Concuerda con las palabras de las Cls. 1 y 3; bOtyo - persona negra, bonkinki - abejorro negro. Builojori , antrop. formado a partir de Millo y o Mlláa . Bo¡¡ohórü se referirá a aquella persona a quien le gusta la limpieza. Está localizado en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buióta', 'sing. ventana. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buíríi', 'sing. salida. evasión, huída. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buitrón', 'buitre', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buítya', 'sing. flato, pedo, ventosidad. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buityíi', 'sing. hermano menor. el. 1 . 2. adj. menor.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buiyabán', 'construido a partir de buía y o iábanna . Este antropóni mo puede traducirse por "exceso, resto". Está localizado en Rebola. bukessi, pret. v. o bukka ; n-a batyo e ehMma wela  hacía cosquillas a las personas en la oscu ridad. Tb. tekessi. bukessi, pret. v. o bukká ; m abundaba, o - abundabas, a - abundaba, etc.; i bonní i -  el dinero abundaba. búkessi, pret. v. o búkka ; IÍlmalé i - i pókkó  antaño abunda ban los bueyes. bukiesiia, pret. v. o bukkiáa ; a abieri ba - a bOllá e erüa wela  los nacimientos incrementaban el número de niños en el pueblo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bükckc', 'zurdo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bukk', 'nicho', NULL, 'Fuente: español-bubi', 'import-script'),
  ('bukká', 'sing. agujero. nicho. el. 3 . Tb. bOlló . bukka , v. hacer cosquillas. Pret. bukki, bukes si. Tb. o tekka. bukká , 1. v. abundar. 2. sobrar. Pret. bukkí, bukessi. búkka , v. abundar; o tuáppo to lá sélla 0 ripottb  las tien das abundan mucho en la ciudad. Pret. búkki, búkessi. bukki, pret. v. o bukka ; o bulla a la ooatooa kóri o bo -  la doncella se ríe porque le hice cosquillas. Tb. tekki. búkki, pret. v. o búkka ; i kóllá ¡-e esubba  las lluvias abun d a n en la época lluviosa. bukki, pret. v. o bukká ; m - abun dé, o - abundaste, a - abundó, etc.; i tyokko i - e etúllá wela a Bioko  el dinero abunda en la isla de Bioko. bukkia, pret. v. o bukkiáa ; e kbbinna a - e beobbo be a batyo  el gobierno aumentó los sueldos de la gente. bukkiáa , v. acrecentar, incrementar, aumen tar; o mmásalÍl a la - e ripeám ri áó  mi jefe aumenta nuestra paga. Pret. bukkía, bukiesiia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bukkio', 'pI. ronquidos. el. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bukku', 'sing. selva. el. 3 . Tb. bu''u .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bula', 'obtenido a partir del verbo o bulla . Bulla se refiere a alguien que defiende o protege, o a la doncella casadera 142 / nuhí que VIW lodavía su periodo IIlICláhco. Está loca lizado en Moka.', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('Bulá', 'que significa "tormenta" o "tempes tad". Bullá se aplica a aquella persona bastante f uerte. Está localizado en Balachá, Belebú y Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bulabaté', 'formado a partir del verbo o bulla y del sustantivo batté . Bulabaté se aplica a la persona que defiende los árboles. Está localizado en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bulabulla', 'sing. 1. mes de octubre. 2. tempes tad. Cl. 3. bulaelessi, pret. v. o bulaella ; n -  defendía, o -  defendías, a -  defendía, to -  defendíamos, 10 -  defendíais, ba -  defendían. bulaella , v. defender, proteger; to la - e bilabba bi áó  defendemos nuestros asuntos tradicionales. Pret. bulaem, bulaelessi. bulaem, pret. v. o bulaella ; n - e tyóbbo o bOieo)  defendí la casa de mi padre.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bulé', 'numo uno, una. Concuerda con las pala bras de las Cls. I y 3; bOtyo - una persona; bom po - una nariz.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bule''o', 'pi. tapones de corcho. Cl. 6 ; a - bá e bekoteri  los tapones de corcho de las botellas. bulea , V. salvarse, defenderse; alebbáa a la alo a pa''a lá  cada uno se defiende como puede, n ta pityi o -  no pude defenderme. Pret. bulei, buleseei.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bulebiele', 'formado a partir del verbo o bulla y de la expresión Melle . Bullebe''ele se traducirá por "defensor de quien llo ra por algo". Está localizado en Belebú y Ruiché. Buleché , antrop. obtenido a partir del verbo o bulla y el sustantivo e tyé . Buletyé se aplica a quien defiende el poblado o el país. Está locali zado en Balachá. bulei, pret. v. o bulea ; n  me salvé, o -  te salvaste, a -  se salvó, to -  nos salvamos, 10  os salvasteis, ba -  se salvaron. bulelessi, pret. V. o bulella ; n a batyo ba ta okkí ba bekutta  yo abrigaba a las per sonas que no tienen mantas. bulella , V. abrigar, proteger; n la - o botyolÍl  protejo ami pariente. Pret. buleri, bulelessi. buleri, pret. V. o bulella ; n bo o boyolla IÍI  yo abri gué a mi abuelo. buleseei, pret. V. o bulea ; n -  me salvaba, o -  te sal vabas, a -  se salvaba, to -  nos salvábamos, 10 -  os salvabais, ba -  se salvaban. bulessi, pret. V. o bulla ; a bakuerakueráa ba - a basoppo  los alumnos se disputaban los panes. bulessi, pret. v', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bulla', 'sing. doncella, joven casadera. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bullá', 'sing. cintura. Cl. 3 . 2 S. sing. y pi. tempestad, tormenta, borrasca. Cls. 9 y 10. Tb . pullá. bulla , V. salvar, proteger, defender. dis putar. prohibir. Pret. buri, bulessi. bulláa , V. buléssi. perforar, agujerear. Pret. buríi,', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bulló', 'sing. azul, azul para la ropa. Cl. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Buna', 'que debería escribirse Bonná . Se localiza en Bilelipa y en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bünlyi', 'vena', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Bunuku', 'escrito Bonokko . Aplicado a las personas, se referirá a alguien fuerte, intrépido, etc. Está localizado en Sampa ka .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bupabote', 'que se forma a partir de buppá y bOtee . Debería escri birse Bupábotee . Está localiza do en Bariobé. buutyi / 143', NULL, 'Fuente: bubi-español', 'import-script'),
  ('bupp', 'gresca', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buppá', 'sing. estrépito, ruido, gresca, barullo, baraúnda. C. 3 . Tb. bOmpá , v. bempá), bOtyípótyípóo , kípáám. 1. mandar agujerear, perforar. 2. 0 tooa  hacer reír, bromear. Pret. burÍa tooa, buresíá tooa. 3. calentar; o la - a boppé bá o wetta o  tú calientas el agua de tu hermana. 4. favorecer. Pret. buría, buresiia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bureleke', 'obtenido a partir del verbo o buráa y eleke . Debería escri birse Buréleke . Está localizado en Riaba. buresiia, pret. v. o buráa ; n i i tyallálÍl  mandaba aguje rear mis chapas de zinc; 10 - a bo''á  vosotros calentabais el agua salada. burl, pret. v. o bulla ; o le - la o to''ú o, la o buétáa o  me salvaste con tu fuerza, con tu inteli gencia. buría, pret. v. o buráa ; e rokútta a - tooa  el médico hizo reír; m - a boppé o  yo calenté tu agua. buríi, pret. v. o bulláa ; e etélÍl emmaa n e -  toda la olla lo agujereé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('burú', 'sing. noticia, chisme. CI. 3 ; - obé una mala noticia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('buruburu', 'párpados. Clases 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('busollo', 'pI. purgantes. CI. 6 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('butá', 'pi. aceite de palma, aceite de oliva. crema. CI. 6. Tb. biitá, bahNtá, mitá, matyátya. butólla , v. perforar, agujerear, taladrar; n la - pussa agujereo una aceitera. Pret. butóm, butuessi. destripar; o boie IÍI a la - o buellá bo e pórü  mi padre destripa a la cabra. butóm, pret. v. o butólla ; e etélÍl emmaa n e -  toda la olla lo agujereé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('butt', 'cólico', NULL, 'Fuente: español-bubi', 'import-script'),
  ('buttú', 'cólico, indigestión. Clases 9 y 10 . Tb. putyú. butuessi, pret. v. o butólla ; n - i pussa kubbaa  agujereaba todas las aceiteras. butyesiia, pret. v. o buutya ; o le -la e bisoí o  me enre dabas con tus mentiras. butyiia, pret. v. o buutya ; n  enredé, o -  enredaste, a  enredó, to -  enredamos, 10 -  enredasteis, ba -  enre daron.', NULL, 'Fuente: bubi-español', 'import-script'),
