INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('ebatto', 'sing. rito antiguo que consistía en rociar con agua fría la cabeza de un niño por la mañana, como paso previo a su fase iniciática. bautismo. CL 7 . Tb. boppé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebátya', 'sing. aflicción, pena, congoja. drama, tragedia. CL 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebatyabatyáa', 'pi. picazones. Cl. 4 . Tb. mebáñtya .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebatyo', 'pI. costillas. Cl. 4 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebátyo', 'sing. aplauso, palmada. Cl. 7 . Tb. ebasso .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebatyú', 'sing. cola CL 7 . Tb. mbatyú. ebba , v. despertar, levantar; n la - yo despierto, n la - o bOllá  yo despierto al niño, bO o bOllá  despierta al n iño, we bo ebbe no le despierte, we ebbo bollá no despiertes al niño. Pret. ebbi, ebessi. Tb. o nebba. ebbá , v. hartarse; n la o -  me har to de ti. Pret. ebbí, ebéssi. ebbáa , v. descansar, reposar; n la - obari des canso mañana. Pret. ebbí, ebéssi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebbé', 'sing. mal, desgracia. Cl. 7 ; e -  el mal, la desgracia, e - ro  mi desgracia, mi maL ebbi, pret. v. o ebba ; e noko noko e bo  - el ruido le despertó. Tb. nebbi. ebbí, pret. v. o ebbáa ; n -  des cansé, o -  descansaste, a -  descan só, to -  descansamos, lo -  des cansasteis, ba -  descansaron. ebbí, pret. v. o ebbá ; n-la o bora''o  me harté con la comida. ebbia , v. afirmar, estar de acuerdo; n la estoy de acuerdo, n ta -  no estoy de acuerdo. Pret. ebbiia, ebbiesiia. ebbiá , v. hartar; e billo bi lá - los ñames har tan. Pret. ebíía, ebiésiia. ebbiera , v. aprobar, aceptar; a batyo ba lá e bilabba bi lá héttá bi é  las personas aprueban las cosas que suceden. Pret. ebbieriia, ebbieresiia. ebbieresiia, pret. v. o ebbiera ; n-e ette  aceptaba la ley, 0 e ette  aceptabas la ley, etc. ebbieriia, pret. v. o ebbiera ; n ka - e bilabba  acepté los asuntos, o''a - e beatta  acep taste las historias, etc. ebbiesiia, pret. v. o ebbia ; n-estaba de acuerdo, o - estabas de acuerdo, etc. ebbiia, ', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebé', 'malo, mala, feo, fea. Concuerda con las palabras de la CL 7; eriia - pueblo malo, pueblo fe o. ebea , v. despertarse; n la - la e bikukuu  me despierto con los truenos. Pret. ebei, ebesei . Tb. o nebea.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebébá', 'sing. caza, cacería. Cl. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebebba', 'sing. caza. Cl. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
