  ('ebebo', 'sing. labio. Cl. 7 ; e  el labio, e - ro  mi labio. ebei, pret. v. o ebea ; n -  me desperté, o -  te despertaste, a -  se despertó, to -  nos despertamos, 10  os despertasteis, ba -  se des pertaron. Tb. nebei.', NULL, 'Fuente: bubi-español', 'import-script'),
