  ('ebell', 'entonces', NULL, 'Fuente: español-bubi', 'import-script'),
  ('ebéló', 'sing. 1. tiempo, momento, ocasión, plazo. CL 7 - ee  buen tiempo, ebé rebeló ébe] mal tiempo. 2. adv. antes, al princi 152 / cbcpc pio, siempre, vez; - eiitya  al principio, - emmaa  siempre, há la sá - algu na vez, una vez. 3. menstruación e - o bOie e tyá pooa tyommaa  la menstruación del hombre nunca llega. ebepe, 1. s. sing. berenjena. CI. 7 . 2. antrop. berenjena. Tb. epeppe .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Ebepé', 'que se refiere a la berenjena. Debería escribirse Ebepe. Se localiza en Basaka to de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
