  ('eberíi', 'sing. don . CI. 7 . ebesei, pret. v. o ebea ; n -  me despertaba, o -  te despertabas, a  se despertaba, to -  nos des pertábamos, lo -  os despertabais, ba  se despertaban. Tb. nebesei. ebessi, pret. v. o ebba ; n -  yo despertaba, o -  tú desperta bas, a -  él despertaba, to -  nosotros despertábamos, \O -  vosotros despertabais, ba -  ellos despertaban. ebessi, pret. v. o ebbáa ; n -  yo descansaba, o -  tú descansabas, a  él descansaba, to -  nosotros descansábamos, \O -  vosotros descan sabais, ba -  ellos descansaban. ebessi, pret. v. o ebbá ; a batyo ba - la o ráa  las personas se har taban de comer.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebéto', 'sing. himno. el. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
