  ('Ebiaca', 'localizado en Belebú. Cft: Ebiaka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Ebiaka', 'que parece haberse construido a partir de e biaká . También parece haberse obtenido a partir de e beakká . Debería escribirse Ebiakká. Está localizado en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebiasso', 'sing. majestad, alteza. CI. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ebie', 'dem. esos, esas. Concuerda con las pala bras de las CI. 4 y 8; - besorí esos hilos, esos cor dones, - bisomme esas malas acciones. ebiesei, pret. v. o ebea ; n -  me despertaba, o -  te desper tabas, a -  se despertaba, to -  nos despertábamos, \O -  os despertabais, ba -  se despertaban. ebiesiia, pret. v. o ebbiá ; i kollo i -  las sardinas hartaban. ebíía, 1. s. pi. botellas de cerveza. CI. 4 . 2. pret. v. o ebbiá ; a bo''á ba le -  el agua salada me hartó.', NULL, 'Fuente: bubi-español', 'import-script'),
