  ('ebuttá', 'sing. sombrero, gorra Cl. 7 . Echikó , antrop. que hace referencia al tronco del que ya no brotará ningún retoño. Debe ría escribirse Etyikkó. Se localiza en Batoicopo. Echuaka , antrop. formado por etyue y á ka . Debería escribirse Etyuáka . Se localiza en Bakake, Basakato de la Sagrada Familia y Bahó. Echube , antrop. que debería escribirse Etyubbe . Se localiza en Belebú. 154 / Echué Echué , antrop. que significa "cabeza, cabecilla". Se refiere al jefe, al cabecilla. Debería escribirse Etyue. Está localizado en Ruiché. Echula , antrop. que debería escribirse Etyuula . El antropónimo completo era etyuula e Moole . Se localiza en Bakake y en Bariobé. Echupo , antrop. que presenta dos signi ficados. En primer lugar "pleamar" o "marea" . Está localizado en Bakake.', NULL, 'Fuente: bubi-español', 'import-script'),
