  ('habé', 'malo, mala, feo, fea. Concuerda con las palabras de la Cl. 16; habba - lugar malo . háelessi, pret. v. o háella ; a batyelernán ba - e kobinna abetté  los presos llena ban bidones para el gobierno, o bollá n bo - e ebolObOlló áí  al niño yo le inflaba su globo. háella , v. inflar para. llenar para; n la botyo ekítoIlo a boppé  lleno un cubo de agua para alguien. Pret. háeri, háelessi. háeri, pret. v. o háella ; a bakuerakueráa ba - o bue''iáa kusiánno yá boppé  los alumnos llenaron bidones de agua para el maestro. haessi, pret. v. o haa ; n -  yo extirpaba, o -  t� extirpabas, a -  él extirpaba, to -  noso tros extirpábamos, 10 -  vosotros extir pabais, ba -  ellos extirpaban. háessi, pret. v. o háa ; elo ebari n e bihá birnmaa bi o tyóbbo á e eriia  esta maña na llenaba todos los cubos de la casa del pueblo. hái, pret. v. o háa ; o -  inflé, o -  inflaste, a -  infló, to -  inflamos, 10 -  inflasteis, ba -  in f laron. haíam, pret. v. o haíanna ; i kuua kubaa o i -  toda la ropa la pla', NULL, 'Fuente: bubi-español', 'import-script');
