  ('halé', 'allí; e tyóbbo ó botúkku é - la casa del jefe de poblado está allí. halelessi, pret. v. o halella ; o bO - e tyóbbo áí  yo le destruía su casa. halella , v. destruir para alguien; o la bo - o wettya bO áí  yo le destruyo su cabaña. Pret. halem, halelessi. halem, pret. v. o haIella ; o bo - e raatyé ri áí  yo le destruí su cama. halessi, pret. v. o halla ; a abi tábítta ba - i tyóbbo kubbaa ya e eriia a kod da  los militares destruían todas las casas del poblado de Kodda. hálessi, pret. v. o háUa ; 010 bOl lá a - o bOllá ó wettam  este niño se parece al niño de mi her mana. halla , v. destruir, demoler, derribar, deshacer, desolar; e kobinna a la - e bilekúléku  el gobierno derriba todos los antros. Pret. hari, halessi. hálla , v. parecer , asemejar . Pret. hám, hálessi. En este verbo la forma del presente es haaó .', NULL, 'Fuente: bubi-español', 'import-script'),
