  ('hantúhántú', 'corto, corta. Concuerda con las palabras de la CI. 16; habba - lugar corto o bajo. Tb. halÍtú. haólla , v. vaciar, deshinchar, desinflar, eva cuar, descargar, deshacer; o Bosoppé a la - e ehá  Bosoppé vacía el cubo. Pret. haóri, hauéssi. haóra , v. 1. acarrear; n la - e bimmálOtoIÍl  yo acarreo mis piñas de cacao. 2. perjudicar; to la - balo batyo  nosotros perjudicamos a estas personas. Pret. haória, haóresiia. haóresiia, pret. v. o haóra ; n -  yo perjudicaba, n - 010 botyo  yo perjudicaba a esta persona, o -  tú perjudicabas, o - a batyo bammaa ba e eriia wela  tú perjudicabas a todas las per sonas del pueblo, a -  él perjudicaba, a ta -  él no perjudicaba, etc. haória, pret. v. o haóra ; n a boppé  acarreé el agua, o le me perjudicaste, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
