  ('haotya', 'sing. primero, primera. Concuerda con las palabras de la Cl. 16; a habba - el primer sitio. Tb. ha ''otya. hara , v. hacer destruir, hacer demoler; to la e bilekulekú  nosotros hacemos destruir los antros, e bilekulekú to la bi -  los antros los hace mos destruir nosotros. Pret. hariia, haresiia. haráa , v. hacer parecer, hacer asemejar; e kapióta a la - e bimpa  el carpintero hace parecerse a los asientos. Pret. haría, harésiia. haresiia, pret. v. o hara ; o bonatú''oIÍl bo - o wettya bO áí  mi her mano mayor hacía destruir su cabaña. haresiia, pret. v. o haráa ; elo telle ne - i telle kubbaa ya IÍlmalé  este camino lo hacía parecer a todos los canlinos de antaño. hari, pret. v. o halla ; o bOíe a - o wettya  el hombre des truyó la cabaña; túe to tyí''a - a bohiáa  nosotros no destruimos los oratorios. haría, pret. v. o haráa ; e beatta bemmaa n be -  todas las historias las hice parecerse. hariia, pret. v. o hara ; n -  hice destruir, o -  hiciste destruir, a -  hizo destruir, to  hicim', NULL, 'Fuente: bubi-español', 'import-script'),
