  ('heahebba', 'cualquier lugar, cualquier sitio. hebbáa , v. descansar, reposar; a bakoé ba lá - e etyíó  los braceros descansan de noche. Pret. hebbí, hebessi. hebbí, pret. v. o hebbáa ; n  descansé, o -  descansaste, a  descansó, to -  descansamos, 10 -  descansasteis, ba -  des cansaron. hebelessi, pret. v. o hebeIla ; n -  yo jadeaba, o -  tú jadeabas, a -  él hadeaba, to -  nosotros jadeábamos, 10 -  vosotros jadeabais, ba -  ellos jadeaban. hebella , v. jadear, acezar; n la - yo jadeo, n tyí''a la -  yo no jadeo, etc. Pret. heberi, hebelessi. heberl, pret. v. o hebella ; n -  jadeé, o -  jadeaste, a -  jadeó, to -  jadeamos, 10 -  jadeas teis, ba -  jadearon. hebessi, pret. v. o hebbáa ; mpári to - Iíkelíke  ayer descansábamos mucho. heessi, pret. v. o hea ; o botébbálÍl bU -  mi corazón latía. héessi, pret. v. o héa ; o bokutta bo -la e húé  la manta se secaba con el calor, e nabba e - la e ehútu  la carne se secaba con el humo.', NULL, 'Fuente: bubi-español', 'import-script'),
