  ('hehe', 'bello, hermoso, bonito, agradable. Con cuerda con las palabras de la CI. 16; habba - un lugar hermoso, bonito. hei, pret. v. o hea ; o botébbá bo áí bU - ebéló esubbá  su corazón latió por última vez. héi, pret. v. o héa ; e bekutta be - las man tas se secaron, o lótto IÍlIO - la e húélÍl  mi cuerpo se secó con mi calor. héía, pret. v. o héya ; n-sequé, o - secas te, a - secó, to - secamos, lo - secasteis, ba secaron; e bimmálOtolÍl n bi -  mis piñas de cacao los sequé. hekessi, pret. v. o hekkáa ; n- invitaba, o - invitabas, a - invitaba, etc. Ej . expr. to ta - a ba tyiáDtyo  no invitába mos a los hechiceros. hékía, pret. v. o hékia ; n bU o bokoé  expulsé al brace ro, to ta - a barannó  no expulsamos a los fangs. hékia , v. �pudiar, expulsar, despedir; o bue''iáa a la - o bUkuerakueráa a lé''a to''ólla  el maestro expulsa al alumno que habla. Pret. hékía, hékíesiia. hékíesiia, pret. v. o hékia ; n  yo expulsaba, o -  tú hepubiesiia / 181 expulsabas, a -  él expulsaba, to -  nosotros ex', NULL, 'Fuente: bubi-español', 'import-script'),
