  ('hellá', 'indo otro, otra. Concuerda con las pala bras de la Cl. 16; habba - otro lugar. hella , V. rcmendar, reparar un vestido , enmendar, remediar, rehabilitar, parchear; n la - o wettya o  yo rehabilito t u cabaña. Pret. heri, heIessi. hella , V. ir, acudir, convertirse; o - bosso  marcharse. Pret. heri , hessi. hellé, 1. adj. junto, juntos, unidos, etc.; a batyo ammaa be - todas las personas están juntas. 2. prono otro, otra. Concuerda con las palabras de la Cl. 16; halo habba, a - este lugar, el otro. helóo''áa , V. meterse dentro, entrar; a batyo ba lá -  la gente entra. Pret. herí, hessi. hem, pret. v. o hella ; n - ripotto  fui a la ciudad; a puulÍl a -  érase una vez. Tb. her;. heókalessi, pret. v. o heúkalla ; e bitobba to bi -  las calabazas las colgábamos, e bitobba to ta bi -  las calabazas no las colgábamos. heñkalla , V. colgar, ahorcar; n la - o loppáa  yo cuelgo el aro para tre par a la palmera. Pret. heÍlkam, heÍlkalessi. Tb. o sora. heñkam, pret. V. o heÍlkalla ; o luua n lo -', NULL, 'Fuente: bubi-español', 'import-script'),
