  ('heú', 'pI. tartamudeces, tartamudos. balbu ceos. Cl. 10 . heúbba , v. balbucear; o bOllá a la -  el niño balbucea. Pret. heúbbi, heú bessi. heúbbi, pret. v. o heúbba ; n - balbu ceé, o - balbuceaste, a - balbuceó, to - balbucea mos, 10 - balbuceasteis, ba - balbucearon. heúbessi, pret. v. o heúbba ; n - balbu ceaba, o - balbuceabas, a - balbuceaba, to - bal buceábamos, lo - balbuceabais, ba - balbuceaban. secar, desecar, limpiar; o la - o bOleppo héya , v. bO bontánna  tú secas el espejo de la ventana. Pret. héía, héyesiia. héyesiia, pret. v. o héya ; n e - e elappám ene heyesiia eelappáárÍ1] yo secaba mi pareo, o e - e ebuttá o  secabas tu sombrero, to 10 - o luua 10 áó  nosotros secábamos nuestra tela, etc. hiessi, pret. v. o hiia ; e etyakka m e -  mi vaso rebosaba. hii, pret. v. o hiia ; e ehá ó waísso e -  el cubo de la mujer rebosó. hiia , v. gotear, rebosar; e ribetté ri lá - biitá  el bidón rebosa aceite. Pret. hii, hiessi. hilálessi, pret. v. o hilálla ; n-e ribotyo m  yo vagueaba co', NULL, 'Fuente: bubi-español', 'import-script'),
