  ('hirelll', 'IJI. limones. CI. 8 . hin''íltya, s pI. naranJas. CI. 8 . híresiia, IJI"l''I. P. o biráa ; n bii - ii biibellelÍl  yo cngañaba a IllI hermano. Biri, I/I/Irop. que ofrece dos significados. Prime ro como herí y segundo como beiri . Se localiza en Ureka. bíría, pret. v. o bíráa ; n ka - he hecho bailar, o''a - has hecho bailar, a''a - ha hecho bailar, etc.; n bo - o bosoppé  engañé a la ardilla.', NULL, 'Fuente: bubi-español', 'import-script'),
