  ('hMmá', 'sing. mudo. Cls. 9 y 10 . hMmáa , v. fructificar, producir, brotar, fecun dar, fornicar, chingar, joder, copular. Pret. hMmí, hMmessi. hMmabi''o , v. alegrarse, estar contento, rego cijarse; n la - me alegro. Pret. hMmíbí''o, hMme síbí''o. hMmárera , v. casarse; o bonánnalÍl a la obaam mi abuela se casa mañana. Pret. hMmá reria, hMmáreresiia. Tb. o mmáraera. hMmáreresiia, pret. v. o hMmárera ; n - me casaba, o - te casabas, a - se casaba, to nos casábamos, 10 - os casabais, ba - se casaban. hMmáreria, pret. v. o hMmárera ; n me casé, n ta -  no me casé, n ta bo -  no me casé con él/ella, o - te casaste, o ta -  no te casaste, o ta bo -  no te casaste con él/ella, etc. hMmelessi, pret. v. o hMmella ; ii biitté bii bó - el árbol fructifera ba para él. hMmella , v. fructiferar/brotar para, dar fruto; i i boreÍltya bo lá le - birótya el naranjo da naranjas para mí. Pret. hMmeri, hMmelessi. hMmera , v. contestar, responder; n la bo i i wéso''o lÍl  yo contesto a mi amigo. Pret. hMmeria, hMmere ', NULL, 'Fuente: bubi-español', 'import-script'),
