  ('hNke', 'pI. muchos, abundantes. Concuerda con las palabras de la Cl. 10; i kuua - ropas muchas . hNnera , Y. orinar, mear; o bOllá a tyí''a ba e raatyé wela  el niño no se mea en la cama. Pret. hNne riia, hNneresiia. hNneresiia, pret. v. o hNnera ; n yo orinaba, o - tú orinabas, a - él orinaba, to nosotros orinábamos, lo - vosotros orinabais, ba - ellos orinaban. hNneriia, pret. v. o hNnera ; o waísso a - e epó wela  la mujer orinó en el orinal.', NULL, 'Fuente: bubi-español', 'import-script');
