  ('hNko', 'sing. cuello. Cls. 9 y 10 . hNuá, 1. s. sing. espalda, dorso. 2. adv. detrás, detrás de. Cls. 9 y 10 . Tb. nná. hNnora , Y. revivir, resucitar; e obéolla e lá - e bilabba  el anciano resucita los hechos. Pret. hNnoria, hNnoresiia. hNnoreea , v. resucitar; 010 botyo a la - esta persona resucita. Pret. hNnoreei, hNnoreseei. hNnoreei, pret. Y. o hNnoreea ; o lá o bOllá a e eruppé a -  dicen que el hijo de Dios resucitó. hNnoreseei, pret. v. o hNnoreea ; a batyo bammaa bá''a �éi ba ba -  todas las perso nas que murieron resucitaban. hNnoresiia, pret. v. o hNnora ; n-e elabba  yo revivía el hecho, o - o boatta  tú revi vías la historia, a - e ehattá  el revivía el pacto, to - e roppá  nosotros revivíamos el dolor, 10 bi - e bilab ba  vosotros revivíais los hechos, ba - a labba lammaa  ellos revivían todas las cosas. hNnoriia, pret. v. o hNnora ; n - e sipóssi  resucité al gato.', NULL, 'Fuente: bubi-español', 'import-script'),
