  ('hNtyáera', 'sing. freno, objeto que sirve para inte rrumpir el movimiento de otro. Cl. 9 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ho', 'adv. aquí, ahí; ne -  estoy , n tyi -  no estoy . hoa , Y. derribar. caer, caerse; e pullá e lá - a abílla  la tormenta derriba las palmeras; ná o luua 10 lá ba - o to la 186 / bOa hoa , v. 10 okka  si tu vestido se cae lo recogemos. Pret. hoi, hoessi. enfriar, calmar; a batyo ba lá - a biitá  la gente enfría el acei te. Pret. hóm , hoessi. hoálessi, pret. v. o hoálla ; 010 botyo a le  esta persona me debía, 010 botyo a''a le hoán esta persona me debía. hoálla , v. deber; 010 botyo n bo hoán  debo a esta persona. Pret. hoán, hoálessi. hoán, pret. v. o hOálla ; iilo botyo a le  esta persona me debió.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('hobahobbá', 'sing. barbaridad, salvajismo. Cls. 9 y 10 ; 010 botyo e - esta persona es salvaje. hobbá , v. desbrozar, desmontar; n la - e epát ta  yo desbrozo la finca. Pret. hObbí, hobessi. hobba , v. calmarse, tranquilizarse; n tyí''a na''a o -  no quiero calmarme. Pret. hóbbi, hobessi. lb. o homa. hóbba , v. ladrar, aullar; e puá e lá - el perro ladra. Pret. hóbbi, hóbessi. hobbí, pret. v. o hobbá ; e epátta n e -  la finca lo des brocé. hobbi, pret. v. o hobba ; n-me calmé, o - te calmaste, a - se calmó, to - nos calmamos, lo - os calmasteis, ba - se cal maron. hóbbi, pret. v. o hóbba ; o botyo a -la puá  la persona ladró como un perro. hobelessi, pret. v. o hóbella ; o boyollalÍl a le - mi abuelo me gritaba, e puá e le -  el perro me ladraba. hobella , v. gritar a alguien, echarle la bronca a alguien, ladrar a alguien; o la le - tú me gritas, tú me echas la bronca, we le hobelle no me grites, no me eches la bronca. Pret. hoberi, hobelessi. hoberi, pret. v. o hobella ; n bo - o biityo  grité a la', NULL, 'Fuente: bubi-español', 'import-script'),
  ('hobó', 'sing. duro, fuerte. Concuerda con las palabras de la CI. 16; a habba - el duro lugar. hoessi, pret. v. o hoa ; n -  yo derribaba, o -  tú derribabas, a -  él derribaba, to -  nosotros derribábamos, 10 -  vosotros derriba bais, ba -  ellos derribaban. hoessi, pret. v. o hoa ; n-a boppé  yo enfriaba el agua, o - a batyo o  tú calmabas a tu gente. hoi, pret. v. o hOa ; n- derribé, n ta -  no derribé, o - derribaste, o ta  no derribaste, etc.; ná o luua lo ba o ola pa''e o okka  si el vestido se cayó, lo puedes recoger. hoi, pret. v. o hóa ; n -  estoy calmado. Tb. hom. hOrni / 187 hoía, pret. v. o hoia ; n ba - a biitá  hice enfriar el aceite. hoia , v. hacer enfriar, hacer calmar; to la - a batyo be ba nobbe  nosotros hacemos calmar a las personas enfadadas. Pret. hOía, hOiesiia. hoiesiia, pret. v. o hOia ; n ta bá - a batyo  yo no hacía calmar a las personas. hoka , v. presionar, dar quebradero de cabeza; bié bilabba bi lá le -  estos hechos me dan quebradero de cabeza. Pret. hoki, hokes', NULL, 'Fuente: bubi-español', 'import-script'),
  ('holláa', 'gustar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('hololló', 'sing. viejo, veterano, antiguo. Con cuerda con las palabras de la Cl. 16; a habba - el lugar antiguo. horn, pret. V. o hOa ; a boppé ba -  el agua está fria. Tb . ho;. homa , V. calmarse, tranquilizarse; we bOrne! ¡no te calmes! Pret. hOmi, hOmessi. Tb. o hoa. homessi, pret. V. o hOma ; 0-elo ebari  te tranqui lizabas esta mañana. horni, pret. V. o hOma ; n - me tranquilicé, o - te tranquilizaste, a - se tran 188 / hOmia quilzó, to - nos tranquilizamos, 10 - os tranquili zasteis, ba -  se tranquilzaron. homia , v. calmar, tranquilizar; o - e ekokko  calmar la cabeza, tranquilizarse. hOótibbia , v. cazar; e sipóssi si lá - e etyíó  el gato caza de noche. Pret. hóñtibi ia, hóÍltibiesi ia. hOótibiesiia,pret. v. o hóÍltibbia ; o obébá a - e ebarityio  el cazador cazaba por la mañanita. hoótibiia, pret. v. o hoÍltibbia ; e sipóssi si - o obitya  el gato cazó al ratón. hoom, pret. v. o holláa ; n quiero, o - quieres, a - quiere, to - queremos, lo - queréis, ba - quieren; n-a baísso Ól  quier', NULL, 'Fuente: bubi-español', 'import-script'),
  ('hombre', 'este', NULL, 'Fuente: español-bubi', 'import-script'),
  ('hontibbia', 'cazar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('horibbia', 'prisa', NULL, 'Fuente: español-bubi', 'import-script'),
  ('hotee', 'grande, voluminoso, importante. Con cuerda con las palabras de la Cl. 16; a habba - el lugar importante. hótelessi, pret. v. o hótella ; o biiieÓl a - ii boka''ó  mi padre revolvía la verdura. hótella , v. agitar, revolver, falsear; n la - e etéÓl  yo revuelvo la olla. Pret. hótem, hótelessi. hótem, pret. v. o hótella ; ne - e etéÓl  revolví el contenido de la olla. hótyi / 189 hótera , v. cambiar, modificar, transformar; to la na''a o - e bilabba  que remos cambiar las cosas, we bi hótere e bilabba no cambies las cosas. Pret. hóteriia, hóteresiia. hóteresiia, pret. v. o hótera ; to ri - e ribotyo nosotros cambiá bamos la vida. hóteriia, pret. v. o hótera ; ba bO - o boatta ellos modificaron la historia. hótessi, pret. v. o hótta ; e emaókoro e -la e húé  el man go maduraba con el calor, e bireótya bi - la e ebélló  las naranjas maduraban con el tiempo. hótOlessi, pret. v. o hótolla ; n-yo des hilaba, o - tú deshilabas, a - él deshilaba, to nosotros deshilábamos, 10 - vosotros deshilabai', NULL, 'Fuente: bubi-español', 'import-script'),
  ('hótera', 'cambiar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('hotottó', 'blanco, color claro; botyo bo - per sona blanca; luua 10 - vestido blanco.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('hótóttó', 'blanco, blanca, blancos, blancas. Con cuerda con las palabras de las Cls. 9 y 10; oabba - animal blanco, koppá - tiburones blancos. hótta , v. 1. quedar limpio; na bo oOi o bokut ta bO Já -  si lavas la manta queda limpio. 2. madurar; e biObbé bi lá - bakassO  las atan gas maduran pronto. Pret. hótyi, hótessi. hotya , v. increpar fuertemente; o mmásam a la le -  mi jefe me incre pa fuertemente. Pret. hótyia, hotyesiia. hótya , v. 1. chapear, desbrozar, segar. Pret. hótyi, hótyessi. 2. blanquear. Pret. hótyia, hó tyesiia. hótyálessi, pret. v. o hótyálla ; to isaké  nosotros chapeába mos con machete. hótyálla , v. chapear con, desbrozar con, etc.; a batyo ba Já - e beoe be ábo  la gente chapea con sus dedos. Pret. hótyám, hótyálessi. hótyám, pret. v. o hótyálla ; a batyo bá''a bua''á bá ba - a bello bábil  las personas que van a morir chapearon con sus dientes. hótyelessi, pret. v. o hótyella ; 0 o botúkku  yo chapeaba para el alcalde, n ta - o botúkku  yo no chapeaba para el alcalde. hóty', NULL, 'Fuente: bubi-español', 'import-script'),
