  ('húbb', 'ladrón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('húbbé', 'sing. ladrón, caco. Cls. 9 y 10 ; we - eres un ladrón, e - e húbiia  el ladrón escapó. húbbia , v. correr, huir, desertar; e bihólOlló bi lá -  las rameras huyen. Pret. húbiia, húbiesiia. húbiera , v. huir de, escapar de; a batyo ba lá - e bittá  la gente huye de la guerra, o la o -  yo huyo de ti, o la le ? ¿huyes de mí? Pret. húbieriia, húbieresiia. húbieresÍÍa, pret. v. o húbiera ; o o - yo huía de ti, o le - tú huías de mí, a - e bittá él huía de la guerra, to - e tyallá  nosotros huíamos del hambre,  vosotros huíais de noso 10 e tros, ba e -  ellos huían de nosotros. húbieriia, pret. v. o húbiera ; e iporosía bi - a batyo ba hMmotyi ba basaké  los policías huyeron de las personas que llevaban machetes. húbiesÍÍa, pret. v. o húbbia ; o - yo huía, o - tú huías, a - él huía, to - nosotros huía mos, 10 - vosotros huíais, ba - ellos huían. húbiia, pret. v. o húbbia ; e pókkó é le poe a batyo bá - el buey, al llegar a las perso nas huyeron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('húé', 'sing. calor, caliente, cálido. Clases 9 y 10 . Tb. wía.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('huehue', 'sing. y pI. calor, caliente. Cl. 9 y 10. Tb. húé. huelessi, pret. v. o huella ; e aríolla oe - e bikokkó bi áe  a la ancIana le arrancaba sus plantas de malanga. huelessi, pret. v. o huella ; e neppóm oe -  a mi sobrino le aconsejaba. huella , v. arrancar de la tierra para alguien; to la - o bulla bekokkó  nosotros arrancamos tubérculos de malanga para la doncella. Pret. hueri, huelessi. huella , v. aconsejar, persuadir, orientar; o boyolla a la - a baseseppe  el anciano aconseja a los jóvenes. Pret. huem, huelessi. huelOlessi, pret. v. o huelolla ; n o bulla  yo desaconsejaba a la doncella. hueloUa , v. desaconsejar; o boie a la - a baseseppe el hombre desaconseja a los jóvenes. Pret. huelori, huelolessi. o bo huelOri, pret. v. o huelolla ; o bulla  a la doncella le desaconsejé. huem, pret. v. o huella ; o oberíim a le -  mi madre me aconsejó, o booatú''om a ta le -  mi hermano mayor no me aconsejó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('huenóko', 'tenue', NULL, 'Fuente: español-bubi', 'import-script'),
  ('hueuóko', 'sing. tibio. Cls. 9 y 10 ; a boppé be - el agua está tibia. hueri, pret. v. o huella ; o bo - e rikobbe o botyo  le arranqué la planta del plátano a la persona. huessi, pret. v. o huua ; to ba - a batté  nosotros arrancá bamos los árboles, to ta bá - a batté  no arrancábamos los árboles. húkalessi, pret. v. o húkalla ; o bo - o waísso m  yo abra zaba a mi mujer. húkalla , v. abrazar. Pret. húkari, húkalessi; le  abrázame; we le -  no me abraces; -bo  abrázale; we bo -le  no le abraces. Tb. o ukalla, o hátyibia. húkari, pret. v. o húkalla ; oe le anne labba n te - o oberíi m  no recuerdo haber abrazado a mi madre. húkessi, pret. v. o húkka ; n-yo abro chaba, o tú abrochabas, a él abrochaba, to nosotros abrochábamos, 10 - vosotros abrocha bais, ba - ellos abrochaban. húkka , v. abrochar; e bobbé e lá - e torosís si o boyolla  el nieto abrocha el pantalón del abuelo. Pret. húkki, húkessi. hútyi / 191 húkki, pret. v. o húkka ; o ta bo - o botiio  no has abrochado el botón. húlessi, pret. v', NULL, 'Fuente: bubi-español', 'import-script'),
