  ('húúa', 'sing. público gente, muchedumbre, multitud. el. 10 . huua , v. arrancar de la tierra; a baísso ba e e biheJÍI bi ábo  yo domestico el caballo. Pret. i''i, i''essi. Tb. o otyáa. i''essi, pret. v. o i''a ; o opotto - e eossi  el blanco domaba al caballo. i''i, pret. v. o i''a ; i póríi kubbaa to i -  todas las cabras las domamos. iáa , v. ir a la finca, al trabajo; o bokoé a la el bracero acude al trabajo. Pret. ií, iessi. iálessi, pret. v. o iálla ; to a baloari  ayudábamos a los impedidos. iálla , v. ayudar, socorrer, asistir, colaborar con alguien; e kobinna e lá - o tobólló  el gobierno ayuda a los pobres. Pret. iári , iálessi. iám, pret. v. o iálla ; elo ebari n-o botyo a epatto lÍl  esta mañana ayudé a mi ve cino. iári, pret. v. iálla ; mpári m bo - o botyo bullé  ayer le ayudé a la otra persona.', NULL, 'Fuente: bubi-español', 'import-script'),
