  ('ibuté', 'pi. encías. Cl. 8 . Ichaikoto , antrop. formado a partir de o ityá y de k6ft6 . Ityaíkottó se referirá a aquella persona que descubre los besugos durante la faena de la pesca. Se localiza en Batoicopo. Ichaka , antrop. plural de etyakka . Debería escribirse Bityakka, pero la convivencia morfológica que caracteriza a la len gua bubi justifica el presente término de Ityak ka. Se localiza en Baney. lchakaito , antrop. que se refiere a un tipo de sonajero que servía para ahuyentar a los animales que comían los ñames. Ityakáito se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
