  ('íIIa', 'sing. 1. nombre, honor. Cl. 5 ; ká ri he e - o?  ¿cuál es tu nombre? ¿cómo te llamas? 2. voz, nombre, pala bra. Cl. 5 . Tb. iUáa .', NULL, 'Fuente: bubi-español', 'import-script'),
