  ('kapatássi', 'sing. capataz. Cls. 9 y 10. kapátya , v. berrear, bramar; e pókkó é la - el buey berrea. Pret. kapátyiia, kapátyesiia. kapátyesiia, pret. v. o kapátya ; e esóló é -  el cerdo bramaba. kapátyiia, pret. v. o kapátya ; e esóló é -  el cerdo bramó. kapea , v. estropearse, averiarse; a lokko la lá -  las cosas se estropean. Pret. kapei, kapieseei. kapei, pret. v. o kapiia ; o wet t ya bo -  la cabaña se estropeó. kapelessi, pret. v. o kapella ; n yo estropeaba para, o - tú estropeabas para, a él kassí / 207 estropeaba para, to - nosotros estropeábamos para, 10 - vosotros estropeabais para, ba -  ellos estropeaban para. kapelessi, pret. v. o kapella ; n - o bo''e  yo enfardaba la car ga, n bO -  yo lo enfardaba. kapeUa , v. estropear para, destrozar para, etc; a baseseppe ba lá le - e empam  los muchachos estropean mi asiento. Pret. kapem, kapelessi. kapella , v. enfardar, embalar; 010 botyo a la - e bekutta be áí  esta persona embala sus mantas. Pret. kapem, kapelessi. kapem, pret. v. o kape', NULL, 'Fuente: bubi-español', 'import-script'),
