  ('karanáte', 'sing y pI. cacahuetes. Clases 9 y 10 . kari, pret. v. o kalla ; n-e empam  \levo mi asiento sobre mi cabeza. Tb. arí. karíbba , v. asustarse, espantarse; e puá e lá la e pittóo  el perro se asusta con la bocina. Pret. karíbbi, karíbessi. karíbbi, pret. v. o karíbba ; e puá e le haúbe n-el perro, al ladrar, me asusté. karíbessi, pret. v. o karíbba ; n-me asustaba, o - te asustabas, a - se asus taba, to - nos asustábamos, 10 - os asustabais, ba - se asustaban. karíbia , v. asustar, espantar; e erikirikki o mmo e lá - a batyo bammaa  la sombra del demo nio asusta a toda la gente, we le karíbbie no me asustes. Pret. karíbiia, karíbiesiia. karíbiesiia, pret. v. o karíbia ; o bonolla m n bO -  a mi abuela le asustaba. karíbiia, pret. v. o karíbia ; o le - me has asustado.', NULL, 'Fuente: bubi-español', 'import-script'),
