  ('kasára', 'sing. y pI. yucas . Cls. 9 y 10 . kasebbia , v. acelerar, darse prisa; o motóo bo lá -  el coche acelera. Pret. kasebiia, kasebiesiia. kasebiesiia, pret. v. o kasebbia ; n-me daba prisa, o - te dabas prisa, a se daba prisa, etc. kasebiia, pret. v. o kasebbia ; n e -  me di prisa, o e -  te diste prisa, e -  se dió pri sa, to e - , etc. kasessi, pret. v. o kassáa ; n-e tyóbbo m  limpiaba mi casa. kasobia , v. relampaguear; o obOtyo o lá  relampa guea. Pret. kasobiia, kasobiesiia. kasobiesiia, pret. v. o kasobia ; e ello e -  el día relampa gueaba. kasobiia, pret. v. o kasobia ; e ello e -  el día relampagueó. kassáa , v. borrar, limpiar; n la - e beleppom  limpio mis gafas, n la - e biletera  borro las letras. Pret. kassí, kasessi. kassí, pret. v. o kassáa ; n-o bossom  limpié mi cara. 208 / katclessi katelessi, pret. v. o katella ; to - o boreótya  nosotros podábamos el n a r a n jo. katella , v. podar; a baie ba lá - a barnrnálOto  los hombres podan los cacaoteros. Pret. kateri, katel', NULL, 'Fuente: bubi-español', 'import-script'),
