  ('kattyá', 'sing. baile bubi. Cls. 9 y 10. kattyi, pret. v. o katta ; a baitta ba - e bilabba  los dignatarios analizaron los asuntos. káya , v. abrir grandemente las piernas. Pret. kábiia, kábiesiia. Tb . o kabella. ke, prono Interrog. quién. Se utiliza para las perso nas; - e péérn alo?  ¿quién hizo eso?', NULL, 'Fuente: bubi-español', 'import-script'),
