  ('ké', 'dónde. Es una forma obtenida mediante la asimilación de los términos ká y e. Funciona como elemento interrogativo cuando se une al sustantivo tye; - tye ¿dónde?; - tye  o la hella é? ¿dónde vas? ke''a , v. probar, medir, pesar; n la ba - o luua Ó l  yo pruebo mi vestido. Pret. ke''i, ke''essi. ke''a , V. generar, originar, germinar, tener; e kario''e e láake''a la gallina tiene ya polluelos. Pret. kei, ke''essi. ke''ea , V. procurar, intentar, ensayar. probar. Pret. ke''ei, ke''ieseei. ke''ei, pret. V. o ke''ea ; n lo - o luuaÓl  yo probé mi vestido. ke''essi, pret. V. o ke''a ; n-o to''ú o  yo probaba tu fuerza. ke''essi, pret. V. o ke''a ; e biakkábe - las semillas germinaban. ke''i, pret. V. o ke''a ; n-probé, o - probas te, a - probó, to - probamos, lo - probasteis, ba -  probaron. ke''i, pret. v. o ke''a ; o waak kábo - la semilla germinó. ke''ieseei, pret. V. o ke''ea ; n-o tyutyúra  yo intentaba conducir, n si - e sotteÓl  yo probaba mi camisa.', NULL, 'Fuente: bubi-español', 'import-script'),
