  ('ke''u', 'sing. y pI. suciedades, inmundicias, por querías. Cls. 9 y 10. ke''ubba , v. ensuciarse; o luua 10 lá - la o lóllá  el vestido se ensucia con la lluvia. ke''ubbi, pret. v. o ke''ubba ; a bollá ba -la biitá  los chi cos se ensuciaron con el aceite. ke''ubbia , V. ensuciar; 10 la - o bobba  vosotros ensuciáis el suelo. Pret. ke''ubiia, ke''ubiesiia. ke''ubessi, pret. V. o ke''ubba ; e biul la be - las doncellas se ensuciaban. ke''ubiesiia, pret. V. o ke''ubbia ; a bollá ba - a boppé  los chicos ensuciaban el agua. ke''ubiia, pret. v. o ke''ubbia ; a bollá ba - e eteppe  los chicos ensuciaron la pared.', NULL, 'Fuente: bubi-español', 'import-script'),
