  ('kohá', 'pI. amaranto espinoso .Cl. 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Koka', 'plural de lokká . Debería escribirse Kokká . Se localiza en Baney. kokessi, pret. v. o kokká ; elo ebaam emmaa ne -e esíllam  toda esta mañana presionaba mi cabello. kokessi, pret. v. o kokkáa ; n - i tyokkolÍl kubbaa  yo reunía todo mi dinero. kokessi, pret. v. o kokka ; o boie i - i puá el hombre achuchaba a los perros.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kokká', 'pi. clanes. Cl. 10 . kokká , v. clavar. presionar el pelo de la cabeza. Pret. kokkí, kokéssi. kokka , v. atizar, achuchar; lo la - a Mllá  vosotros achucháis a los niños. Pret. kokki, kokéssi. Tb. o kóbba. kokkáa , v. reunir, agrupar; a balakoláko ba lá - basa''a  los trabajadores reúnen limas. Pret. kokki, kokessi. kokki, pret. v. o kokkáa ; a batyo ba - e riossa puá  las personas se reunieron en la plaza. kokki, pret. v. o kokka ; ne - e puá  achuché al perro.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kokkáa', 'adicionar', NULL, 'Fuente: español-bubi', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('koko', 'sing. y pi. tenue. Cls. 9 y 10. kokobessi, pret. v. o kokobba ; a bo mme ba - las mujeres se estremecían. kokobba , v. estremecerse. Pret. kokobbi, kokobessi. kokobbi, pret. v. o kokobba ; n me estremecí. kokobbia , v. 1. temblar, tiritar; o bollá a la  el niño tiembla. Pret. kokobiia, kokobiesiia. Tb. o tyíbella. 2. o - botyo presionar a alguien, intimidar a alguien. kokobiesiia, pret. v. o kokobbia ; n-yo temblaba, o - tú temblabas, a - él tembla ba, to - nosotros temblábamos, 10 - vosotros tem blabais, ba -  ellos temblaban. kokobüa, pret. v. o kokobbia ; n bo -o botyo  presioné a la per sona, o - temblaste, a batyo ba - la e sine  las personas temblaron de frío.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kokopp', 'desazonado', NULL, 'Fuente: español-bubi', 'import-script'),
  ('kokoppé', 'sing. y pI. insípidos, sosos, desazo nados. Cls. 9 y 10. kokora , v. roer, ratonar ; o obitya bo lá - el ratón ratona. Pret. kokoria, kokoresiia. 212 I kokoresiia kokoresiia, pret. v. o kokora ; e kólló e -  la rata hacía ruido en su madriguera, ratonaba, o obitya bo - el ratón hacía ruido en su madriguera, ratonaba, a bate ke ba -  los cangrejos de río hacían ruido, to - nosotros hacíamos rui do como las ratas, 10 - vosotros hacíais ruido como las ratas, ba -  ellos hacían ruido como las ratas. kokoria, pret. v. o kokora ; n- hice ruido como las ratas, o - hiciste ruido como las ratas, a - hizo ruido como las ratas, to - hicimos ruido como las ratas, 10 - hicisteis ruido como las ratas, ba -  hicieron ruido como las ratas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kokoríOkó', 'sing. y pI. onomatopeya del canto del gallo. gallos. Cls. 9 y 10. kokotessi, pret. v. o kokotta ; n - me inclinaba, o - te inclinabas, a - se inclina ba, to - nos inclinábamos, 10 - os inclinabais, ba -  se inclinaban; a boppé ba -  el agua hervía. kokotta , v. inclinarse, agacharse. her vir, cocer; a boppé lá - el agua hierve. Pret. kokotyi, kokotessi. kokotya , v. hacer hervir; n la - a boppé yo hago hervir el agua. Pret. kokotyiia, kokotyesiia. kokotyesiia, pret. v. o kokotya ; 10 ba - a boppé  voso tros hacíais hervir el agua. kokotyi, pret. v. o kokotta ; o botyo a - o bOitta a hetessi lá  la persona se inclinó cuando pasaba el gobernador. kokotyiia, pret. v. o kokotya ; n ba - a bo''á  yo hice hervir el caldo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kolákarí', 'sing. y pI. muchachas, jóvenes mucha chas. Cls. 9 y 10 ; e eyéí yébba e - el viva de la muchacha.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kolákobe', 'sing. y pI. muchachos, jóvenes. Cls. 9 y 10 ; e eyéíyébba e el viva del muchacho.', NULL, 'Fuente: bubi-español', 'import-script'),
