  ('kólló', 'sing. y pi. ratas de bosque. "rom piz" o grombif. Cls. 9 y 10; na e - na e tyí o obáám e tyí aneHa o bOsekka  si la rata no está en el bosque no se le conoce madriguera.', NULL, 'Fuente: bubi-español', 'import-script'),
