  ('kolokollo', 'sing. tataratataranieto. Cl. 9 . kOlólló, adk. sing. y pi. viejo/s, veterano/s. Con cuerda con las palabras de las Cls. 9 y 10; i kobbí -  las viejas calabazas vinateras.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kOlótta', 'de! alquitrán. Cl. 10; e teHe á i nalle e péneri o la -  la carretera se hizo con alquitrán.', NULL, 'Fuente: bubi-español', 'import-script'),
