  ('konyákko', 'sing. coñac. Cls. 9 y lO; ha tyi - e ripelló pua  no hay coñac en la fiesta.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('koo', 'pI. loros, cacatúas, papagayos. el. lO .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kooa', 'pI. lavabos, lavaderos, lavanderías, lava torios. lavadoras. Cl. 10 . kooa , v. odiar, envidiar, detestar; we le kooe, tyuíi no me odies, por favor. Pret. kooi, koessi. Tb. oooa. kooi, pret. v. o kooa ; n- odié, ¡¡ - odiaste, a - odió, to - odiamos, 10 - odiasteis, ba -  odiaron. Tb. 00;.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kookonno', 'pequeño, pequeña, pequeños, pequeñas. Concuerda con las palabras de las Cls. 9 y 10; nabba - animal pequeño, kollo - sardi nas pequeñas. Tb . kookoo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kookoo', 'pequeño, pequeña, pequeños, peque ñas, etc. Concuerda con las palabras de las Cls. 9 y 10. Cfr. kookonno. kossá / 213', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kóólÍl', 'pI. leños, leñas. el. 10 . kopáa, 1. s. pi. aros con los que se trepa a la pal mera de aceite. el. 10 . 2. s. sing. y pI. barajas . els. 9 y 10 . kópáa , v. cuidar, asistir; o boie a la - o Mllá . Pret. kópíi, kópessi. Tb. o bópáa. kópála , v. cuidar para, asistir para; o bOyolla a la bo - o Mllá  el abuelo le cuida al niño. Pret. kópári, kópálessi. T b. o bópála. kópálessi, pret. v. o kópála ; n - cui daba para, o - cuidabas para, a - cuidaba para, to - cuidábamos para, 10 - cuidabais para, ba - cui daban para. Tb. bópálessi. kópári, pret. v. o kópála ; n- cuidé para, o - cuidaste para, a - cuidó para, to - cui damos para, 10 - cuidasteis para, ba - cuidaron para. Tb. bópári.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kopáa', 'baraja', NULL, 'Fuente: español-bubi', 'import-script'),
