  ('koperi', 'sing. y pi. juicios. els. 9 y 10; e - e séi mpári  el juicio era ayer. kópessi, pret. v. o kópáa ; n- cuidaba, o cuidabas, a - cuidaba, to - cuidábamos, 10 - cui dabais, ba - cuidaban. Tb. bópessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kopetyinna', 'sing. fiebre, dolor de cuerpo. el. 9 . kopiesiia, pret. v. o koppia ; n-me arrimaba, o - te arrimabas, a - se arrimaba, to nos arrimábamos, lo - os arrimabais, ba -  se arrimaban. kópü, pret. v. o kópáa ; n- cuidé, o - cui daste, a - cuidó, to - cuidamos, 10 - cuidasteis, ba - cuidaron. Tb. bópíi. kopiia, pret. v. o koppia ; n-me arrimé, o - te arrimaste, a - se arrimó, to - nos arrimamos, 10 - os arrimasteis, ba -  se arrimaron. kopolla , v. desgranar; to la - e bimmálOto  nosotros desgranamos las piñas de cacao. Pret. kopom, kopuessi. 2. o botyo sonsacar. kopom, pret. v. o kopolla ; e bim máloto n bi -  des grané las piñas de cacao.', NULL, 'Fuente: bubi-español', 'import-script'),
