  ('koppé', 'sing. y pi. gavilán. milano. els. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('koppí', 'sing. y pI. cuarto de aseo. retrete, letrina. els. 9 y 10 . koppia , v. arrimarse, retirarse; - M arrímate. Pret. kopiia, kopiesiia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('koppo', 'sing. y pI. cubilete. copa. els. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kóppó', 'sing. y pi. buey. toro. els. 9 y 10. kopuessi, pret. v. o kopolla ; n- e bimmálOto m  des granaba mis piñas de cacao, o - desgranabas, a desgranaba, to - desgranábamos, 10 - desgrana bais, ba -  desgranaban.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kori', 'sing. y pI. rico. hacendado. els. 9 y 10 . Tb. górí.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('korí', 'pI. bejucos. el. lO . Tb. wgori . rico, adinerado. els. 9 y 10. Tb. bOtyú''u .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kóri', 'porque', NULL, 'Fuente: español-bubi', 'import-script'),
  ('koroko', 'pI. bebida alcohólica. aguardien te, licor. el. 10 ; i - i lá olláa a batyo  la bebida alcohólica mata a las personas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('korokoroo', 'sing. y pI. roña, tiña, sama. els. 9 y 10. kosessi, pret. v. o kossá ; a batyo bá e eriia ba - a baseseppe  las personas del poblado empareja ban a los jóvenes. kosibalessi, pret. v. o kósiballa ; o boitta bote a - a batyo  el gran mandatario insultaba a las personas. kosiballa , v. insultar, injuriar; 010 waísso a la - o oberii áf roló waissó láa kósiballoberaaí] esta mujer insulta a su madre. Pret. kósibam, kósiba lessi. Tb. o ikka. kosibam, pret. v. o kósiballa ; n bo -  le insulté, le injurié.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kosóo', 'pI. anos, culos. el. 10 . kossá , v. 1. emparejar, aparejar, juntar, parear. 2. o - e bilabba  armonizar los hechos. 3. moverse, currar; 010 botyo a la - kóri a te pélla lelle  esta persona se mueve porque todavía no vive bien. Pret. kossí, kosessi. 214/ kossí kossí, 1. s. sing. pareja . Cl. 9 . 2. pret. v. o kossá ; o - e biulla la bolábObe  emparejé a las doncellas con los muchachos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kosso', 'sing. acierto, correcto, etc. Cls. 9 y 10. Ej . expr. e bilabba bi tyí oppáa e -  las cosas no salen bien.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kota', 'que debería escribirse Kótaa . Se localiza en Belebú. kótebia , v. tomar el pelo; e bobbé e lá - o boyol la  el nieto toma el pelo al abuelo, we le kótebbie no me tomes el pelo. Pret. kótebiia, kótebiesiia. Tb. o pobbá. kótebiesiia, pret. v. o kótebia ; o tomaba el pelo, o - tomabas el pelo, a - tomaba el pelo, to - tomábamos el pelo, 10 - tomabais el pelo, ba - tomaban el pelo. Tb. pobessi. kótebiia, pret. v. o kótebia ; o tomé el pelo, o - tomaste el pelo, a - tomó el pelo, to - tomamos el pelo, lo - tomasteis el pelo, ba - tomaron el pelo. Tb. pobbí.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kotee', 'sing. y pi. grande, voluminoso, impor tante, destacado. Concuerda con las palabras de las Cls. 9 y 10; e bappa - la serpiente grande, i bappa - las serpientes grandes. kótessi, pret. v. o kótta ; o - amontonaba, o - amontonabas, a amontonaba, to - amontonábamos, 10 - amonto nabais, ba -  amontonaban. kotóbaam, pret. v. o kotóballa ; n - kóri o ta ekessi e rikottom álo  yo tropecé porque no miraba dónde ponía mi pie. kotóbalessi, pret. v. o kotóballa ; to - a bate  nosotros tropezábamos con las piedras. kotóballa , v. tropezar, chocar; o la - kóri o la etta e etyíó  tropiezas porque caminas por la noche.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kotobítyo', 'sing. y pI. huella. paso. CIs. 9 y 10. kótta , v. amontonar, agrupar, reunir; n la - e bimmálOtom  yo amon tono mis piñas de cacao. Pret. kotyí, kotessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kótte', 'sing. y pi. chaqueta. CIs. 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('kotto', 'sing. 1. pisada . 2. dátil caído al suelo. Clases 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kottó', 'sing. valiente, hombre fuerte. Cls. 9 y 10 . * we - eres un valiente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kotya', 'sing. y pi. primero/s, primera/s, los pri meros, las primeras. Concuerda con las palabras de las Cls. 9 y 10; e oabba - el primer animal, i oabba -los primeros animales. kOtya , v. t. tragar, engullir; o la - o bOlallo  trago el remedio. Pret. kótyía, kótyesiia. 2. 0-tuái  tragar saliva, aguantar. kotyesiia, pret. v. o kótya ; o - yo tragaba, o - tú tragabas, a - él tragaba, to - noso tros tragábamos, lo - vosotros tragabais, ba ellos tragaban. kótyi, pret. v. o kótta ; n -  amontoné, o -  amontonas te, a -  amontonó, to -  amon tonamos, 10 -  amontonasteis, ba -  amontonaron. kotyía, pret. v. o kótya ; o - tra gué, o - tragaste, a - tragó, to - tragamos, 10 tragasteis, ba - tragaron. koya , v. atar fuerte, anudar; tyuíi, - bo o bOoe m  por favor, ata fu erte mi dedo. Pret. kóbíía, kóyesiia. koyesiia, pret. v. o kóya ; o - yo ata ba fuerte, o - tú atabas fuerte, a - él ataba fuerte, to - nosotros atábamos fuerte, 10 - vosotros ata bais fuerte, ba - ellos ataban fu erte. kuá , v. caer, ', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kuarí', 'pi. continentes, contenedores. CI. 10 . kuri /215 kúbala , v. tropezar ; n la - yo tropiezo, o la - tú tropiezas, etc. Pret. kúbari, kúbalessi. kúbalessi, pret. v. o kúbala ; n-yo tro pezaba, o - tú tropezabas, a - él tropezaba, to nosotros tropezábamos, lo - vosotros tropeza bais, ba - ellos tropezaban. kúbari, pret. v. o kúbala ; n - mpári tropecé ayer, n ta - mpári no tropecé ayer.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kubb', 'parque', NULL, 'Fuente: español-bubi', 'import-script'),
  ('kubba', 'indo alguno, alguna. Concuerda con las palabras de las Cls. 9 y 10; he - nabba hay algún animal, hay alguna carne guisada.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kubbá', 'sing. y pi. patio. parque. Cls. 9 y 10. mimbres de palma. CI. 10 . kubbáa , V. tropezar, topar; e rikottolÍl ri lá e raatyé e etyíó  mi pie tropieza con la cama por la noche. Pret. kubbí, kubessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kubbé', 'pi. peces eléctricos, que sueltan una des carga eléctrica en contacto con alguien. Cl. 9 . Sing. Cl. 3: "bubbé". kubbí, pret. v. o kubbá ; e ehMma wela n-e etetémpa  en la oscuridad tropecé con el sofá. kubessi, pret. V. o kubbá ; n -beala  yo tropezaba con obstáculos, o eteppe  tú tropezabas con una pared, a - batté  él tropezaba con árboles, etc. kuéi, pret. V. o kuá ; ne le supútalle n-yo, al resbalar, me caí. kuessi, pret. v. o kuá ; n-yo me caía, o - tú te caias, a - él se caía, to - nosotros nos caía mos, 10 - vosotros os caíais, ba - ellos se caían. kuítarí, int. icaramba!', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kukú', 'obtenido a partir de ekukuu . Se localiza en baney. kukura , V. esparcir, desparramar; n la - e betoolÍl be o bOlIá lÍl  yo esparzo las cenizas de mi hijo. Pret. kukuriia, kukuresiia. kukuresiia, pret. V. o kukura ; n be - e beakká  yo esparcía las almendras. kukuriia, pret. V. o kukura ; to to - o topotto  nosotros esparcimos las pimientas negras. kukútya , V. caminar a tientas, despacio. Se refiere especialmente a los andares de los ancía nos. Pret. kukútyia, kukútyesiia. kukútyesiia, pret. v. o kukútya ; e obéolla e - el anciano caminaba a tientas y despacio. kukútyia, pret. V. o kukútya ; n-caminé despacio, o - caminaste des pacio, a - caminó despacio, to - caminamos despa cio, 10 - caminasteis despacio, ba -  caminaron despacio.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kula', 'que se refiere a una especie de boti jo o cántaro. Se localiza en Baney. kulessi, pret. V. o kulla ; n - i pillá e ebarityio  yo reco gía los dátiles muy de mañana, o - e beakká o mpári  tú recogías tus almendras ayer.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kull', 'botijo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('kullá', 'sing. y pI. botijo, cántaro. Cls. 9 y 10 . kulla , V. recoger , elegir; lo la - a batyo bá''a takká''á bá  vosotros elegís a las personas que van a gobernar. Pret. kuri, kulessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kullo', 'sing. y pI. pez espada. Cls. 9 y ID .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kunké', 'sing. y pi. bombo, tambor. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kunnú', 'sing. piragua, canoa, cayuco. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Kupa', 'que significa "sabio", "inteligente". Debería escribirse Kuppá. Se localiza en Batoi copo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kupékupé', 'sing. y pi. pincho moruno. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kupékúpe', 'pi. caspa. Cl. ID . kupiesiia, pret. v. o kuppia ; a baitta ba - a batyo  los gobernantes despreciaban a las personas. kupiia, pret. V. o kuppia ; n- desprecié, o - despreciaste, a - despre ció, to - despreciamos, lo - despreciasteis, ba  despreciaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kuporue''í', 'sing. facultad, escuela superior. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kupp', 'ciencia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('kuppá', 'sing. y pi. sabio, erudito, docto. listo, inteligente. ciencia. Cls. 9 y 10. kuppia , V. faltar al respeto, desobedecer. desdeñar, despreciar. Pret. kupiia, kupiesiia. kuri, pret. V. o kulla ; n - i tyokko a batyo ba upessi yé  recogí el dinero que las personas tiraban. 216/ kurú', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kurú', 'sing. y pI. joroba, chepa. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kurússu', 'sing. crucifijo, cruz. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kusiánno', 'pI. barriles, toneles, bidones. CI. 10 . Tb. ribitté .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kussí', 'sing. y pI. ñame amarillo. Cls. 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kuttyá', 'sing. y pI. estropajo. esponja. Cls. 9 y lO .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kutyú', 'bajo, corto, etc. Concuerda con las palabras de las Cls. 9 y 10. efr. kutyukútyu.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kutyukútyu', 'bajo, corto, etc. Concuerda con las palabras de las Cls. 9 y 10; telle camino cor to, tekka rafias cortas. Tb. kutyú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('kuua', 'pI. telas, prendas. ropa, vestidos, batas. banderas. Cl. 10 . Tb. lokuua. L la, corlj. y, con; bolÍlmua - botyo a tyá la pélla hellé carne y persona no viven juntas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('la''otya', 'sing. primero, primera. Concuerda con las palabras de la CI. 6b. Cfr . wiitya.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('labb', 'mal', NULL, 'Fuente: español-bubi', 'import-script'),
  ('labba', 'sing. cosas, asuntos. CI. 6b; a - la obotyo  las cosas de la vida.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('labé', 'malos, malas, feos, feas, grave, graves. Concuerda con las palabras de la CI. 6b; a labba - las cosas malas, 010 botyo e - esta persona está grave. labóatta, int. ejemplo, por ejemplo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('labotólá', 'despacio', NULL, 'Fuente: español-bubi', 'import-script'),
  ('labotóláboto', 'despacio, lentamente, tran quila y suavemente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lado', 'izquierdo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('ladrones', 'apalear', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Laesá', 'que debería escribirse Laessa . Se localiza en Bahó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('laha', 'sing. nombre dado al dios de la música y la salud en la mitología bubi. la he, adj. nuevo, nueva, nuevos, nuevas. Con cuerda con las palabras de la CI. 6b; lokko cosas nuevas, labba - asunto nuevo. Lajai , antrop. que también aparece escrito como Lajay en español. Se refiere a algo que va a ser . Se localiza en Batete. Lajay , antrop. también escrito Lajai en español. Cfr . Lajai.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Laka', 'plural de lolakka . Se localiza en Basuala. lakaelessi, pret. v. o lakaella ; n - o motóo bó''a kapei lá  reparaba el coche cuando se hubo ave riado. lakaeUa , v. arreglar, reparar, enmendar; o la o motóolÍl  tú arreglas mi coche. Pret. lakaeri, lakaelessi. lakaera , v. hacer arreglar, hacer reparar; o la bo - o motóo o  tú haces arreglar tu coche. Pret.  yo hacía reparar el coche. lakaeri, pret. v. o lakaella ; e ebankolOsi ne - sé sibelOhékka  el brazalete lo arreglé hace un momento. lakaeria, pret. v. o lakaera ; n bo - o motóo  hice arreglar el coche. lakea , v. morir, fallecer, morirse; i pókkó i lá - la e sille . Pret.  el anciano murió. lakeseei, pret. v. o lakea ; e obéol la e -la o bolólló  en anciano moría de viejo. lakessi, pret. v. o lakka ; e sipóssi to si  al gato lo castrábamos. lakiesiia, pret. v. o lakkia ; e tyippa to e -  a la jineta lo hacíamos castrar. lakiia, pret. v. o lakkia ; e sipós si n si -  a[ gato lo hice castrar. 21S/ lakka', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lakka', 'pi. halcones. gavilanes pequeños. ladronzuelos. Cl. lO . Tb. langa . lakka , v. castrar, capar, matar; o bOie a la - e puá  el hombre castra al perro. Pret. lakki, lakessi. lakki, pret. v. o lakka ; n- castré, o - castraste, a - castró, to - castramos, 10 - cas trasteis, ba -  castraron. lakkia , v. hacer castrar, hacer capar; e sipóssi r o n la si -  a mi gato le hago castrar. Pret. lakiia, lakiesiia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lakookonno', 'poco, poca. Concuerda con las palabras de la Cl. 6b; labba - poca cosa, pocos asuntos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lakookoo', 'un poco, algo; ü pa''e o tó''ólla  puedes hablar un poco.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lála', 'ahora, ahora mismo. Este término se localiza entre los usuarios de Ureka. lalabbia , v. negar; o wetta o a la - e elab ba  tu hermana niega el hecho. Pret. lalabiia, lalabiesiia. Tb. dinaebbia. lalabiesiia, pret. v. o lalabbia ; o botyo o a - o boatta  tu pariente negaba la historia. lalabiia, pret. v. o lalabbia ; a betta o ba e elabba  tus herma nas negaron el hecho.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lalé', 'dem. aquel, aquella. Concuerda con los nombres de la Cl. 6b; - labba aquel asunto.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lállo', 'así, de esta manera, esto; - kálo n ko werí lá  esto fue lo que te dije.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lalo', 'dem. este, esta. Concuerda con los nom bres de la Cl. 6b; - labba este asunto.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lamina', 'localizado en Moeri. Parece pro venir de la conjunción la y el término minna .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lamma', 'indo alguno, alguna. Concuerda con las palabras de la Cl. 6b; he - labba hay alguna cosa.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('langa', 'pi. halcones. gavilanes pequeños. ladronzuelos. CI. 10 . Tb. lakka .', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('lanké', 'con dos significacos: "árboles de la nuez de cola" o "nueces de cola". Está locali zado en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lantúlántú', 'corto, cortos, corta, etc. Con cuerda con las palabras de la Cl. 6b; labba asuntos cortos. Tb. lañtú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('láOlé', 'ahora, ahora mismo. Este término se localiza más entre los usuarios de Basuala.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('laótú', 'corto, corta, cortos, cortas, etc. Concuer da con las palabras dc la Cl. 6b. Cfr. lanfúlántú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('laotya', 'sing. primero, primera. Concuerda con las palabras de la Cl. 6b; labba - primer asunto, lokko -  las primeras cosas. Tb. la ''¡¡tya. lapálessi, pret. v. o lapálla ; aotya a batyo ba - biitá bá o ribotyo  antaño la gente cocina ba con aceite de palma.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('laotyalaotya', 'primeramente', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lapálla', 'cocinar con; to la - tookollo nosotros cocinamos con picantes. Pret. lapári, lapálessi. lapári, pret. v. o lapálla ; o bObbelÍl a - topotto  mi espo so cocinó con pimientas negras. lapelessi, pret. v. o lapella ; n bO o waíssolÍl  yo coci naba para mi mujer. lapella , v. cocinar para; 10 la - batyo vosotros cocináis para algunas personas. Pret. laperi, lape lessi. laperi, pret. v. o lapella ; n bO - o wetta IÍI  yo cociné para mi hermana. lapessi, pret. v. o lappá ; n-yo cocina ba, o - tú cocinabas, a - él cocinaba, to - noso tros cocinábamos, lo - vosotros cocinabais, ba  ellos cocinaban. lápiesiia, pret. v. o láppia ; n i - i nabba  yo hacía cocinar la carne. lappá , v. cocinar, preparar la comida; n la - e súppu  yo cocino la salsa. Pret. lappí, lapessi. lappí, pret. v. o lappá ; e lo ebaam n nabba  esta mañana coci né carne. láppía, pret. v. o láppia ; n bo - o büka''ó  yo hice cocinar la verdura. láppia , v. hacer o mandar cocinar; ba lá - e biheelÍl  ellos mandan cocinar las malan', NULL, 'Fuente: bubi-español', 'import-script'),
  ('láppo', 'sing. lámpara, luz. Cls. 9 y 10 . lekelessi I 2 t 9', NULL, 'Fuente: bubi-español', 'import-script'),
  ('larga', 'largo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Lásakero', 'que significa "buen recibi miento" . Debería escribirse Lásákero. Se localiza en Ria ba y en Moka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lataño', 'obtenido a partir del verbo o anya . Debería escribirse Látáanyo . Se localiza en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lato', 'largo, alto. Concuerda con las palabras de la Cl. 6b; labba - largo asunto. le, 1. morf.· numo cuatro baie ba -  cua tro hombres, basa''a ba - cuatro limas, benná bie - cuatro balas, bilebbó bie - cuatro campa nas, tohékká tue - cuatro trocitos. 2. prono como me; o - peí riburí tú me diste protección. le, morf obtenido a partir de la conjunción la y el aumento e; e nabba la e bappa  el animal y la serpiente. lé, 1. morf dem. aquel, aquella o - botyo  aquella persona, bo - bone  aquel dedo, ri - isa''a  aquella lima, e - erüa  aquel poblado, 10 - IOhakoo  aquella fragancia, si - sinorí  aquel pájaro, ha - habba  aquel lugar, etc. 2. mor:f. numo uno, una botyo bu - una persona, bone bu - un dedo, riaka ri - un menú, loberí lu -  una canción, siteteri si - un minuto. 3. adv. todavía, aún; ne hállo todavía estoy aquí. le''era , v. mimar, consentir; 0-bOllá mimar a un niño. Pret. le''eriia, le''eresia. le''era , V. guardar, proteger, ahorrar; e puá e lá - o buhá  el perro guar da el hueso. Pret. ', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lehílehí', 'sing. molestón, camorrista, beligeran te. Cls. 9 y 10. Lehri , antrop. en el que no se justifica la hache. Debería escribirse Lerí . Se localiza en Baresó . lekelessi, pret. V. o lekélla ; n yo drenaba, o - tú drenabas, a - él drenaba, to nosotros drenábamos, 10 - vosotros drenabais, ba - ellos drenaban. 220 I lekélessi lekélessi, pret. v. o lekélla ; o boyolla a - e empa wela  el abuelo dormitaba en el asiento. lekella , v. canalizar, drenar; n la - a boppé bá o lóllá  yo canalizo el agua de la lluvia. Pret. lekeri, lekelessi. tekélla , v. dormitar, adormecerse, cabecear. Pret. lekém, lekélessi. tekém, pret. v. o lekélla ; n-me adormecí, o - te adormeciste, a - se ador meció, ro - nos adormecimos, 10 - os adormecis teis, ba -  se adormecieron. lekeri, pret. v. o lekella ; n drené, o - drenaste, a - drenó, to - drenamos, 10 - drenasteis, ba -  drenaron. lekessi, pret. v. o lekka ; o obessé a batyo bamma ba -  en el poblado todas las personas se ponían en fila. lekiesiia, pret. v. o lek', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lekella', 'filtrar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('leláe', 'nada, ni un ápice; labba - nada de nada. Tb. leláJIe.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lelálle', 'nada, ni un ápice; labba - nada de nada. Tb. leláe.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lele', 'que debería escribirse LelIe . Se localiza en Baney y en Balachá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lellá', 'indo otro, otra. Concuerda con las pala bras de la Cl. 6b; labba - otra cosa.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lelle', 'bien, buenamente; le -  está bien.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lello', 'actual', NULL, 'Fuente: español-bubi', 'import-script'),
  ('leoo', 'poco, poca. Concuerda con las palabras de la Cl. 6b; labba - poca cosa. lepea , v. esconderse, ocultarse; n la ba leppo yo me oculto, n la - yo me escondo. Pret. lepei, lepieseei. lepei, pret. v. o lepea ; n me oculté, o - te ocultaste, a - se ocultó, to - nos ocultamos, lo - os ocultasteis, ba -  se ocultaron. lepelessi, pret. v. o lepella ; o bOyolIa n bo - e isaké ri áí  al abuelo le guardaba su machete. lepella , v. guardar/ocultar/esconder algo a alguien; n la o - eruua  yo te guardo sitio. Pret. lepem, leperi, lepelessi. lepem, pret. v. o lepella ; o bOnatú''olÍl a le - e eruua  mi hermano mayor me guardó el sitio. leperi, pret. v. o lepella; to bo - e bilabba  nosotros le ocultamos los hechos. Tb. lepem. lepessi, pret. v. o leppa ; a abObée ba - e bitataa bi ábo  los bubis escondian sus escopetas. lepetessi, pret. v. o lepetta ; n -  yo tenía mucho frío, o -  tú tenías mucho frío, a -  él tenía mucho frío, to -  nosotros te níamos mucho frío, lo -  vosotros teníais mucho frío, ba', NULL, 'Fuente: bubi-español', 'import-script'),
  ('leppa', 'ahorrar', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lette', 'verídico, cierto; - n ka poa''á obari de verdad iré mañana. Iewera , v. fijarse, observar. Pret. lewereei, lewereseei; o lá na o te parí e esoko kábera na o te e - o  dicen que si no has llegado a ser joven entonces nadie se habrá fijado en ti. lewereei, pret. v. o lewera ; n- e bilabba  observé los hechos. lewereseei, pret. v. o lewera ; a batyo ba - e kobinna  la gente se fijaba en el gobierno.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('leUo', 'hoy; - to pa''e o tó''ólla kóri o bOitta a''a húbiia  hoy podemos hablar porque el jefe ha huído.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lIepa', 'obtenido a partir del verbo o leppa . Puede traducirse por "almacén", "escondite", "refugio", etc. Se locali za en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('llorones', 'llorón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lo''obba', 'sing. 1. calabaza comestible. 2. paga duría, caja, oficina de cambio. CI. 11 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lO''obbá', 'sing. cuchillo, navaja. Cl. 11 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lo''otya', 'sing. primero, prímera. Cl. 1 1 . err. lootya.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lo''ú', 'sing. tartamudeo, tartamudez, tartamudo. balbuceo. Cl. I I . Tb. loheú .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loa', 'sing. año. Cl. 1 1 ; - 10 he Año Nuevo; o''a - 10 he Feliz Año Nue vo; lO''a - lo he Feliz Año Nuevo a todos vosotros. lóa , V. moler, machacar. Pret. lói, lóéssi. Tb. o nóa.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOakke', 'sing. atado, atadura. parto. Cl. 11 . lóálessi, pret. V. o lóálla ; i pillá n i - bate  los dáti les los machacaba con piedras. lóálla , V. machacar con, moler con, etc. Pret. lóám, lóálessi. lóám, pret. V. o lóálla ; to beto''o  molimos con pilones.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loantyotyo', 'sing. sarampión. CI. 11 . loátessi, pret. V. o loátta ; o botyo a - e puá  la per sona mordía al perro. loátta , V. morder, mordisquear; o bOllá a la e ribelle ri o oberíi áí  el niño muerde el seno de su madre. Pret. loátyi, loátessi. loátyi, pret. V. o loátta ; e puá e - o bokobbe  el perro mordisqueó el plátano. Loba , antrop. que debería escribirse Lo''obbá . Pero si tenemos en cuenta el verbo o obba , obtendremos el término Lo''obba . Se localiza en Sampaka .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loba''a', 'sing. costa del mar, playa. CI. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loba''o', 'sing. caserío, aldea. distrito de una ciudad, barrio, barriada. CI. I I . Ej . exp. botyo a -  un familiar, un pariente, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobakka', 'sing. baúl, ataúd, féretro. male ta. Cl. I I . 222 l lübákko', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobákko', 'irmamento', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lobakoo', 'sing. fragancia. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobár', 'pleito', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lobari', 'sing. la aurora, la mañana. CI. I \ .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobatto', 'veto', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lobb', 'antebrazo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lobbe', 'sing. macho, varón. Concuerda con las palabras de la CI. 1 1; ii liiókóra - el camaleón macho, ii liibbo - el brazo derecho. lobbíi, pret. v. o lobbáa ; a baobbe ba tyotyo  los pescadores pescaron una ballena.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobé''í', 'sing. lamento, queja. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lobede', 'que debería escribirse Lobédé . Está loca lizado en Batete, en Ruiché y en Bakake.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobelá', 'sing. morera . Cl. 11 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Loberi', 'que debería escribirse Loberí . Está localizado en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loberí', 'sing. canción, cántico. Cl. I I . lobessi, pret. v. o lobbáa ; o boobbe a koppá  el marinero pescaba tiburones.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lobete', 'que proviete de obetti! . Por extensión, este antropónimo signifi ca paraguas o parasol. Debería escribirse Lobet té. Se localiza en Bariobé, en Bakake y en Bahó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lobeto', 'que hace referencia a una gran ceremonia durante la cuál se levantan las prohibi ciones que pesan sobre una familia, un pueblo, etc. Debería escribirse Lobétto . Se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script');
