  ('lobokokko', 'sing. flema, baba. CI. 11 . Tb. lohíkko . Loboleri , antrop. obtenido a partir del verbo o jjlella . Looleri se locali za en Riaba y en Moka. Lobopa , antrop. que debería escribirse Lopáa . Se localiza en Batoicopo. Loboso , antrop. que nos remite a Losso . Se localiza en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobóllo', 'pregón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lobóra', 'sing. descendencia. herencia. CI. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobótóttó', 'blanco, blanca. Concuerda con las palabras de la Cl. I 1 ; lorubbá - pelo blanco.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobúa', 'sing. ej ército, batallón, hueste, patrulla. CI. I I . lói, pret. v. o lóa ; n-e beakká  molí las almendras, o - a bate  moliste las piedras, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lobullo', 'sing. riada. CI. I I . Loca , antrop. que presenta dos significados. En primer lugar Lokká significará "cangrejo". En segundo lugar, escrito Lokká significará "clan". Se localiza en Baresó y en Basuala.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOé', 'sing. llorido, lloro. CI. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOe''o', 'sing. enseñanza, formación, etc. Cl. 11 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOeppa', 'sing. planta. CI. 1 1 . lokessi / 223', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Loeri', 'que debería escribirse loeri cuya traducción aproximada en español es "grito". Se localiza en Baney y en Batete. lóessi, pret. v. o lóa ; n-yo molía, o - tú molías, a - él molía, to - nos otros molíabamos, lo - vosotros molíais, ba ellos molían.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Loeto', 'que se construye a partir del verbo o etta . Loetto significa "caminata", "trayecto". Se localiza en Basakato de la Sagrada Familia, en Baloeri y en Sampaka .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loette', 'sing. azada, palo para cavar, palanca. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOetto', 'sing. caminata, trayecto. Cl. 1 1. Tb. loettyi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOettyi', 'sing. caminata, trayecto, viaje. Cl. 1 1 . Tb. loet/o.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lohah', 'uñero', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohakoo', 'fragancia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohebb', 'ocio', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohebbo', 'vacación', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohel', 'morera', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohíkko', 'lema', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lohúa', 'patrulla', NULL, 'Fuente: español-bubi', 'import-script'),
  ('loiriri', 'sing. tristeza, congoja. Cl. 1 1 . Tb. boiri .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOitta', 'sing. lugar donde viven los jefes o baitta. CI. I I . Lojua , antrop. obtenido a partir de húúa . Lohúúa se podrá traducir por "ejército". Se locali:la en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('LoJeri', 'que debería escribirse Looleri . Cfr. Loholeri. Se localiza en Balachá. 100eri, pret. v. o lolella ; o - a batyo  apoyaste a las personas, fortaleciste a las personas. 100essi, pret. v. o lollá ; o obitya bo tá -  el ratón no pacía.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Loká', 'que debería escribirse Lokká o Lokka . También aparece escrito Loca en español. Se localiza en Baresó y en Basuala.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokákka', 'sing. cangrejo pequeño de mar. Cl. I I . lokalessi, pret. v. o 10kalla ; a abitábítta ba - a basesepári bá e eriia wela  los militares se acostaban con las jóvenes del pueblo. lokalla , v. dormir con, acostarse con, fornicar, chingar; n la - bibbo duermo con demonios. Pret. lokam, lokalessi. Tb. o lokanna. lokam, pret. v. o lokanna ; n bo - o bObbelÍ1  me acosté con mi marido. lokanessi, pret. v. o lokruma ; a - bi''ó  él dormía con fiebre. lokanna , v. dormir con, acostarse con. Pret. lokam, lokanessi. Tb. o lokalla.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokatte', 'murciélago', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lokk', 'enseres', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lokká', 'sing. clan. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokko', 'pI. bártulos, bienes, enseres, cosas. Cl. 6b', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokokó''ó', 'sing. ocro, quimbombo. CI. I I . lokolessi, pret. v. o lokolla ; e ekobekobbe e -  la hoja del plátano se marchitaba. lokolla , v. marchitarse, ajarse, debilitarse. Pret. lokori, lokolessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokollo', 'sardina', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lokorí', 'sing. bejuco. CI. 1I . T b. logori .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lokuakua', 'balbuceo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Lola', 'que debería escribirse Lóllá . Se localiza en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lolda', 'sing. sábado. CI. 9 . Tb. sátiré. loldesiia, pret. v. o lokkia ; o botúkku a - a batyo ba e ripelló  el alcalde alojaba a las personas de la fiesta.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lóllá', 'sing. lluvia. Cl. II . Tb. wellá . Ej . expr. - a tyí oppáa tyóbbo alo té  la lluvia no cae delante de una sola casa . IOlIá , v. pacer, pastar; i pókkó i lá -  los bueyes pacen. Pret. lorí, lolessi. 10110, s. sing. planta del ñame, ñamal. Cl. 1 1 ; á me tárí o - eteppe wela ? ¿quién medió la planta del ñame en la pared? IOpello / 225', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lollo', 'ñamal', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lolló', 'sing. pierna, muslo. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lolo', 'que puede escribirse Limo o Lolló . Se localiza en Baloeri y en Baoey. 1010, adj. dem. este, esta. Concuerda con los nom bres de la Cl. 1 1; - IOlIó esta pierna, - IOnekku esta hierba mora. 1010''0, s. sing. muralla. muro de contención, barrera. Cl. 1 1 . 100óa, s. sing. mortero. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('lolóa', 'molino', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lolobba', 'grieta', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lololló', 'sing. viejo, veteraoo. Concuerda con las palabras de la CI. 6b; a labba - los viejos asuntos. 100ólló, adj. sing. viejo, veteraoo. Concuerda con las palabras de la CI. 1 1; o luua - el viejo ves tido.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lomopuá', 'que debería escribirse Lom mopuá. Parece haberse construido a partir de rimmo . En este sentido se referirá a una persona sumamente her mosa . Se localiza en Batoicopo y basupú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lonekku', 'sing. verdura amarga. hierba mora. Cl. I I . Tb. lona''u .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lones', 'comilón', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lonokko', 'sing. arco. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
