  ('looa', 'lavadero', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lOókóra', 'sing. camaleón. CI. I I . Tb. lowátéte. 1000eri, s. sing. fortaleza. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lóóÓl', 'sing. leño, leña. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('looppo', 'sing. concurso. adorno, lujo. CI. 1 1 . 100taotá, s. sing. planta olorosa con hojas aochas opuestas . Cl. 12 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lóórÍl', 'leña', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lootté', 'sing. red de pesca. Cl. 1 1 . 100tya, adj. sing. primero, primera. Cl. 1 1 . Concuerda con las palabras de la Cl. 1 1 : loko''ó-  el primer cañave ral. Tb . lo''otya.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOótú', 'corto, corta, bajo, baja, etc. Concuerda con las palabras de la Cl. 1 1; o luua - el vestido corto. 100a, s. sing. lavabo, lavadero, lavaodería, lavato rio. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lopa', 'que nos remite semánticamente a Lohopa. Es una de las formas en las que el regis trador colonial escribió Lopáa. Se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopáa', 'sing. aro con el que se trepa a la palmera de aceite. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopappá', 'sing. ala de ave. Cl. 1 I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopappo', 'techado', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopáppo', 'sing. techado, tejado que sobresale de la pared. Cl. I 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lopato', 'que se refiere a la "barraca" o a la "cabaña". En este sentido tendrá relación con epatto . Pero también puede relacionarse con el verbo o apatta . LOpatto se refiere entonces a "rasguño". Se localiza en Bariobé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopatta', 'cachete', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopatto', 'sing. cobertizo, caserío, barraca. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopekke', 'sing. baranda, barandilla. Cl. 1 I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopelell', 'ironía', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopello', 'desaire', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopéllo', 'agravio', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Lopeló', 'que puede traducirse por "burla", "agravio", "ignominia", etc. En este caso se escribirá Lopello. Se localiza en Bososo y en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lopeo', 'construido a partir del término pe''o . Lope''o se refiere a la alusión hecha a alguien. Se localiza en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lopete', 'relacionado con el término petté . Lopetté será el lugar donde abun dan las lianas. Se localiza en Baresó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopetyíi', 'amargor', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopetyípetyíi', 'amargo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopippo', 'sing. adorno, ornamento. lim pieza, pulcritud. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopoporera', 'sing. llano, llanura. Cl. 1 1 . loppá , v. encender, alumbrar; n la - e láppo  enciendo la lámpara , o la - o boissó  enciendes el fue go, etc. Pret. loppí, lopéssi. loppí, pret. v. o loppá ; i láppo ye beoko wela i -  las luces de las calles están encendidas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopopórera', 'llano', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lopóppo', 'pulpo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('loppó', 'sing. reunión de países o de gente. convocatoria. cumbre. conferencia. CI. 11; o -lo i tyé  la cumbre de países.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lopúrü', 'sing. salida. CI. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lorá', 'contruido a partir del verbo o ráa . Lorá significará entonces "comida", "alimento". Se localiza en Bariobé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loréi', 'sing. convite, banquete. Cl. 1 1 . IOrí, pret. v. o lollá ; i póríi i -  las cabras pacieron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lori''o', 'hundimiento', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Loribo', 'que hace referencia al lugar don de viven los espíritus , o a la confusión o perdición. En este último caso se escribirá LoribbO . Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loriki', 'sing. lugar donde hay muchas silue tas. televisor. CI. 1 1.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('losássa', 'sing. plato , cuenco. Cl. 1 1 . Tb. pelétté . lOse'' o, s. sing. 1. medición. 2. balance, balanza, pesa. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Losebá', 'obtenido a partir del verbo o seb báa . Losebbáa se referirá a la huí da. Se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('losibbó', 'sing. 1. conchita redonda plana y menuda con un orificio en el centro. 2. sarta. CI. 1 1 . Tb . lokkó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('losikko', 'anorexia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('losisi', 'compasión', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Loso', 'que nos remite a Lohoso. Debe entonces escribirse Losso. Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Losóa', 'obtenido a partir del verbo o suua . Losuua se referirá al "lavado" o al "lugar donde se realiza un lavado". Se localiza en Bakake.', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('losoo', 'culo', NULL, 'Fuente: español-bubi', 'import-script'),
