  ('Lotapo', 'obtenido a partir del verbo o tappáa . Debería escribirse Lotáppo . Escrito Lotappo se traducirá por la "fachada de un edificio". Se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lotáppo', 'escaparate', NULL, 'Fuente: español-bubi', 'import-script'),
