  ('lotyókko', 'sing. cadena. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOuppe', 'sing. niebla, neblina. Cl. 1 1 . Tb. LOu peuppe, /otóbátóbbá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('loutaeri', 'sing. rodeo, manera de hacer o conse guir una cosa, camino más largo. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lovari', 'construido a partir de obari . Debería escribirse Lobari . Se localiza en Balachá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lOwátéte', 'sing. camaleón. Cl. I I . Tb. /oókóra.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lowatt', 'ignorancia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('lowattá', 'sing. ignorancia. torpe, ignoran te. Cl. 1 1 . lb. seké lua, conec. prep. de; o luua - baie  la prenda de los hombres, o luua - e eriia  la bandera del pueblo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lpuallo', 'muy, en exceso, demasiado; o bollá e wewe - el niño es muy guapo. Mpulejale , antrop. que debería escri birse Mpúlehalé . Se localiza en Moka. Mpuliché , antrop. compuesto por o púlláa e i tyé . Presenta dos formas: Mpúlityé y Mpulityé . Se localiza en Moka. Muacho , antrop. que debería escribirse Moatyo . Se localiza en Belebú y en Ruiché. Muadyabitá , antrop. que debería escribirse Mo''adyabitá . Se localiza en Belebú. muadyána , s. sing. mujer, esposa. CI. I . Tb. muára , w a i sso .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ltimo', 'úlcera', NULL, 'Fuente: español-bubi', 'import-script'),
  ('luarí', 'sing. continente, contenedor. Cl. 1 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lubá', 'que se refiere al mimbre de la pal ma. Lubbá fue el nombre del Jefe o bOtúkku de San Carlos, quien luchó contra los colonizadores españoles y murió en 1910. Este antropónimo se localiza en Batoicopo y en Bocoricho.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lubbá', 'sing. mimbre de palma. Cl. l I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lubbé', 'sing. pez eléctrico, que suelta una descar ga eléctrica en contacto con alguien. Cl. l I . Tb. bubbé', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lue''a', 'sing. cuerno. Cl. I I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luebba', 'sing. culebra grande. gran ola de mar. Cl. l I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luellá', 'indo otro, otra. Concuerda con las pala bras de la Cl. 1 1 ; luua - otro vestido. luelue, ad}. bello, bonito, hermoso, agradable. Concuerda con las palabras de la Cl. 1 1; luua vestido hermoso, bonito.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luetáa', 'sing. pluma . Cl. 1 1 . Luha , antrop. que significa "esqueleto", "osamenta". Debería pronunciarse . Se localiza en Bahó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luhá', 'sing. esqueleto, osamenta. Cl. 1 1 . Luhita , antrop. obtenido a partir de loitta . Existe un poblado en la Isla de Bioko que se llama Oloitía . Este antropónimo se localiza en Batoicopo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luiri', 'sing. nube. Cl. I I . lullé, prono sing. otro, otra. Concuerda con las palabras de la Cl. 1 1 ; 1010 lotyókko, o - esta cadena, la otra.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('lusiánno', 'sing. bidón, tonel, barríl. Cl. 11 . Tb. ribetté', NULL, 'Fuente: bubi-español', 'import-script'),
  ('luua', 'sing. tela, lienzo. prenda, vestido, bata. bandera. Cl. 11 ; o - 10 a abobée  la bandera de los Bubis. m-, morj: 1. presentativo que se coloca delante de los nombres que empiezan por Ip/: mpuá es un perro, mporíi es una cabra. 2. prel suj bó botyíó m púríi anoche salí.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ma''u', 'dej: vino de palma, vino en general. el. 6. Tb. ba''u.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('maa''o', 'pI. antorchas. el. 6 ; a - ba riberi  las antorchas están apagadas.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('maálá', 'pi. piernas. el. 6 . T b. lolló , IOponná .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('maaó', 'pI. cañaverales. cañas de azucaro el. 6. Tb. ba''ó .', NULL, 'Fuente: bubi-español', 'import-script'),
