  ('mma', 'dos , algunos/as. Cl. 8: biriia bié - dos poblados. Este morfema concuer da con los prefijos bii- , ba- , be- , ri- , e- , bi- , kubba , 10- , si- , to- , ha . mma , v. estar de pie; to - ohO''ó a batyo ba etyi''íi pongámonos de pie que la gente nos ha adelantado, o - bi''o estar de pie junto a alguien, alegrarse, contentarse. Pret. mmí, mmessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmaa', 'todo; e bilabba bi - todas las cosas. mmábba , v. nublar, nublarse; o bokó bo lá -  el día se nubla. cerrar los oj os; i nokko i áí i lá -  sus oj os se cierran. Pret. mmábbi, mmábessi. mmábbi, pret. v. o mmábba ; i nokko o i -  tus oj os están cerrados. mmábessi, pret. v. o mmábba ; i nokko ÓI i -  mis oj os se cerraban con el sueño, o bokó bo -  el día se nublaba. mmaelessi, pret. v. o mmaella ; o hOioppé ÓI a le -  mi tío me apoyaba. mmaella , v. ponerse de pie por alguien, brin d a r apoyo a alguien, defender a alguien, etc. Pret. mmaem, mmaelessi. mmaem, pret. v. o mmaella ; n bo - o bopulákke  defendí al extranjero.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmakétte', 'sing. mercado, venta. CI. 3 ; n la helláa o -  voy al mercado.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmalé', 'antaño, antiguamente; i - a batyo ba pélessi beappú wela  antaño las personas vivían en cuevas; - ha séí bOie antaño había un señor. Tb. opúlla, opullo. mmáraera , v. casarse, contraer matrimonio; e biulla be lá - e etyo wela la o tyotyi  las donce llas se casan según la tradición y canónicamente. Pret. mmáreriia, mmáraeresiia. mmáraeresiia, pret. v. o mmáraera ; n -la o wetta o  me casaba con tu hermana, o - te casabas, a - se casaba, to - nos casábamos, 10 os casabais, ba - se casaban. mmáraeriia, pret. v. o mmáraera ; n -  me casé, 0 te casaste, a - se casó, to - nos casamos, 10 - os casasteis, ba - se casaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmása', 'sing. jefe, patrón, amo. CI. 1 . 234 / mmasíín mmasíín, .1''. pI. máquinas, motores. el. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmatta', 'sing. dictador, tirano. el. 1 . Tb. opippa .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmé', 'sing. madre, señora, doña. el. I ; a bo -  las madres. Tb. mmer;.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmeá', 'sing. alteza, eminencia. el. I ; ko bóyállo e - yo te saludo, gran señor. mmelessi, pret. v. o mmella ; bá batyo ba le - estas personas me repre sentaban. mmella , v. representar; tyuíi - le, n la pulóo por favor, represéntame, ahora vengo. dejar paso; 010 botyo a la le -  esta per sona me deja paso. cazar; o hittá a baiee bá la - en la selva los hombres cazan . Pret. mmeri, mme lessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmembó''o', 'sing. suegra. el. I . Tb. oberlbó''o. mmenna, pret. v. o Ólmera ; e le lelelle o boie m bo - cuando me llamó el señor le con esté. mmera , v. contestar, responder; - le tyíi  contéstame, por favor, we bO mmere no le contestes. Pret. mmenna, mme resiia. mmeresiia, pret. v. o Ólmera ; n-yo contestaba, o - tú contestabas, a - él contestaba, to - nosotros contestábamos, lo vosotros contestabais, ba - ellos contestaban. mmeri, pret. o ommella ; e kobinna e - a batyo  el gobierno ha representado a la gente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmeri', 'sing. madre, señora. el. 1 . Tb. mmé. mmessi, pret. v. o mma ; n obo''ó  yo me ponía de pie. mmetessi, pret. v. o Ólmetta ; n yo cogía, o - tú cogías, a - él cogía, to - noso tros cogíabamos, 10 - vosotros cogíais, ba - ellos cogían. mmetta , v. coger, detener; a batyo ba lá o lobakka  las personas cogen el ataúd. Pret. mmetyi, mme tessi. Tb. o hMmota.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmetya', 'sing. burlón, bufón, humorista, paya so. el. 1 . mmetyi, pret. v. o mmetta ; ne e húbbé cogí al ladrón. mmi, pret. v. o mma ; n - obo''ó  me puse de pie, to - obo''ó  nos pusimos de pie. mmia , v. paralizar, parar; to la - e elako  nosotros paramos el trabajo. mmiesiia, pret. v. o rnmia ; lo e bilabba  vosotros paraliza bais los asuntos, ba - o motóo  ellos paraban el coche. mmiia, pret. v. o mmia ; e kobin na a - e bilako  el gobierno paró los trabajos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmo', 'sing. demonio, diablo, fantasma. difunto. el. I ; na - na botyo a heye a beUá né  demonio o persona, que seque mis lágrimas, o - la morada de los demonios. mmOla , v. preparar; to la ba - o  nos estamos preparando. Pret. mmo ri, mmolessi. Tb. o uolla. mmOlessi, pret. v. o mmola ; n la - a lokko  yo preparaba las cosas. Tb . uoless;. mmora , v. preparar, prepararse; n ba - o  me preparé. efr. o mmola. mmori, pret. v. o rnmOla ; n-e bilab ba  preparé los asuntos, los hechos. Tb. uor;.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmotomotóo', 'pI. coches grandes. el. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmotye', 'sing. asambleario, tertuliano. el. I . mmuátessi, pret. v. o mmuátta ; a abitábítta ba - a batyo  los militares cogían en brazos a las personas. mmuátta , v. coger en brazos; o wetta Ól a la - o Mllá áí  mi hermana coge a su hijo en brazos. Pret. mmuátyi, r nmuátessi. mmuátyi, pret. v. o mmuátta ; o waisso Ól a le -  mi mujer me cogió en brazos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mMpe', 'apaleador', NULL, 'Fuente: español-bubi', 'import-script'),
  ('mo''abba', 'sing. repartidor. el. I ; 0-mulé el primer repartidor. moakanne s. mes de febrero. el. 3. También se llama utamoóte. mokoteri / 235', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moambú', 'sing. cueva, gruta, madriguera, caverna. el. 3 . Tb. bOappú , bosilla .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moanda', 'sing. historia, noticia, discurso. el. 3 . Tb. bOatta .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moatyó', 'sing. persona que recoge ostras. el. J .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mobabé', 'sing. trozo, porción. el. 3 . Tb . ebabé . Mobajale , antrop. que debería escri birse Moobahaále . Se localiza en Ehoko .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mobale', 'que hace referencia a alguien que siempre corre riesgos. Debería escribirse Mobáá le. Se localiza en Riaba.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mobáótya', 'sing. picazón. el. 3 . Tb. obatyabatyáa .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mobólo', 'sing. vaina . el. 3 . Tb. ebakanónno .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mobú', 'sing. muerto, difunto. el. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mobuagasi', 'cuyo significado encontra mos en Bobuakasi. Se localiza en Belebú. Moche , antrop. que debería escribirse Mmotye . Se localiza en Baney. Mochi , antrop. que hace referencia a una generación, a una pandilla o a un grupo. Debería escribirse Motyí. Se localiza en Moka. Mochumu , antrop. que nos remite a motyumo . Se localiza en Riaba.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('modady', 'junio', NULL, 'Fuente: español-bubi', 'import-script'),
  ('modadyá', 'sing. lluvia del mes de junio. junio. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('modyo', 'sing. persona, alguien. el. l . Tb. bOtyo . Modyuerímola , antrop. compues to por modyo y erímola . MOdyéierímola se referirá a alguien extraño. Está localizado en Moka.', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('moé', 'sing. alma, espíritu. el. 3 ; nye - nye - nye morekaita n te e nyá ka''e  soy un espíritu, soy un espíritu, soy de la lejanía y no muero nunca. Tb. bOé .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moete', 'sing. persona que impone normas o reglas. el. I . Mohaba , antrop. construido a partir del verbo o abba . Mo''abba se tra ducirá por "repartidor". Se localiza en Moeri. Mohabá , antrop. que ofrece otra forma escrita de Mohaba. Se localiza en Moeri. Mohachó , antrop. que debería escribir se Moatyó . Se localiza en Belebú. Mohete , antrop. que nos remite a Moete. Se localiza en Belebú, en Moeri y en Ruiché.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mohóle', 'sing. persona querida y amada. el. I . Mohomolo , antrop. compuesto por moo y moló . Moomoló se localiza en Batete. Mohoso , antrop. que debería escribirse Moosó . Se localiza en Batete y en Baloeri. Moiché , antrop. que debería escribirse Mo''ityé . Se localiza en Batete, en Belebú y en Balachá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moíhero', 'sing. pregunta, indagación, cuestión. el. 3 . Tb. emeri .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moityé', 'sing. poseedor de los países, señor de los pueblos. emperador. el. l . Mojede , antrop. que hace referencia a una norma o ley. Mohede se localiza en Moka. Mojole , antrop. construido a partir del verbo o hOlláa . Mohóle hace referencia a una persona amada y querida. Se localiza en Moka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Moka', 'que nos ofrece tres significados en f unción de la pronunciación. En primer lugar, Mooka . En segundo lugar Moókáta . En tercer lugar Mooka . Se localiza en Bariobé, en Belebú, en Bakake y en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mokara', 'que debería escribirse Mokárá . Se localiza en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mokeria', 'compuesto por el verbo o okkáa y el sustantivo eriia . Mookéria se referirá al señor del poblado. Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mokoteri', 'sing. botella . el. 3 . Tb . opilo , opoteri , bOkOteri . 236 / mmallo', NULL, 'Fuente: bubi-español', 'import-script'),
  ('molleja', 'molino', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Molo', 'que ofrece dos significados: Mooló y Moló . Se localiza en Baresó . mOló, atij. sing. antiguo, veterano. els. 1 y 3 . Tb. molóló , bOló/1 ó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mOloe', 'sing. testamento, última voluntad. el. 3 . T b. bjjloe , ii''é .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mololó', 'pI. antiguos, veteranos. el. 2 . Tb. moló , bololló .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Molubela', 'obtenido a partir del verbo o malubela . Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Momesori', 'compuesto por mame y sori . Momesori se refe rirá a alguien que bebe, prueba, etc. Se localiza en Ruiché.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mometolo', 'compuesto por mame y tollo . Mome tollo se referirá a alguien que concilia fácilmente el sueño. Se localiza en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Momó', 'que debería escribirse Moomó . Se localiza en Bariobé yen Moeri. Momokobo, antr op. compuesto por maamó y kabo . Moomókobo se referirá a alguien tan fuerte como un escudo. Se localiza en Bososo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Momolú', 'que nos remite a un caso meta tésico o permutación de unidades fónicas conti guas. El término primario parece ser MOIoló . Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moo', 'sing. vida, aliento, energía. el. 3 . Tb. boo .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moópe', 'sing. apaleador, pegador. el. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moosó', 'sing. fuego. leño. el. 3 . Tb. bOissó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mope', 'que puede escribirse como Moopé o como MOópe . Se localiza en Batete y en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('moroo', 'sing. moda, costumbre popular. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mORye', 'sing. dedo, yema del dedo. el. 3 . Tb. bOne , bOnaai . Moña , antrop. que parece una forma abre viada de Monyá''ola . Se localiza en Belebú. Moñai , antrop. formado a partir del verbo o nya ''a . En bubi Monyaí  ofrece el mismo significado que Mna ''í . Se localiza en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mosabo', 'sing. autorización, permiso. el. 3 . Tb. bOsabo .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mosari', 'que debería escribirse Mosari . Está localizado en Riaba, en Batete y en Moka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mosibé', 'obtenido a partir del préstamo bubinizado wásibé . Mosibé es la persona que vive en la bahía del Oeste o San Carlos . Se localiza en Ruiché.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mosombé', 'sing. ardilla grande. el. 3 . Tb. biisoppé .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mososó', 'que debería escribirse Mososó . También signifi ca "malanga" y "pezón". Para ambos casos se escribirá Mososó. Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mosotyi', 'sing. rayo. el. 3 . Tb. bOsotyi .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mossú', 'sing. dedo del pie. el. 3 . T b. bOnessú . Mosupi, ant r op. compuesto por los términos mmo y suppíi . Mmosúppi significará "persona elegida por el espíritu". Se localiza en Moka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mota', 'que debería escribirse Moota . Moota se refiere a Mpeyo / 237 la persona que trenza. Se localiza en Sampaka .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mOtallo', 'sing. medicamento, remedio. el. 3 . Tb. bOlallo , meressi. Molay , antrop. probablemente prestado de alguna lengua africana, aunque su parecido con Moláe nos permite incluirlo entre los términos bubis. Se localiza en Baresó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mote''a', 'sing. persona que consuela, que cal ma. el. 1 . Tb. bote''a.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Motea', 'obtenido a partir del verbo o te ''a . Mote''a se referirá a la perso na que consuela o calma. Se localiza en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Motede', 'que significa columna vertebral . Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motédé', 'sing. columna vertebral. el. 3 . Tb. botété .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motémá', 'sing. corazón. el. 3 . Tb. botébbá .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motete', 'sing. palmera joven. el. 3 . Tb. biitette .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Motobe', 'compuesto por moto y mbi . Motobé se referirá a alguien de otro tiempo. Se localiza en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motóo', 'sing. coche, vehículo, automóvil. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motyekke', 'sing. tabla de madera. el. 3 . Tb. hOsekke , biitye''e .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motyí', 'sing. generación, personas que nacen y viven en la misma época. el. 3 . Tb. hotyí .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motyikamatta', 'sing. pez raya. el. 3 . Tb. biityikabatta .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motyílé', 'sing. 1. persona con experiencia y de edad avanzada, persona mayor. 2. anciano, ancestro. el. 1 . Tb. biityllé .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('motyuekokora', 'sing. cráneo, calavera. el. 3 . Tb. biikákálló .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('MouJa', 'que debería escribirse Moula . Se localiza en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('MouJe', 'que nos remite a Moula. Se loca liza también en Belebú. mpá , 1. v. coger , echar, observar; o - sibbó echar una miradita, tener en cuenta; o - kotto dar un paso rítmico, avanzar; o - boatta contar una noticia; o - etataa  disparar una escopeta. Pret. mpí, mpessi. 2. s. pI. pulseras o brazaletes hechos con sartas de t yíbO. el. 8 . Tb . ippá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpá', 'que hace referencia a las pulseras o brazaletes hechos con sartas de tyíbO. Se localiza en Baney y en Rebola. mpáám, pret. v. o mpálla ; n-a batyo Matta  conté una historia a las personas, o - a banapa na bisOí  contaste mentiras a los estudiantes, etc. Mpachí , antrop. que nos remite a opatyí . Se localiza en Belebú. mpáJessi, pret. v. o mpálla ; aossa Bososso o - o boatta  antaño se hablaba de Bososo como noticia. mpálIa , v. contar, narrar, hablar de; o boitta a la e - bisijí . Pret. mpáám, mpálessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpanapénne', 'pi. piñas, ananás. el. 8 .', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('mpapara', 'pi. desmontes, desbroces. el. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpári', 'ayer; to seí ripotto  ayer estuvimos en la ciudad. mpeem, pret. v. o mpella ; e enokonokko e - o botyo emaókoro  el ogro lanzó a la persona un mango.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpele', 'obtenido a partir de pellé . Se refiere al "ladrón" o a la "persona des honesta e impúdica". Mpelé se localiza en Belebú. mpeJessi, pret. v. o mpella ; e nooa e - o botyo tuái  la serpiente lanzaba sali va a la persona. mpella , v. lanzar algo a alguien, dar la bendi ción; o botéribbo a la - o obitábítta o bohullá  el espíritu da la bendición al guerrero. Pret. mpeem, mpelessi. mperá. conj. con tal de; - o to''óri e ette  con tal de que digas la verdad.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpesó', 'que debería escribirse Mpessó . Se localiza en Basuala. mpessi, pret. v. o mpá ; to - sibbó echábamos una mirada. mpessó, 1. s. sing. adoquinado. carretera. plaza. tarima. lugar elevado. 2. antrop. lugar elevado, algo que destaca. el. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpess', 'adoquinado', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Mpeyo', 'obtenido a partir del verbo o páa . Mpéyo se traducirá por "me han regalado algo". Se localiza en Rebola. 238 / mpí mpí, pret. v. o mpá ; a banánna ba - kotto las abuelas dieron un paso rítmico, avanzaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpilla', 'pi. golpes en la espalda. CL 8 . Tb. ipilla.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpo', 'sing. y pi. faena, tarea, trabajo, ocupación, deber, obligación, etc. Clases 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpOlo', 'pi. gestos, ademanes. CI. 8 . Tb. ipolo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpoppo', 'pi. papayas . CI. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpoppó', 'pi. caparazones. chochos. CI. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mposso', 'pi. delfines. CI. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpote', 'que se refiere a la media calabaza . Se localiza en Balachá, en Moka y en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpoté', 'sing. y pI. media calabaza. Cls. 9 y 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpoteri', 'pI. trozos de cristal. CI. 8 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpotó', 'gracia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('mpotópotóo', 'pi. agredecimientos, gracias. CL 8 . Ó', NULL, 'Fuente: bubi-español', 'import-script'),
  ('muára', 'sing. mujer, esposa. CI. 1 . Tb. warí , waísso .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('muarírimo', 'sing. espíritu guardián. mujer que vela por alguien. protectora. Cl. I . Tb. waíribbo .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('muatésabbá', 'sing. pacificador. modera dor juez. CI. I . Tb. bua tésapá .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muatetema', 'compuesto por el verbo o átta y el sustantivo etémá . Muatéetémá se puede traducir por "rompecorazón". Se localiza en Batete, en Moka y en Ruiché.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mübólo', 'vaina', NULL, 'Fuente: español-bubi', 'import-script'),
  ('mucha', 'mucho', NULL, 'Fuente: español-bubi', 'import-script'),
  ('muchas', 'gracia', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Mueba', 'que debería escribirse Mo''ebba . Se localiza en Baney y en Moka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muebake', 'que debería escribirse Mueebá ké . Se locali za en Basuala y en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mueda', 'que nos remite a Meda . Se localiza en Ruiché. Muelachoa , antrop. obtenido a partir del verbo o elláa y del sustantivo t yooa . Muelátyooa se referirá a alguien que ve o encuentra las termitas blancas. Mueñe , antrop. cuya traducción apro ximada es "espinilla" . Tam bién parece provenir de moenya . Se localiza en Batete.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muera', 'que debería escribirse Muera . Se localiza en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Muerabitá', 'obtenido a partir del verbo o muera y del sustanti vo bittá . Antiguamente Muerabittá se refería a aquellas personas que guardaban el secreto del ritual que permitía tener una buena cosecha de aceite. Se localiza en Moeri. Muhaleri , antrop. que debería escribir se Mo''áleri . Se trata de alguien con quien resulta fácil ponerse de acuerdo. Se localiza en Ureka.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('mujeres', 'aislamiento', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Mulé', 'numeral que hace referencia a "primero". Se localiza en Belebú. N n, 1. pref sujo yo; - sossi yo leí, - sosessi yo leía, ka sosá''á yo leeré, - tyá sossa yo no leo. 2. prtv. es; - tyóbbo es una casa, - tyebbá es un sueño.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('na''a', 'también', NULL, 'Fuente: español-bubi', 'import-script'),
  ('na''u', 'pi. verduras amargas. hierba moras. CI. 10 . Tb. nekku .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nabba', 'sing. y pI. carne cruda. animal salvaje, fiera. bárbaro, salvaje, bestia, bruto, feroz. Cls. 9 y 10 ; n ka ra''á -  voy a comer carne, 010 bOtyo - esta persona es un animal salvaje; - bo''í  animal muerto. n abOlessi , pret. V. o nabolla ; e biátto be -  los barcos navegaban. nabolla , V. navegar; e sitímma si lá - el bar co navega. Pret. naborí, nabolessi. nabori, pret. V. o nabolla ; e biátto be  los barcos navegaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Naele', 'obtenido a partir de enaéle . Naéle se localiza en Baney. nakessi, pret. V. o nakká ; n bo -  yo le echaba. nakká , V. echar, rechazar a alguien; o waísso a la - o bOie  la mujer rechaza al hombre. Pret. nakkí, nakéssi. nakkí, pret. V. o nakká ; n - 010 botyo  eché a esta per sona, to - a abitábítta  recha zamos a los militares.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nakko', 'sing. y pI. vulva, vagina. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nalle', 'sing. 1. mármol, pavimento, piedra de amolar 2. ciudad; na hella i - puá  voy a la ciudad. Cls. 9 y 10 . 240 I Narnasó Narnasó, an/rop. cuyo significado aproximado es "animal o bestia que es o existe". Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nálolláa', 'tataranieto', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nanakóbbo', 'sing. y pi. pellejos, pieles. Cls. 9 y JO. nánéa , v. enredarse; e epetté be la -  las cuerdas se enredan. Pret. nánéi, nánéseei. nánéi, pret. v. o nánéa ; e bilabba bi los hechos se enredaron. náneseei, pret. v. o nánéa ; e bilabba bi - los hechos se enredaban. nánessi, pret. v. o nánáa ; n  yo enganchaba, o -  tú engan chabas, a -  él enganchaba, to -  nosotros enganchábamos, 10 -  vosotros enganchabais, ba -  ellos enganchaban. náníi, pret. v. o nánáa ; e bilabba bi - los hechos se enredaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nanito', 'obtenido a partir del verbo o nánáa y el sustantivo plural j to . Náníto se localiza en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Napa', 'que presenta dos significados. En primer lugar, se referirá a la "podadera" o al "cuchillo para podar". En segundo lugar, signifi cará "mamar" o "chupar". En este último caso se refiere al verbo o nappá . Se localiza en Baney. napessí, pre/. v. o nappá ; o bollá a ta lelle  el niño no mama ba bien. Tb. ápessi. napía, pret. v. o nappiá ; e póríi e o obitya  la cabra ama mantó al ratón. napiesiia, pret. v. o nappiá ; n-yo amamantaba, o - tú amamantabas, a él ama mantaba, to - nosotros amamantábamos, lo vosotros amamantabais, ba ellos amaman taban.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Napo', 'cuyo significado aproximado es "dátil" de la palmera de aceite. Se localiza en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nappa', 'sing. y pi. cuchillo podador. Cls. 9 y 10 . nappá , v. mamar; e sine''e si lá -  el bebé mama. Pret. nappí, napéssí. Tb. o áppa. nappí, pret. v. o nappá ; 010 botyo ata abelle roló botSo ata náppi abelle] esta persona no ha mamado leche materna. Tb. áppi. nappiá , v. amamantar; e póríi karí e lá - e sipóríi  la cabra amamanta al cabrito. Pret. napía, napiésiia. naríbba , v. dispersarse; o tonorí to lá - la e ekokoo e etataa  los pájaros se dispersan con el disparo de la escopeta. Pret. naríbbi, naríbessi. naríbbi, pret. v. o naríbba ; a batyo bammaa ba - todas las personas se dispersaron. naríbessi, pre/. v. o naríbba ; a batyo ba mmaa ba -  todas las personas se dispersaban, o tonorí álle to -  los pájaros también se dispersaban. naríbia , v. ahuyentar, espantar. disper sar ; e ekukuu e lá - a batyo  el trueno espanta a las personas. Pret. naríbiia, naríbiesiia. naríbiesiia, pret. v. o naríbia ; a bollá ba - e besoppé  los niños espantaban a las ardillas. naríbiia, pret. v. o naríbia ;', NULL, 'Fuente: bubi-español', 'import-script'),
  ('narnrno', 'sing. y pi. dátil de la palmera de acei te. Cls. 9 y 10. Tb . pi/lá. nánáa , v. enganchar, enredar; to la - e riotté  nosotros enredamos la red. Pret. náníi, nánéssi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('natta', 'sing. y pi. biznieto. Cls. 9 y 10. nawera , v. remar; a baobbe ba lá - la e benne be ábo  los pescadores reman con sus dedos. Pret. naweria, naweresiia. naweresiia, pret. v. o nawera ; tue ammaa to - la e pullá  todos nosotros remábamos con el huracán. naweria, pret. v. o nawera ; a batyo ba la e pullá  las perso nas remaron con el huracán. Nchana , antrop. formado a partir de la expresión n tyá na ''u . Ntyána se loca liza en BOS080. Nchaso , an/rop. construido a partir de la expresión n tyá soou . Debería escri nekku / 241 birse Ntyasso. Se localiza en Basakato de la Sagrada Familia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Ndele', 'que significa "camino", "sendero" . Ndele se localiza en Moka. ne, 1. prl!f suj. yo. 2. formo verbo soy, estoy; botyo soy una persona, - hállo estoy aquí. né, mor:[. mi, mío. contracción del sufijo posesi vo -ro y el morfema é; o botyo - mi pariente, o bOllá - mi hijo, a bellá - mis lágrimas. Tb . -rí, -nyí.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ne''i', 'tomate', NULL, 'Fuente: español-bubi', 'import-script'),
  ('ne''í', 'sing. y pI. berenjena, tomate. Cls. 9 y \O .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nebba', 'sing. y pI. iguana, reptil comestible. Cls. 9 y \O . nebba , V. despertar a alguien; we le nebbe no me despiertes. Pret. nebbi, nebessi. Tb. o ebba. nebbi, pret. V. o nebba ; n-e kario''e  yo desperté a la gallina, o - o wéso''o o  tú despertaste a tu amigo, a le - él/ella me despertó, to - desperta mos, \O bO - vosotros le despertasteis, ba e -  ellos nos despertaron. Tb. ebbi. nebea , v. despertarse, levantarse; a batyo ba Já - la e nokonoko  la gente se despierta con el ruido. Pret. nebei, nebieseei. Tb. o ebea. nebei, pret. V. o nebea ; n- la e nokonoko  me desperté con el ruido. lb. ebei. nebessi, pret. V. o nebba ; n o oberíi ro wáae na á''a wéi  yo despertaba a mi madre pero había muerto. Tb. ebessi. nebieseei, pret. v. o nebea ; a baitta ba - la o loé \O a batyo bá e tyélle  los altos dig natarios se despertaban con los lloros de las per sonas de la cárcel. lb. ebieseei. nebiilea , V. estirarse, desentumecer; e puá e lá - e ebari  el perro se estira por la mañana. Pret. nebolei, n', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Neka', 'obtenido a partir del verbo o neka . Se localiza en Baney. nekekessi, pret. V. o nekekka ; a bayolla ba áó ba tá - ba sessi la i pohá i ábo  nuestros abuelos no dudaban cuando rea lizaban sus hazañas. nekekia , V. aflojar, debilitar; to la - e eta póllo  nosotros aflojamos la lona. Pret. nekekiia, nekekiesiia. nekekiesiia, pret. V. o nekekia ; n bo - ii biisiirí ro  yo aflojaba mi cordón. nekekiia, pret. V. o nekekia ; n e - e etapóllo  yo aflojé la lona, o bi - e bitapóllo  tú aflojaste las lonas, a bo - o bOsorí  él/ella aflojó el cordón, to - noso tro� aflojamos, \O - vosotros aflojasteis, ba -  ellos/ellas aflojaron. nekekka , V. dudar, titubear; tyommaa o bulabotyo tyi -  jamás duda un defensor. Pret. nekekki, nekekessi. nekekki, pret. V. o nekekka ; n ta - Ieláe  no dudé ni un ápice.', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('nekekka', 'titubear', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nekku', 'pI. verduras amargas. hierba moras. CI. 10 . Tb . na ''u . 242 / nélaam nélaam, pret. v. o nélalla ; to o bosekke  nosotros clava mos la tabla de madera, to bo - lo clavamos. nélalessi, pret. v. o nélalla ; o bobáa i tyóbbo a - o bosekke  el hacedor de las casas clava ba la tabla de madera. nélalla , v. clavar, crucificar; e kapinta e lá o bosekke  el carpintero clava la tabla de madera. Pret. nélaam, nélalessi. Tb. o nettá.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nell', 'bis', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nellá', 'indo otro, otra, otros, otras. Concuerda con las palabras de las Cls. 9 y 10; nabba - otro animal, otra carne, kollo - otras sardinas. nélOlessi, pret. v. o nélolla ; to - e tyal lá  nosotros desclavábamos la chapa de zinc. nélolla , V. desclavar; e kapióta e lá - e tyallá  el carpintero des clava la chapa de cinc. Pret. nélori, nélolessi. nélOri, pret. V. o nélolla ; e besekke m be - las tablas de madera las desclavé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nene', 'bello, hermoso, bonito, agradable. Con cuerda con las palabras de las Cls. 9 y 10 ; e nabba - un hermoso animal, i bappa - unas bonitas serpientes.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nepi', 'que debería escribirse Neppí . Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nepp', 'cantante', NULL, 'Fuente: español-bubi', 'import-script'),
  ('neppí', 'sing. y pI. cantante, músico. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('neppó', 'sing. y pI. sobrino, el hijo de la herma na. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('néri', 'sing. y pI. clavo. Cls. 9 y 10 . Tb. tokko.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Neta', 'que parece provenir del verbo o net tá . Se localiza en Baney. netessi, pret. V. o nettá ; n-e biho''o lÍl  yo clavaba mis postes. Tb. né/alessi. nettá , v. clavar, incrustar; i kapinta kubbaa i lá - ollé  todos los carpinteros clavan algo. Pret. netyí, netéssi. T b. o nélalla. netyí, pret. V. o nettá ; n- o bosekke  yo clavé la tabla de madera, o - o lo''obbá e ello wela  tú incrustaste el cuchillo en el ñame, a - e kurússu  él/ella clavó la cruz, to - a baallá ba áí  nosotros clavamos sus manos, 10 - clavasteis, ba -  clavaron. Tb. o né/ori.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nikobara', 'obtenido a partir del verbo o nokObáára . Se refiere a alguien que traga sin masticar mucho. Se localiza en Baney. Njuhaleri , antrop. que debería escri birse Nhuáaleri . Se localiza en Riaba.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkobbe', 'sing. árbol del plátano. Cl. 5 . Tb. rikobbe .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáa', 'ahora', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nkuáaó', 'ahora, en este momento; ne''a poes si - acabo de llegar ahora. Tb. tyútyulé, dyíto, lá/a, láolé, nkuáhoole.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáhoole', 'ahora, ahora mismo, en este momento. Se localiza entre los usuarios de Baney. Tb. tyútyulé, dyíto, /ála, láolé, nkuáaó. nkutessi, pret. V. o nkutta ; n-me fastidiaba, o - te fastidiabas, a - se fastidiaba, to - nos fastidiábamos, 10 - os fastidiabais, ba -  se fastidiaban. nkutta , v. fastidiarse, perder; ba lá - lello ellos/ellas se fastidian hoy. Pret. nkutyi, nkutessi. ukutya , V. fastidiar, hastiar, aprovecharse de alguien; e enokonokko e lá - o tonokonokko  el ogro fastidia a los pequeños ogros. Pret. nkutyia, nku tyesia. nkutyesia, pret. V. o nkutya ; to bo - o bosubári  nosotros nos aprove chábamos de la benjamina. nkutyi, pret. V. o nkutta ; n-me fas tidié, n ka -  me he fastidiado. nkutyia, pret. v. o nkutya ; 10 le -  me habéis fastidiado, os habéis aprovechado de mí.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nmollo', 'sing. y pI. aguja, alfiler grande. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nná', 'sing. y pI. espalda, dorso. Cls. 9 y 10 ; o herá e -  lle var en la espalda, e - pua detrás, ao ? ¿qué tal? Tb. hNná.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nnabí''o', 'atrás, detrás, detrás de; pellá e  siéntate por la parte de atrás.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nnápua', 'detrás; e - e eriia  detrás del pueblo, a espaldas del pueblo. nne, moif. numo cuatro. Concuerda con las pala bras de la Cl. 10; nabba yé - cuatro animales. nokkó / 243 nné, 1. morj: numo uno. Concuerda con las pala bras de la Cl. 7; eriia é - un poblado. 2. prono sing. otro, otra. Concuerda con las palabras de la CL 7; elo eriia , e - este pueblo, el otro. úne, prono yo ; - ne bOllá yo soy un niño.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nno', 'suelo, abajo; o - abajo. nnolla , V. resucitar, reanimar; botyo ata pá''e o - o na á''a wéi  la persona no se puede resucitar si ha muer to. Pret. nnori, nnuessi. nnorea , V. resucitarse, reanimarse; o botyo e''a binni o o motóo a la -  la persona que fue atropellada por el coche se reanima . Pret. nnorei, nnueseei. nnorei, pret. v. o nnorea ; o lá o bollá e eruppé a -  dicen que el hijo de Dios resucitó. nnori, pret. v. o nnolla ; n-o botyo e''a wéi ó  yo resu cité a la persona que había muerto, o e - e puá  tú reanimaste al perro, a - rea nimó, to - reanimamos, Iii - reanimasteis, ba reanimaron. nnueseei, pret. V. o nnorea ; e sipós si si -la i kollo  el gato se reanimaba con las sardinas. nnuessi, pret. V. o nnolla ; to - e beatta bi áó  noso tros resucitábamos nuestras historias. no''ía, pret. v. o no''iáa ; n ba a biitá  calenté el aceite. no''iáa , V. calentar, templar; to la - a biitá  nosotros calentamos el aceite. burlar, molestar; wele no''ie no me molestas. Pret. no''ía, no''iesiia. n', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nobanoba', 'sing. y pI. bostezo. Cls. 9 y 10 . nobba , V. bostezar; a batyo ba lá - kóri o bosabóatta a la to''ólla la gente bosteza porque el narrador está hablando. Pret. nobbi, nobessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nobbe', 'sing.y pI. enfado, enojo, cabreo. Cls. 9 y 10. nobbi, pret. V. o nobba ; e ko''e e - la gallina bostezó.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nober', 'sed', NULL, 'Fuente: español-bubi', 'import-script'),
  ('noberí', 'sing. y pI. sed. ganar. Cls. 9 y 10; - kobó mucha sed, n Iii''á e - o  tengo ganas de ti. nobessi, pret. V. o nobba ; o boie Ól a mi padre bostezaba. Noconoco , antrop. cuyo significado encontramos en Nokonoko. Se localiza en Bare só . noessi, pret. V. o nooa ; o sessi la o boatta o n -  cuando conta bas tu historia me reía. nóessi, pret. V. o nóa ; to - i pillá  nosotros molíamos los dátiles. noessitooa, pret. v. o noatooa ; n- o towessi lá  me reía cuan do hablabas, o - o''a lokki lá  te reías cuando dormías, a - se reía, to tue ammaa nos reíamos todos, lo - os reíais, ba -  se reían. Noha , antrop. que debería escribirse Nooa . Se localiza en Baney y en Basakato de la Sagrada Familia. nói, pret. V. o nóa ; Iii - e bekobbe  molisteis los plá tanos. noitooa, pret. v. o noatooa ; n - sóté me reí mucho, o - o opullo te reíste en el pasado, a - se rió, to - bó botyíó nos reímos anoche, Iii - os reísteis, ba -  se rieron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokk', 'ojo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nokké', 'sing. y pi. manantial, fuente natural, f uente. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokko', 'sing. y pi. ojo, vista. Cls. 9 y 10 ; herá aho i - pon allí los oj os, vigila, presta atención, pulóo o pe ¡-o lorá  ven y da a tus ojos alimento .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokkó', 'sing. 1. arcoiris. ninfa, hada, mujer del río en la mitología popular de Guinea Ecuatorial, y por medio de la cuál se pueden obtener toda clase de favores, desde hacer el bien hasta desear y hacer el mal a alguien. Cls. 9 244 / Noko y 10 . 2. arco. el. 10 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Noko', 'que debería escribirse Nokkó o Nokko . Se localiza en Baney. nokobbia , v. alborotar, hablar en voz alta, etc.; a batyo ba lá - líke las personas hablan mucho. Pret. nokobiia, nokobiesiia. nokobiera , v. engullir, tragar, devorar; e elo''á e lá - a baobbe  el mar engulle a los pescadores. Pret. nokobieriia, nokobieresiia. nokobieresiia, pret. v. o nokobiera ; e erukurukku e - e pórñ  la boa devoraba a la cabra. nokobieriia, pret. v. o nokobiera ; o lüebba lo - o boobbe  la gran ola tragó al marinero. nokobiesiia, pret. v. o nokobbia ; bó botyíó a batyo bá é eriia ba  anoche las personas del pueblo hablaban en voz alta. nokobiia, pret. v. o nokobbia ; n- hablé en voz alta, o -hablaste en voz alta, a - habló en voz alta, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('nokonokko', 'bulla', NULL, 'Fuente: español-bubi', 'import-script'),
  ('nokonoko', 'sing. y pI. alboroto, ruido, bulla. els. 9 y 10. nokuera , v. dormir profundamente; o botyi bíi bo tyuáría n la -  el cansancio me hizo dormir profunda mente. Pret. nokueri, nokueressi. nokuerea , v. echar un sueñecito, dormitar, fingir que se duerme. Pret. nokuerei, nokueresei. nokuerei, pret. v. o nokuerea ; n-ele atoo eché un sueñecito esta tarde. nokueresei, pret. v. o nokuerea ; we le poe - cuando llegaste dormitaba. nokueressi, pret. v. o nokuera ; lue le poe to - cuando llegasteis dormía mos profundamente. nokueri, pret. v. o nokuera ; ne le sétye e elako n -  al terminar el trabajo dormí profundamente.', NULL, 'Fuente: bubi-español', 'import-script'),
