  ('nótto', 'pI. cuerpos. el. 10 . '' notya , v notyesiia. . vigilar atentamente. Pret. nótyía, nótya , v. mascar, rumiar; e pókkó e lá -  el buey rumia. Pret. nótyía, nótyesiia. nué / 245 jero se obstruye con el barro. Pret. ntéi, nteseei. nótyesiia, pret. v. o nótya ; n elol\ó  yo mascaba una corteza, o - simeressi  tú mascabas un medicamento, a - sibáka  él mascaba tabaco, to si - e sibáka nosotros mascá bamos el tabaco, 10 - vosotros mascabais, ba ellos mascaban. notyesiia, pret. v. o nótya ; tue - e húbbé nosotros vigilábamos al ladrón atentamente. notyi, pret. v. o notta ; 010 botyo a - sóté a tyibbi  esta persona miró tanto fijamente que se cansó. notyía, pret. v. o notya ; e kobinna tue - al gobierno le vigilamos atenta mente. nótyía, pret. v. o nótya ; e pókkó e -  el buey rumió. notyonotyo , s. sing. y pI. 1. herbá cea que forma matorrales de rizomas rastreros. 2. fr uto de esta planta. Clases 9 y 10 . Tb. okokue. ntá, 1. s. sing. señor, padre, tío, don. Cl. 1 . El plu ral de la Cl. 2 se e', NULL, 'Fuente: bubi-español', 'import-script'),
