  ('ñ''é', 'sing. y pI. sudor/es. Cls. 9 y 10 . na, pref suj. yo; - pulóo voy. Se obtiene a partir del prefijo sujeto n y el morfema de apoyo la; n la sossa  yo leo, n la ráa  yo como, etc. na''a , v. buscar, desear, necesitar; n la o -  te busco, te deseo, te necesito, n la - waísso quiero una mujer. Pret. na''i, na''essi. na''essi, pret. V. o na''a ; n - isa''a yo buscaba una lima, o - ¡; bOllá o  tú buscabas a tu hijo, a - él bus caba, to - nosotros buscábamos, 10 - vosotros buscabais, ba - ellos buscaban. na''i, pret. v. o na''a ; n-e rihueelÍl ripotto  busqué a mi familia en la ciudad. na''ia , v. ligar, conquistar; tue baseseppe to la - a bolábáari nosotros los jóvenes muchachos conquistamos a las chicas. Pret. na''iia, na''iesiia. na''iesiia,pret. V. o na''ia ; o le lá na ne lé bollá  cuando me conquistabas yo todavía era muy joven. na''iia, pret. V. o na''ia ; n - conquis té, o - conquistaste, a - conquistó, to - conquista mos, 10 - conquistasteis, ba -  conquis taron.', NULL, 'Fuente: bubi-español', 'import-script'),
