  ('obatyo', 'sing. costilla. CI. 3 . obba , v. pagar, resarcir; 10 la - lello vosotros pagáis hoy. Pret. obbi, obessi. obba , v. subir, ascender, trepar, escalar; n la e robbo  subo la escaleTa. Pret. obbi, obessi. obbá , v. fortalecer, madurar. Pret. obbí, obes si; o - rubbí fortalecer el prestigio o la fama, reconocer. obbe, a4i. sing. macho, varón. derecho. Concuerda con las palabras de la Cl. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
