  ('obbé', 'sing. el fruto de la atanga. CI. 7 . obbi, pret. v. o obba ; n -  pagué, o -  pagaste, a -  pagó, to -  pagamos, lo -  pagasteis, ba -  pagaron. obbi, pret. v. o obba ; n-e robbo  yo subí la escalera, o bo o obílla  tú subiste la palmera, a - e raatyé  ella se subió a la cama, to -  nosotros subimos, lo  vosotros subisteis, ba - a bobbo  ellas subieron las escaleras. obbí, pret. v. o obbá ; n-o botébbá lÍl  yo fortalecí mi corazón, bo - o opetté  tú fortale ciste la cuerda, o -  él fortaleció, to -  nosotros fortalecimos, 10 -  vosotros fortalecisteis, ba -  ellos fortalecieron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obé', 'malo, mala, feo, fea. Concuerda con las palabras de las Cls. l y 3; boebba - vinatero malo, botyo - persona mala o fea.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obe''a', 'sing. nadador, navegador. Cl. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obébá', 'sing. cazador. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obek', 'codo', NULL, 'Fuente: español-bubi', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('obeké', 'sing. codo. CI. 3 . obelessi, pret. v. o obella ; e eruppé a - o tobólIó  Dios pagaba a los pobres. Tb. piálessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obellá', 'sing. liana espinosa, bejuco. CI. 3 . obella , v. pagar, pagar a alguien, costear; e kobinna a la - a balakoláko ba áí  el gobierno paga a sus trabajadores. Pret. oberi, obelessi. Tb . o piálla.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obélle', 'sing. soltero. CI. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obélló', 'sing. anunciador. traductor, intér prete. CI. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obéolla', 'sing. anciano, viejo. CI. 7 . Tb . obetyityi .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obera', 'sing. partero, partera, comadrón, coma drona, matrona. CI. 1 . oberi, pret. v. o obelJa ; o mmásalÍl a le - ele) ebari  mi jefe me pagó esta mañana. lb. piám.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oberíbó''o', 'sing. suegra. Cl. I . Tb. mmethbó''o.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oberíi', 'sing. madre. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obessé', 'sing. la aldea, el poblado. CI. 3; na helIá -  voy al poblado, voy al pueblo. 252 / obessi obessi, pret. v. o obba ; n -  yo pagaba, o -  tú pagabas, a  él pagaba, to -  nosotros pagábamos, lo -  vosotros pagabais, ba -  ellos pagaban. obessi, pret. v. o obba ; mpári n -Iá e tyóbbo n ka eeIÍJ. o botté  ayer cuando subía la casa vi el árbol. obessi, pret. v. o obbá ; e bekobbe be - bakasso  los plátanos maduraban pronto.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obette', 'sing. palomero , parasol . CI. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obetyityi', 'sing. anciano muy mayor. CI. 7 . obía, pret. v. o obiá ; n -  for talecí, bo -  fortaleciste, o -  forta leció, to - e esaká áó  nosotros fortalecimos nuestra amistad, lii -  forta lecisteis, ba -  fortalecieron. obiá , v. fortalecer; tlÍe, to la - e esaká áó  nosotros fortalecemos nuestra amistad. Pret. obía, obiesiia.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Obiamo', 'que debería escribirse Óbiammo . Se refie re a alguien que cede el paso. Se localiza en Moeri. obiesüa, pret. v. o obiá ; n bi - e bilab ba  yo fortalecía los hechos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obíía', 'sing. botella de cerveza. CI. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obílla', 'sing. palmera, palmera de aceite. CI. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obitábítta', 'sing. guerrero, luchador, batalla dor. militar. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obitya', 'sing. ratón. Cl. 3 ; buelá otro ratón, o - buelá el otro ratón.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('objeto', 'obsoleto', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obo', 'dem. ese, esa. Concuerda con las palabras de la CI. 3; - botákko ese mensaje. obó, mor! adj. duro, fuerte. Concuerda con las palabras de la CI. 7: etue - cabeza fuerte, testa rudez. PI. CI. 8: "biobó".', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obo''ó', 'arriba, encima; - ó lobákko puá en el f irmamento, en el cielo; - e eruppé onnotyé o mmo  arriba dios, abajo el demonio.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obobée', 'sing. bubi, natural de la isla de Bio ko. Cl. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oboi', 'sing. podredumbre. CI. 3 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obokk', 'gemelo', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obokko', 'sing. gemelo, mellizo. CI. I .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obolóberíi', 'sing. hermano de madre. Cl. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oboobbo', 'amarillo, color ocre; sinta sé - hoja amarilla.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obosso', 'adelante, hacia delante, enfrente; na hella - o mme  voy a ver a la madre siguiendo el camino de enfrente .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obotelloo', 'en medio, en el centro.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obotóóbotó', 'blando, tierno, débil. Concuer da con las palabras de las Cls. 1 y 3; botyo - una persona débil, bohori - una tímida libertad.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obott', 'débil', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obotto', 'sing. debilidad, flojedad. Cl. 3 . Tb. obattó .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obottó', 'sing. debilidad, flojedad. abati miento. CI. 3 . 70. riotta , Motta , obotto .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obotyibótyi', 'falso', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obotyíbótyi', 'sing. embustero, mentiroso, falso, farsante. adulador. CI. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obotyo', 'sing. vida, mundo, naturaleza. CI. 3; ó''a há''á lólla va a llover. Tb. otyé.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obuéi', 'inado', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obulabatyo', 'sing. salvador, defensor. Cl. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obulabotyo', 'salvador', NULL, 'Fuente: español-bubi', 'import-script'),
  ('obulaella', 'sing. defensor, protector. abo gado. Cl. 1 . Tb. oburi .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('obur', 'defendido', NULL, 'Fuente: español-bubi', 'import-script'),
  ('oburí', 'sing. defensor. abogado. Cl. l . Tb . obulaella .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oburo', 'sing. defendido, salvado, libre. CI. 1 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oé', 'sing. algo. Cl. 7 ; ké - ¿qué pasa? Tb. ollé . oea , v. lavarse, bañarse; n la - la boppé bá hlÍlÍé  me lavo con agua caliente. Pret. oei, oeseei. oei, pret. v. o oea ; n -  me lavé, bo -  te lavaste, o -  se lavó, to  nos lavamos, lo -  os lavasteis, ba  se lavaron. oeseei, pret. v. o oea ; e puá - e eribba wela  el perro se bañaba en la charca. oessi, pret. v. o ooa ; a balakoláko ba - o mmássa ábO  los trabajadores rechazaban a su jefe. Tb. koe�''Si. okanori I 253 oessi, pret. v. o ooa ; ne - e akákka  yo lo lavaba, el cubilete de coco, we - e torosíssi  tú lo lavabas, el pantalón, tue e tyóbbo  nosotros lavábamos la casa. ohá , v. moler, machacar, amasar; to la - i tolla  amasamos el tolla . Pret. ohí, ohessi. oháa , v. decir, hablar; ká o la -le?  ¿qué dices? Pret. ohíi, ohessi. ohálessi, pret. v. o ohálla ; o botúkúaari - a batyo ba e eriia wela ba bo iálle  la alcaIde sa solicitaba la colaboración de la gente del pue blo para que le ayuden. ohálla , v. solicitar la ayuda o la col', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ohello', 'sing. futuro, devenir. Cl. 3. ohessi, 1. pret. v. o ohá ; e sarítyityi si - i tolla elo ebari  la viejecita molía el Urophyllum rubens esta mañana. 2. pret. v. o oháa ; n ta - Iabba  yo no decía nada. ohí, pret. v. o ohá ; e emasíín - e beakká  la máquina molió las almendras. ohía, pret. v. o ohiá ; e sine''e si - o biirihí  el bebé fue poseído por el espíritu de Borihí. ohiá , v. ser poseído por un espíritu; elo elottyí e lá - a Borihí  este sier vo es el que posee el espíritu de Borihí. Pret. ohía, ohiesiia. ohiera , v. invocar a un espíritu para alguien; e boyolla tyuíi, ohielá lee abuelo, por favor, invo ca a un espíritu para mí. Pret. ohieria, ohieresiia. ohieresiia, pret. v. o ohiera ; o boyolla e - el abuelo invocaba su espíritu para que nos atendiera. ohieria, pret. v. o ohiera ; o bOllá a - a batyo ba pooi bá  el niño invocó a su espíritu para la gente que llegó. ohiesiia, pret. v. o ohiá ; e aríoIla - e tyibba  la anciada era poseída por el espíritu de Tyibba. ohíi, pret. v. o', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ohittá', 'sing. cacería, caza. Cl. 3. oíia, pret. v. o oyáa ; n bo - o bosorí  apreté el cordón. okaan, pret. v. o okanna ; n ba a batyo  yo reuní a las personas. okáera , v. atacar a una personas entre varias; a batyo ba la - e húbbé  la gente ataca al ladrón. Pret. okáeria, okáeresiia. okáeresiia, pret. v. o okáera ; a abitábítta ba - o botyo a e eriia ro  los militares atacaban todos a mi paisano. okáeria, pret. v. o okáera ; a bakuerakueráa ba tá le - kóri n húbiia  los alumnos no me atacaron porque huí. okalessi, pret. v. o okalla ; n  yo abarcaba, bO -  tú abar cabas, o -  él abarcaba, to -  nosotros abarcábamos, \O -  vosotros abarcabais, ba -  ellos abarcaban. okalla , v. abarcar, reunir, sumar, amontonar, unir; o - beaó sumar deudas. Pret. okam, okari, okalessi. Tb. o okanna. okam, pret. v. o okalla ; n  abarqué, bo -  abarcaste, 0  abarcó, to -  abarcamos, lO  abarcasteis, ba -  abarcaron. okanessi, pret. v. o okanna ; n a batyo  yo reunía a las personas. okanna , v. unir, reunir, abar', NULL, 'Fuente: bubi-español', 'import-script'),
  ('oke', 'hacia el mar, hacia abajo; e mmo wa bale''o - o''á kii  oh Dios de los naturales de Basakato de la Sagrada Familia fortalécenos aquí abajo. okela , v. fatigarse por; n la - o betto  me fatigo por el trayecto. Pret. okerí, oke lessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Okele', 'que parece construirse a partir del verbo o okela . Se localiza en Bososo. okelessi, pret. v. o okela ; n -  me fatigaba por, bo -  te fatiga bas por, a -  se fatigaba por, to -  nos fatigábamos por, lo -  os fatigabais por, ba -  se fatigaban por. okelessi, pret. v. o okella ; e kobin na ne - ripukké  al gobierno le tenía una falta de consideración. okella , tener por/para; e bappa e lá le o - losi si la serpiente me tiene compasión. Pret. okeri, okelessi. okeri, pret. v. o okela ; n-o lOetto  me fatigué por la caminata, n ta e bitúrii  no me fatigué por las palizas. okeri, pret. v. o okella ; o botyoro n ka bo - elako  tuve un trabajo para mi pariente. okessi, pret. v. o okka ; a bollá ba - la o loetto  los niños se cansaban con el trayecto. okessi, pret. v. o okkáa ; n -  yo tenía, bo -  tú tenías, a  él tenía, to -  nosotros teníamos, 10 -  vosotros teníais, ba -  ellos tenían. okessi, pret. v. o okka ; a baie ba - i pillá  los hombres recogían los dátiles.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Oki', 'que significa "ñame" . Se loca liza en Moka. okia, pret. v. o okkiá ; a bi''ó ba le -  la fiebre me agotó. okiesüa, pret. v. okkiá ; o botyibíi bo le -  el cansancio me agotaba. okka , v. cansarse, agotarse. reunir. recoger, coger. Pret. okki, okessi. okka , v. recoger ; o bonatú''o ro a la - bato''a mi hermano mayor recoge ñames aéreos, - o tokollé o  recoge tus cosas. Pret. okki, okessi. okkáa , v. tener, poseer; to la - ri''uáa  tenemos suerte. juntar, aglutinar. obtener. Pret. okkíi, okessi. okki, 1. pret. v. o okka ; n -la e elako  me agoté con el trabajo. 2. s. sing. un tipo de ñame. el. 7 . Tb . eokki. okki, pret. v. o okka ; n -  recogí del suelo, bo -  recogiste del suelo, o -  recogió del suelo, to -  recogimos del suelo, lo -  recogisteis del suelo, ba -  recogieron del suelo. okkiá , v. cansar, agotar, baldar; o loetto lo lá le -  el trayecto me agota. Pret. okía, okiesiia. okkü, pret. v. o okkáa ; n - elako  tengo trabajo, tengo algo qué hacer.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okko', 'sing. avenida, bulevar. el. 7 . * e - ó botúkku la avenida del alcalde.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okkó', 'sing. bÍlho, lechuza. el. 7 . Tb. ekotekotte .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ókko', 'cadena', NULL, 'Fuente: español-bubi', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('okó', 'sing. día, de día. el. 7 ; o weelÍl e - o botyo  tú le vis te de día a la persona . OIerl / 255', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okokue', 'sing. 1. herbácea que forma matorrales de rizomas rastreros. 2. fruto de esta planta. Cl. 3 . Tb. niityonotyo. okólla , v. arrastrar, tirar de; o motóo bo lá - e rikotye  el coche arrastra al camión. Pret. okóri, okuessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okollo', 'sing. concha, caparazón del cangrejo. Cl. 7 .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okoputtú', 'sing. enjambre. Cl. 7 . Tb. opuputtu . okórea , v. arrastrarse; e esokolla e lá  el ciempiés se arrastra. Pret. okórei, okóreseei. okórei, pret. v. o okórea ; a bollá ba - e telle wela  los niños se arrastraron en el camino. okóreseei, pret. v. o okórea; e bilabba bi - la e ribOtyo  las cosas se arrastraban con el tiempo. okóri, pret. v. o okólla ; n ri - e raatyé  yo arrastré la cama, n - e raatyé  arrastré la cama.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('okoríbba', 'sing. lago, pantano. Cl. 7 . okosessi, pret. v. o okossa ; mpári to Iíkelíke  ayer nos movíamos mucho. okossa , v. moverse; e pókkó e tóppi o é e lá - ókuáaó  el buey que está atado se mueve ahora. Pret. okossi, okosessi. okossi, pret. v. o okossa ; o botté bo lobbó  el árbol se movió mucho. okuelessi, pret. v. o okuella ; n -  yo arrancaba de cua jo, bo -  tú arrancabas de cuajo, a  él arrancaba de cuajo, to -  nosotros arrancábamos de cuajo, 10 -  vosotros arrancabais de cuajo, ba -  ellos arrancaban de cuajo. okuella , v. desarraigar, arrancar . Pret. okueri, okuelessi; n la - e biruppú  yo arranco de cuajo las hierbas. okuerl, pret. v. o okuella ; n - i to lÍ1  yo arranqué de cuajo mis plantas de ñame. okuessi, pret. v. o okólla ; a batyo bammaa ba - e rikotye  todas las personas tiraban del camión.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Olá', 'que deberia escribirse Eiilá . Se refiere al personaje mitológico eolá mo tokape. Se localiza en Baney. OIálessi, pret. v. o olálla ; mpári to ba - o  ayer nos matábamos. OIálla , v. matarse, batallar, pegarse, combatir, pelear; to la ba - o  nos estarnos pegando. Pret. olám, olálessi. OIám, pret. v. o olálla ; i ko''e i ba -  los gallos se mataron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('olé', 'dem. aquel, aquella. Concuerda con los nombres de la Cl. 1 ; - boyolla  aquel abuelo, - bonánna  aquella abuela. olelessi, pret. v. o olella ; bolo botté n bo - o bolotyi  este palo se lo llevaba al guardián. OIelessi, pret. v. o olella ; o bonán na lÍ1 n bo - tyué o rótta  a mi abuela le compraba pesca do en el mercado. OIelessi, pret. v. o Olella ; o bulla á e eriia n bo - bihalle  a la donceUa del pueblo le mataba arenques, ne - e elako lÍ1 ene olelessi eelakóóm] yo maduraba mi trabajo. olella , v. llevar para alguien; to la - bOllá barí bombebbí  nosotros llevamos muñecas a las chicas, o wetta áí a la bo - ripéppa  su hermana le lleva un documento. Pret. ole ri, olelessi. OIella , v. comprar para; o buityü lÍ1 n la bo ribúkku  a mi hermanito le compro un libro. Pret. oleri, olelessi. OIella , v. matar para alguien, madurar algo; o boebba a la - e elako  el vinatero madura el trabajo. Pret. ole ri, olelessi. olerl, pret. v. o oleUa ; mpári to no - abúkku  ayer os llevamos libros. OI', NULL, 'Fuente: bubi-español', 'import-script'),
  ('olió', 'sing. dátil verde e inmaduro. racimo verde de dátiles. Cl. 7 ; na ó uperi o - we e okke  si te lanzan un racimo verde de dátiles no lo cojas .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('olláa', 'caber', NULL, 'Fuente: español-bubi', 'import-script'),
  ('ollé', 'sing. algo, objeto, cosa, materia. Cl. 7 ; na - e ta okkí boréi e lá bolla  si algo no tiene comensal se pudre . Tb . eollé', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ólló', 'sing. ofensa. CI. 7 ; o le mpeem -  me has ofendido. 010, adj. dem. ese, esa. Concuerda con las palabras de la CI. 1 1; - loribáa ese pelo. 010, adj. dem. este, esta. Concuerda con los nom bres de la Cl. 1; - bOyolla este abuelo. OIólló, temo a4i. viejo, veterano. Se pospone a los morfemas concordantes de las Clases a las que hace referencia: CI. I botyo b - persona vieja/mayor. CI. 3 bokutta b - vieja manta. CI. 5 ripotto r - vieja ciudad. CI. 7 esussa - viejo zorro. Cls. 9 y 10 eti ke''u k - vieja suciedad. CI. I I loetto 1-antigua caminata. Cl. 12 settya s vieja cabañita. CI. 16 habba h - un viejo lugar. CI. 6b labba 1 - viejo asunto. Cl. 2 batyo b veteranas personas. CI. 4 beatta be - viejas his torias. CI. 6 apotto b -  viejas ciudades. Cl. 8 biriia bi - viejos poblados. CI. 13 to''ú t - viejas fuerzas, etc.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('olól', 'obsoleto', NULL, 'Fuente: español-bubi', 'import-script'),
  ('olóll', 'obsoleto', NULL, 'Fuente: español-bubi', 'import-script'),
  ('ometya', 'sing. bufón, cómico, humorista, paya so. CI. l .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ommo', 'sing. más allá, morada de espíritus. Cl. 3.', NULL, 'Fuente: bubi-español', 'import-script'),
