  ('opowári', 'sing. madre criadora. el. 1 . oppa , v. atragantarse, ahogarse; o oberíi ÓI a la -la boppé  mi madre se atraganta con el agua. Pret. oppi, opessi. oppa , v. tardar, durar, demorar, perdurar; o obé bá a la -  el cazador tarda, we oppe no tardes, íme n la - e telle  yo soy quien se demora. Pret. oppi, opessi. óppa , v. pegar, golpear, azotar. Pret. óppi, ópessi; o - e eoso  encajar, o - botyo o bobba puá tirar a alguien al suelo. oppi, pret. v. o oppa ; e kario''e e - la i puápuá yá i ressi  la gallina se atragantó con los granos de arroz. oppi, pret. v. o oppa ; o''a - Iobbó  has tardado mucho, lello n - ripottO  hoy he tardado en la ciudad. óppi, pret. v. o óppa ; lo''a le - lo''a le ikki, na ló''a le pa''o olláa ná ló''a le oríi  me habéis pegado, me habéis insultado, si pudierais matarme me habríais matado. oppia , v. atragantar, ahogar; o tuái to lá bo  la saliva le atraganta. Pret. oppiia, opiesiia. oppiia, pret. v. o oppia ; a bo''á ba - o botyo  el agua sala da ahogó a la persona.', NULL, 'Fuente: bubi-español', 'import-script'),
