  ('opussu', 'sing. juego, diversión, pasatiempo. el. 3 . oráa , v. enviar, mandar; a bayolla ba áó ba lá - bohullá buebue  nuestros abuelos envían una buena ben dición. Pret. oóa, oresiia. Tb. o ará.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Oraca', 'construido a partir de oreklw . Está localizado en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('orekka', 'lejos, lejano; na hella o -  voy lejos. oresiia, pret. v. o oráa ; n - boa tabOatyo  yo enviaba una carta, bo - bihánna  tú envia bas retratos, a - basoppo  él enviaba panes, to - batyo  noso tros enviábamos a algunas personas, 10 - bentyo  vosotros enviabais hechizos, ba -  ellos enviaban. ori, pret. v. o olla ; na o - o la hella bOlobbO  si lo niegas te convertirás en un monstruo. orla, pret. v. o oráa ; o bObelleÓJ a le - o boatta  mi hermano me envió la noticia. Orichi , antrop. que debería escribirse Oriityé . Se ha formado a partir del pret. v. oríi y del sustantivo plural i tyé . Se localiza en Riaba, en Moka y en Moeri.', NULL, 'Fuente: bubi-español', 'import-script'),
