  ('orle', '1. el lado izquierdo mirando al mar. 2. sur. oro, pret. v. o olláa ; mpári n ka - o bOllá e rokútta  el militar mató a las personas que no quieren al alto digna tario. Tb . oom. osea , v. obrar con maldad, hacer algo adrede; 010 botyo a la le -  esta perso na obra con maldad conmigo. Pret. osei, oseseei. osei, pret. v. o osea ; 010 botyo a le -  esta persona obró conmigo con maldad. oselessi, pret. v. o oseIla ; e elottyí to e -  al siervo le ofrecíamos algo para que realizara un rito tradicional. osella , v. ofrecer algo a alguien para que rea lice un rito tradicional; to la - o mmo  nosotros ofrecemos algo al espíritu. Pret. oseri, oselessi. oserl, pret. v. o osella ; e elottyí to e  al siervo le ofrecimos algo para que realizara un rito tradicional. oseseei, pret. v. o osea ; o bohiá rúppe a - a batyo  el sacerdote obraba con maldad con las personas. osessi, pret. v. o ossa ; n o -  yo te hacía algo adrede, n-yo libaba, o -  tú hacías algo adrede, tú li babas, a -  él hacía algo adr', NULL, 'Fuente: bubi-español', 'import-script'),
  ('osso', 'l. enfrente, delante. 2. este. ótáam, pret. v. o ótalIa ; {me n ka - e ribúk kuÓJ  yo olvidé mi libro. ótálessi, 1. pret. v. o ótalla ; n ri - e isa''a Ó J  yo olvidaba mi lima. 2. pret. v. o ótáIla ; 010 bOie n bo - ba''u  a este señor le vendía vino de palma. ótalla , v. olvidar; o boioppé o a la - e ripelló o  tu tío olvida tu fiesta. Pret. ótáam, ótálessi. ótálla , v. vender algo a alguien. delatar; we le otálle a batyo  no me ven das a la gente, no me delates. Pret. ótári, ótálessi. ótári, pret. v. o ótálla ; o bOtúkku - a batyo a apotto  el jefe del pueblo delató a la gente ante los blancos.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('óte', 'sing. grande, voluminoso, importante. Concuerda con las palabras de la Cl. 7; eriia poblado grande, poblado importante, elabba asunto importante. otee, acij. sing. grande, voluminoso, importante, destacado. Concuerda con las palabras de la Cl. 7; e etataa -  la escopeta grande. ótelessi, pret. v. o ótella ; a batyo ba e - a lokko la áó  la gente nos vendía nuestras cosas. 260 / óteUa ótella , v. vender para alguien; o wéso''o o a la o - e billo o  tu a migo te vende tus ñames. Pret. óteri, ótelessi. óteri, pret. v. o ótella ; a bakollé ba e - i píssi  los braceros vendieron el pescado salado para nosotros. otessi, pret. v. o otta ; n-e esíl la a o oberii Ól  yo trenzaba el cabello de mi madre, o - e riotté  tú hilabas la red, a - e besorí  él trenzaba los cordones, to - besippa  nosotros trenzábamos trenzas, 10 - voso tros trenzabais, ba -  ellos trenzaban. otessi, pret. v. o ótta ; n séi la boseseppe n - basoppo  cuando era joven yo vendía panes, e pateri - a batyo  el párro co delatab', NULL, 'Fuente: bubi-español', 'import-script'),
  ('otee', 'grande', NULL, 'Fuente: español-bubi', 'import-script'),
  ('oto', 'dem. esos, esas. Concuerda con las pala bras de la Cl. 13; - tonoke esas criaturas. otOlessi, pret. v. o otolla ; n-yo destrenzaba, o - tú destrenzabas, a él destrenzaba, to - nosotros destrenzábamos, 10 - vosotros destrenzabais, ba -  ellos destrenzaban. otolla , v. destrenzar, deshilar, destejer; to la e etúkká  nosotros destejemos la cesta. Pret. otori, otOlessi. otori, pret. v. o otolla ; e le poe o boláwáarí a - o  cuando llegó la muchacha le destrenzaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('ototto', 'lejos, lejanía. Tb. otto. otta , v. trenzar, hilar, tejer; o tonorí to lá rubOo  los pájaros tejen un nido. Pret. otyi, otessi. ótta , v. vender, delatar. Pret. otyíi, otessi; we le otee  no me vendas, no me delates.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('otto', 'lejos, lejanía. Tb. otollo. otya, temo numo el primero, la primera. Concuerda con la Clase de la palabra referida. otyáa , v. domar, domesticar; n la - e eossi  yo domo al caballo. Pret. otyía, otyesiia. otyaan, pret. v. o otyanna ; o waísso - o bOlIá  la mujer cuidó del niño. otyanessi, pret. v. o otyanna; o mmása - a balakoláko  el jefe negociaba con los trabajadores. otyanna , v. cuidar; o biitóweri a la - o boat t a  el intérprete cuida de la historia negociar. Pret. otyaan, otyanessi. otyarea , v. velar por, cuidar de; o la - e tyóbbo o boyolIa o  tú cui das de la casa de tu abuelo. Pret. otyarei, otyareseei. otyarei, pret. v.. o otyarea ; n - o bOlIá  yo cuidé del niño, yo velé por el niño. otyareseei, pret. v. o otyarea ; o luuaÓl n 10 -  mi vestido, yo cuidaba de él.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('otyé', 'sing. universo, mundo, naturaleza. sociedad, entorno. Cl. 3. Tb. iibOtyii. otyesüa, pret. v. o otyáa ; n ta - e biossi  yo no domaba a los caballos. otyi, pret. v. o otta ; o - e esíl la o bulla  yo trencé el cabello de la doncella. otyía, pret. v. o otyáa ; o - e eossi  yo domé al caballo. otyíi, pret. v. o ótta ; o bo - o bokutta  vendiste la manta, n-o botyo Ól  yo traicio né a mi pariente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Owete', 'que se encuentra en la fase de la vocalización del fonema oclusivo bilabial Ib/. Debería escribirse obette . Se localiza en Baloeri. oyáa , v. apretar; o la - e inoo  yo aprieto el nudo. Pret. Oíia, oyesiia. oyáera , v. esperar, aguardar; to la - a batyo ba heri ba obáám  esperamos a las personas que fueron a la finca. Pret. oyáeriia, oyáeresiia. oyáeresiia, pret. v. o oyáera ; n -  yo esperaba, bo -  tú esperabas, o -  él esperaba, to  nosotros esperábamos, 10 - vosotros esperabais, ba -  ellos esperaban. oyáeriia, pret. v. o oyáera ; mpári ne - e euláúla  ayer esperé el coche. oyesiia, pret. v. o oyáa ; ne - e ebélette o boyollaÓl ene oyesiia eebelette o bóyóllaam] yo apretaba el cinturón de mi abuelo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('Oyó', 'probablemente formado a partir de ó ''io . Está localiza do en Baresó y en Baney. pa, mor:f numo dos. Concuerda con las palabras de las Cls. 2, 4, 6 Y ID, previa anteposición del correspondiente morfema concordante; batyo a - dos personas, beheú e - dos huevos, baatyé a dos camas, nabba - dos animales.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('pa''á', 'sing. amante, concubino, ligue. Cls. 9 y 10 . pa''a , v. poder, ser capaz; to la pa''e to la se  podemos, hagámoslo. qui tar, sacar; a baitta ba lá - o luua 10 ábo  los dignatarios quitan su bandera. Pret. pa''i, pa''essi. pa''essi, pret. v. o pa''a ; o bohiarnrno a - e bentyo  el espiritista quitaba los hechizos. pa''i, pret. v. o pa''a ; e ribatyu ri áí n ri -  su braga, se lo quité. páa , v. dar, donar, dispensar; o rnrnásaÓl a la le - billo n ebbee  mi jefe me da días para que yo descanse. regalar, obsequiar, ofrecer; o waísso Ól a la le - ehátyibianna  mi mujer me da un abrazo. ofrecer, ceder, conceder. * 0-to''ú  noso tros autorizamos al niño. Pret. péi, pessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('paao', 'sing. y pI. sien. Cls. 9 y ID. paatessi, pret. v. o paatta ; n -  yo volaba, o -  tú volabas, a -  él volaba, to -  nosotros volá bamos, 10 -  vosotros volabais, ba  ellos volaban. Tb. haatessi. paatta , v. volar; a batyiáñtyo ba lá - botyíó los hechiceros vuelan de noche. Pret. paatyi, paa tessi. Tb . o haata. paatyi, pret. v. o paatta ; e bikokka bi  las águilas volaron. Tb. haatyi. pabba , v. pestañear; ná n la to''ólla n tyi -  cuando hablo no pesta ñeo. Pret. pabbi, pabessi. pabbi, pret. v. o pabba ; n -  pestañeé, o - pestañeaste, a - pestañeó, to - pes tañeamos, 10 - pestañeasteis, ba -  pesta ñearon. pabessi, pret. v. o pabba ; o le ekessi lá n -  esta persona hur ga en mis cosas. Pret. pakaria, pakaresiia. Tb. o passa. pakaresiia, pret. v. o pakara ; o bollá a - a lokko el niño revol vía las cosas. 262 I pakaria pakaria, pre/. v. o pakara ; n la - a lokko la áí  yo revolví sus enseres. Pako, an/rop. que proviene de pakopako . Algunos usuarios lo consideran un préstamo de otra l', NULL, 'Fuente: bubi-español', 'import-script'),
