  ('Paralele', 'cuyo significado encontramos e n Eparalele. Está localizado en Moka. paresiia, pret. v. o para ; n -  yo ofrendaba, o - tú ofrendabas, a - él ofrendaba, to - nosotros ofrendábamos, lo vosotros ofrendabais, ba -  ellos ofrendaban. paresiia, pret. v. o paráa ; o mmé a - o botólló  la señora hacía llegar el mensaje. parí, 1. pret. v. o palláa ; n - botyió  llegué de noche. 2. pret. v. o pálla ; o boie ro bue''a - á ná o tyí''a sosalla o  mi padre fue quien dijo que no se contaba contigo. Pariché , antrop. construido a partir del verbo o paráa y del sustantivo plu ral i tyé . Párityé se refe rirá a alguien que hace llegar a los países. Se localiza en Batoicopo. pariia, pret. v. o para ; e robbo n ri  el rito lo ofrecí . paríia, pret. v. o paráa ; o M''e m M - el fargo lo hice llegar.', NULL, 'Fuente: bubi-español', 'import-script'),
