  ('Pasialo', 'que debería escribirse Pasí''alo . Está localizado en Ruiché. passa , v. revolver, escarbar, hurgar, etc. o - a lokko  hurgar en las cosas, revol ver las cosas. Pret. passi, pasessi. Tb . o papara. passi, pret. v. o passa ; mpári to - i kuua  ayer revolvimos la ropa.', NULL, 'Fuente: bubi-español', 'import-script'),
