  ('pelello', 'pi. burlas. ironías. Cl. 10 . peleri, pret. v. o pelella ; to bi - e binyankue nos burlamos de los cabezudos. pelessi, pret. v. o pella ; to séi la ripotto to ta - o rótta  cuando estuvimos en la ciudad no llegábamos al mercado. pélessi, pret. v. o pélla ; n yo vivía, o - tú vivías, a - él vivía, to - nosotros vivíamos, lo - vosotros vivíais, ba - ellos vivían.', NULL, 'Fuente: bubi-español', 'import-script'),
