  ('pen', 'sing. inconveniente, impedimento. Cls. 9 y 10 . pénera , v. 1. hacer algo por/para alguien; o bulla to la bo - ripelló a la doncella le hacemos una fiesta. 2. arreglarse; n la - e esílla lÍl  yo me arreglo el pelo. 3. festejar, celebrar; to la - ello n berí o é  nosotros celebramos el día de mi naci miento. Pret. péneriia, péneresiia. péneresiia, pret. v. o pénera ; 010 botyo n bo - e bilako bi áí roló botJo m bo péneresíé bilakó bíááí] a esta persona le hacía sus trabajos, n ba - kóri ha séi ripelló  me arreglaba porque había fiesta. péneriia, pret. v. o pénera ; lello ommaa o wéso''o lÍl m bo - e elako áí  durante todo el día a mi compañero le hice su trabajo. pénessi, pret. v. o pénna ; to a baotté la besorí  nosotros hacíamos las redes de pesca con hilos. pénna , v. hacer, fornicar, fabricar; a bayolla ba lá - i pohá i ábo  los ancianos hacen sus proezas. Pret. péém, pénessi. péótalessi, pret. v. o péÍltalla ; a bakuera kueráa ba - a bate  los escolares pintaban las piedras. péútall', NULL, 'Fuente: bubi-español', 'import-script'),
