  ('pepenna', 'sing. y pi. tobillo/s. Cls. 9 y 10. Tb . kekesse, pepelle. pépessi, pret. v. o péppa ; o bOoáooa ro a - a abaUá  mi abuela enrollaba los rollitos de malanga. pepólessi, pret. v. o pepólla ; o - e ion o  yo desen rollaba el nudo. Tb . pepueessi. pepólla , v. desdoblar, desenrollar; e aríolla e lá - e eppáa  la anciana desenrolla la pulsera de tyíbbo. Pret. pepóm, pepólessi . pepóm, pret. v. o pepólla ; oe - e iIloo  desenrollé el nudo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('peppa', 'pI. caolín, mineral de arcilla blanca y dura. Clase 10 . Tb. kalabátyoko. péppa , v. enrollar, doblar, devanar; tyuíi - se e sipéppa  por favor dobla el papel. Pret. péppi, pépessi. peppáa , v. doblar, enrollar; o la ri - e ripép pa  yo 10 enrollo, el docu mento. Pret. peppíi, pepessi.', NULL, 'Fuente: bubi-español', 'import-script'),
