  ('perí', 'sing. y pI. veneno. Cls. 9 y lO. peri, pret. v. o pella ; o - sornó  llegué a ser valiente, o ta - sornó  no llegué a ser valiente, o - botyo  llegaste a ser alguien, o bollá a ta bOtyo  el niño no llegó a ser alguien, no llegó a vivir. Tb . peem. periia, pret. v. o pera ; o r notóo bo le - otottto  el coche me llevó lejos.', NULL, 'Fuente: bubi-español', 'import-script'),
