  ('pillá', 'sing. y pI. dátil de la palmera de aceite. Cls. 9 y 10. Tb. nammo. pilla , v. plantar o fijar un poste o un palo en la tierra; 10 la - batté vosotros plantáis postes . Pret. piri, pilessi. pipea , v. adornarse, engalanarse, acicalarse; a bakuerakueráa ba lá - Iello  los estudiantes se engalanan hoy. Pret. pipei, pipeseei. pipei, pret. v. o pipea ; o bulla a''a - mpári  la doncella se engalanó ayer. pipelessi, pret. v. o pipella ; o wettalÍl n bo - o bOllá áí  a mi hermana le engalanaba a su hijo. pipella , v. adornar para, engalanar para; to la - e eriia kóri he ripelló  nosotros adornamos el pueblo porque hay fiesta. Pret. piperi, pipelessi. piperi, pr et. v. o pipella ; ne - e tyóbbo lÍl  adorné mi casa. pipeseei, pret. v. o pipea ; to - kóri to séi ripelló  nos engalanábamos porque estábamos de fiesta. pipessi, pr et. v. o pippa ; o loa lullé a batyo bammaa ba - i tyóbbo yábbO el año pasado todas las personas adornaban sus casas. pippa , v. adornar, engalanar, decorar, or namentar; a', NULL, 'Fuente: bubi-español', 'import-script'),
