  ('po''a', 'sing. y pi. mono, macaco. Cls. 9 y 10 . poalelessi, pret. v. o poalella ; a batyo ba mmaa ba -  todas las personas se daban las manos. poalella , v. darse las manos; to la nos damos las manos. Pret. poaleri, poalelessi. poaleri, pr et. v. o poalella ; n o boríbáa  yo di la mano al extranjero. pobba , v. charlar, conversar, parlamentar, pla ticar; a batyo ba lá - las personas charlan. Pret. pobbi, pobessi. pobbá , v. burlarse, reírse de alguien, mofarse, despreciar; o la le -?  ¿te ríes de mí? Pret. pobbí, pobessi. póbba , v. reventar, explotar, reventarse, deto nar; o buellá o bo lá -  tu vientre revienta. Pret. póbbi, póbessi. pobbi, pret. v. o pobba ; a batyo appa lé ba - Ielle  las dos personas charlaron muy bien. pobbí, pr et. v. o pobbá ; n-o botyo  me burlé de la persona. póbbi, pret. v. o póbba ; e etue áí e -  su cabeza reventó. póbbia , v. reventar, explotar, hacer reventar, hacer explotar, detonar; a bakuerakueráa ba lá - e ibolobOlló  los alumnos hacen reventar los glo bos. ', NULL, 'Fuente: bubi-español', 'import-script'),
