  ('Pola', 'que debería escribirse Pollá . Se localiza en Baney y en Batoicopo. pOlelessi, pret. v. o polella ; o wéso''o lÍl a le - mi amigo me evitaba, n - i to l Í l  yo cavaba alrededor de mis ñamales. pOlella , v. 1. prevenir, evitar; o bonatú''olÍl a la o -  mi hermano mayor te evita. 2. cavar alrededor de la planta del ñame; abó rnrne ba la e biheelÍl  las señoras cubren con barro el bajo tallo de las plantas de la malanga bubi . Pret. pOleri, polelessi. pOleri, pret. v. o po  yo evité al soldado. pOlessi, pret. v. o pollá ; o boie o a - a barnrnáloto ba áí  tu padre podaba sus cacaoteros. pollá , v. esquilar, podar. escoger las hojas buenas. trocear; to la - o bOka''ó  nosotros escogemos las buenas hojas de la verdura . Pret. pori, polessi.', NULL, 'Fuente: bubi-español', 'import-script'),
