  ('Posa', 'obtenido a partir del verbo o pósá . Está localizado en Riaba y en Moka. pósá , v. alardear, pavonearse, presumir; a ba tyu''ú bá e eriia wela ba tyí''a la -  los ricos del pueblo no presumen. Pret. pósi, pósessi. pósessi, pret. v. o pósá ; n -  yo alardeaba, o - tú alardeabas, a él alardeaba, to - nosotros alardeábamos, lo vosotros alardeabais, ba - ellos alardeaban. pósi, pret. v. o pósá ; o obébá a -la i nabba i áí  el cazador alardeó con su botín.', NULL, 'Fuente: bubi-español', 'import-script'),
