  ('puápúa', 'sing. y pI. 1. pepita, grano. Clases 9 y 10 . 2. antrop. sipúa vulgarniente traducido por "perrito". púbba , v. reventar, explotar ; e esawasawáa e lá -  el guanábano revienta al caer al suelo. Pret. púbbi, púbessi. puráa / 271 púbbi, pret. v. o púbba ; e bireñtya bi -  las naranjas reventaron al caer al suelo. púbbia , v. hacer reventar; to - e suppáa . Pret. púbiia, púbiesiia. púbessi, pret. v. o púbba ; e beakaleko be -  los cocos reventaban al caer al suelo. púbiesiia, pret. v. o púbbia ; e biróya to bi -  las naranjas las hacíamos reventar. púbiia, pret. v. o púbbia ; e bireÍltya 10 bi -  las naran jas las hicisteis reventar. puéi, pret. v. o puá ; i puápúa i -  los granos brotaron. puelessi, pret. v. o puella ; n obáám o''a le eelÍl lá  venía de la finca cuando me viste. puella , v. 1. proceder, venir de, provenir; to la - e elo''á o''aaé  venimos de allende los mares. 2. gotear; e epánna e la  la palangana gotea. Pret. pueri, puelessi. puera , v. escupir; to la - tuái nosotros escu', NULL, 'Fuente: bubi-español', 'import-script'),
