  ('Puye', 'construido a partir del verbo ya en desuso o buyeea . Está loca lizado en Baney. ra, conec. prep. de; rihúla - bisussú  un montón de hormigas comunes y rojas. Concuerda con las palabras de la CI. 5.', NULL, 'Fuente: bubi-español', 'import-script');
