  ('seké', 'sing. necio, tonto, bobalicón, ignorante. Cl. 12 ; 010 bOllá a serí o sá -  este niño es muy ton to. * we - no tienes conciencia, eres necio. selessi, pret. v. o sellá ; o boyolla lÍ1 a -la o lOetto  mi abuelo desfallecía con la caminata. selessi, pret. v. o sella ; e rokit ta a - o bOllá  el médi co curaba al niño, o bOllá n bo - siatta  al niño le contaba un cuento, 010 botyo a le - elako  esta persona me hacía un trabajo. sélessi, pret. v. o sélla ; n-yo falle cía, n ta -  yo no fallecía. Tb. wessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('sellá', 'indo otro, otra. Concuerda con las pala bras de la Cl. 12; sinki - otra mosca. sellá , v. desmayarse, desfallecer; a batyo ba lá -la o botyibíi  la gente desfallece del cansancio. También se trata de un verbo que sirve de apoyo a una acción principal; o - o to''ólla no parar de hablar, o - o etta no parar de caminar, etc. Pret. seri, selessi. sella , v. curar; to la - a batyo bammaa  nosotros curamos a todas las personas. hacer algo por alguien. narrar, contar; n ka o - boatta  voy a contarte una historia. Pret. seri, selessi. sélla , v. morir/se, fallecer, fenecer; a batyo ba lá - la e bekaaí  la gente muere por las epidemias. Pret. séri, sélessi. Tb. o wáa. senáera , v. enviar, mandar; lo la le - boták ko  vosotros me enviáis un recado. Pret. senáeriia, senáeresiia. Tb. o ará. senáeresiia, pret. v. o senáera ; to - o boatta bo e riwéi ri o botúkku  nosotros enviábamos la noticia de la muerte del alcalde. Tb. aresiia. senáeriia, pret. v. o senáera ; n o boie lÍ1 tyokko  man dé dinero a', NULL, 'Fuente: bubi-español', 'import-script'),
  ('senena', 'sing. hormiga menuda. Cl. 12 .', NULL, 'Fuente: bubi-español', 'import-script'),
