  ('Sénoko', 'cuyo significado hace referencia a alguien que hace ruido. Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('senti', 'perfume', NULL, 'Fuente: español-bubi', 'import-script'),
  ('Sepa', 'obtenido a partir del verbo o seppa . Se localiza en Baney, en Basakato de la Sagrada Familia, en Belebú y en Ruiché. sepelessi, pret. v. o sepella ; to - e kobinna  nos quejába mos del gobierno. sepella , v. quejarse de algo o de alguien; o la le  tú te quejas de mí, we le sepelle no te quejes de mÍ. Pret. seperi, sepelessi. seperi, pret. v. o sepella ; n bo - o mmása lÍl  me quejé de mi jefe. sepessi, pret. v. o seppa ; lello ommaa n -  todo el día de hoy me quejaba, e obéolla e -  el anciano se quejaba. seppa , v. vanagloriarse, alabarse a sí mis mo. quejarse; lello mmaa n la - todo el día de hoy me quejo. Pret. seppi, sepessi. seppi, pret. v. o seppa ; n-me quejé, o - te quejaste, a - se quejó, to - nos quejamos, 10 - os quejasteis, ba -  se quejaron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('seppo', 'sing. música, melodía. CI. 12 . séra , v. acabar con, terminar; to la - a ba''u  nosotros terminamos el vino de palma. llenar, repoblar. Pret. séría, séresiia. séresiia, pret. v. o séra ; to be - e bekobbe nosotros termi nábamos los plátanos, to si - e sibólló nosotros acabábamos con la pobreza. serí, pret. v. o sella ; n bo hOatta o wéso''o o  yo narré una historia a tu amigo, e taa to - é hállo  la razón por la que estamos aquí. seri, pret. v. o sellá ; n buéi n ta -  morí no desfallecí. séri, pret. v. o sélla ; a batyo ba e eriia á Kodda ba - be ammaa  todos los habitantes del poblado de Kodda murieron. Tb. wéi. séría, pret. v. o séra ; a abitábítta ba - a batyo  los militares acabaron con las personas. Seriché , antrop. formado a partir del ver bo séra y del sustantivo plural i tyé . Sérityé se referirá a alguien que repuebla los poblados. Se localiza en Balachá, en Moka y en Belebú.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('SeSe', 'bello, bonito, hermoso, bueno, agrada ble. Concuerda con las palabras de la CI. 12; e sokko - la buena noticia, e siatta - la hermosa historieta. seselessi, pret. v. o sesella ; ii bulla a - o oberíi áí  la doncella visitaba a su madre. sesella , v. visitar a alguien; a bariariia ba lá - a balokia  los gobernantes visitan a los hoteleros. Pret. seseri, seselessi. seseri, pret. v. o sesella ; o tua rítyityi to - e rohiáa  las ancianitas visitaron el oratorio. sesessi, pret. v. o sessa ; a batyo ba - la gente comía y guardaba algo. sessa , v. guardar, comer y guardar algo para después; e tyallá e lá tyuará a batyo la - el ham bre hace que la gente coma y guarde algo para después. Pret. sessi, sesessi. Tb. o leppa. sessi, pret. v. o sessa ; epókkó e - el buey comió y guardó algo para después. sessi, pret. v. o sa ; o loa lulé n ripotto Iikélíke el año pasado solía ir mucho a la ciudad. sétaelessi, pret. v. o sétaella ; e ribetté ri - boppé e tyokkó  el bidón se desecaba en verano. sétaell', NULL, 'Fuente: bubi-español', 'import-script');
INSERT INTO dictionary (bubi, spanish, ipa, notes, created_by) VALUES
  ('settáa', 'sing. pluma cuchillo. navaja. Cl. 12 . Tb. lo ''obbá , si''obbá . sétya , v. acabar, disminuir, terminar, concluir; 10 la - elo elako  termináis este trabajo. Pret. sétyiia, sétyesiia. sétyesiia, pret. v. o sétya ; n e isoppo la o buakaleko  yo terminaba el pan y el coco, n ri - e isoppo yo terminaba el pan, n bo - o bua kaleko  yo termi naba el coco.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('setyi', 'sing. antílope. Cl. 12 . Tb. sibelo . sétyi, pret. v. o sétta ; a boppé ba -  el agua se agotó. sétyiia, pret. v. o sétya ; n-e elako  terminé el trabajo, ne - e elako  lo terminé, el trabajo. Sey , antrop. que se refiere al barro rojo aunque también significa límite . Se locali za en Moka. si''a , v. tocar; n la - botyo yo toco a alguien. humedecer, mojar; o lóllá lo lá obotyo  la lluvia hume dece el entorno. Pret. si''i, si''essi. si''ea , v. tocarse, tocar a alguien; 10 la batyo tocáis a algunas personas. humedecer se, mojarse; e bie''e bi lá -la o tuái  los labios se humedecen con la saliva. Pret. si'' ei, si'' eseei. si''ei, pret. v. o si''ea ; ba a batyo  se tocaron a las per sonas, bi - e biriia la e sille  se humedecieron los poblados con el frío. si''eseei, pret. v. o si''ea ; i kuua i -la e esubba  la ropa se humedecía con el invierno. si''essi, pret. v. o si''a ; o tonáé náé to - obotyo  la llovizna humedecía el entorno. si''i, pret. v. o si''a ; a bahNneri ba o bollá ba - o boassó  la ori', NULL, 'Fuente: bubi-español', 'import-script'),
