  ('Siabú', 'diminutivo de bOappú . Siabbú se localiza en Ureka. siaelessi, pret. v. o siaella ; to bi - e bilabba  nosotros uníamos los hechos, e beatta to be -  las historias los relacionábamos. siaella , v. enlazar, unir, relacionar; to la - bi e bilabba  nosotros rela cionamos estos hechos. Pret. siaeri, siaelessi. siaeri, pret. v. o siaella ; 10 - i tyerú  vosotros unisteis las nipas.', NULL, 'Fuente: bubi-español', 'import-script'),
