  ('Siarpe', 'prestado del inglés sharp  "afilado, cortante". Se localiza en Lubá. si atta, s. sing. cuento, historieta, fábula. Cl. 12 ; e - si o Weweopo  el cuento de Weweopo. sibáa , v. obstruir; e biruppú bi lá - e telIe Le biruppú bí la sibbé telle] las hierbas obstruyen el camino. mirar mal, desairar; 010 botyo a la se -  esta persona me mira mal. Pret. sibí, sibessi. Sibacha , antrop. que debería escribirse Sibatya . Se localiza en Rebola.', NULL, 'Fuente: bubi-español', 'import-script'),
