  ('sikárityi', 'sing. carretilla. Cl. 12 . sikessi, pret. v. o sikkáa ; a batyii ba -la e tyallá  la gente adelgazaba con el hambre. sikía, pret. v. o sikkiáa ; ii bOrulIa bii bó - la vejez le desmedró.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('sikiére', 'sing. balanza, báscula, pesa. Cl. 12 . Tb. liise''o , ke''o. sikiesiia, pret. v. o sikkiáa ; e tyiikkó e - e bekobbe  el estío reducía el tamaño de los plátanos, e tyallá e - a batyii  el hambre desmedraba a la gente.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('sikíkko', 'sing. columpio. Cl. 12 . sikkáa , v. adelgazar, perder peso, menguar, mermar, desmedrarse; ii bOllá a la - kóri a tyá la ráa  el niño adel gaza porque no come. Pret. sikkí, sikessi. sikkí, pret. v. o sikkáa ; ii - sóté  has adelgazado mucho, estás muy delgado. '' sikkiáa, 1. s. sing. cigarrillo, pitillo. CI. 12 . Tb. simíki . 2. , v. desmedrar, medrar, disminuir, reducir el tamaño de algo. Pret. sikía, sikiesiia. Silo / 295', NULL, 'Fuente: bubi-español', 'import-script'),
