  ('Sikobo', 'diminutivo de Bokobó. Se locali za en Rebola. Sikocha , antrop. obtenido a partir del verbo o kOtya . Sikotya se refie re a alguien o algo diminuto que traga o engulle. Se localiza en Baney.', NULL, 'Fuente: bubi-español', 'import-script'),
