  ('Suta', 'que debería escribirse Surta . Está localizado en Batoicopo. sutaam, pref. V. o sutalla ; n-la born búttu Ól  resbalé con mis botas de lluvia. sutalessi, pret. V. o sutalla ; n -  yo resbalaba, o -  tú resbalabas, a -  él resbalaba, to -  nosotros resbalábamos, 10 -  vosotros resbalabais, ba -  ellos resbalaban. sutalla , v. resbalar. Pret. sutaam, sutalessi. Tb. o supútalla, o .�usúballa.', NULL, 'Fuente: bubi-español', 'import-script'),
