  ('taa', 'sing. y pi. razón, objetivo. els. 9 y 10; e - to serí é hállo  la razón por la que estamos aquí. tábaam, pret. v. o táballa ; a batyo bammaa m ba - a todas las personas les grité. tábalessi, pret. v. o táballa ; e eporosía e - a bapulákke  el policía gritaba a los extranjeros. táballa , v. gritar o chillar a alguien; o la le tú me gritas, we le táballe no me grites. Prer. tábaam, tábalessi. tábba , v. gritar, vociferar; na botyo a la kábera a la báa la nabba  si una persona grita es porque se comporta como un a nimal. Pret. tábbi, tábessi. tábbi, pret. v. o tábba ; a batyo ba lá ekkáa ba e suppá ba - sóté  la gente que mira el encuentro de fú tbol gritó mucho. tábessi, pret. v. o tábba ; o botyelemán a ópessi lo lá a  el preso, cuando era golpea do, gritaba.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tábuella', 'sing. y pI. toallas. els. 9 y 10. takelessi, pret. v. o takella ; o botúkku e oríi i tyé a - a batyo ba mmaa puá  eljefe de todos los pueblos destaca ba sobre toda la gente. takella , v. destacar sobre, dirigir, presidir; o bOllá a la - a batyo ba mmaa  el niño dirige a todas las perso nas. Pret. takeri, takelessi. takeri, pret. v. o takella ; e kobinna e - a batyo e tyá la pénna e bilabba lelle  el gobierno que dirige a la gen te no hace las cosas bien. takessi, pret. v. o takkáa ; a batyo ba - bá IÍlmalé ba aan sóté  las personas que gobernaban antaño sabían mucho.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tákityé', 'sing. gobernador, emperador. el. I . takkáa , v. gobernar. destacar, predomi nar, dominar; na n tyá na''a le n la -  aunque no quiera destaco. Pret. takkí, takessi. takki, 1. pret. v. o takkáa ; o botyo e - ó a ta púríi e eriia wela  la persona que gobierna no es del pueblo. 2. mandamás , director/es. legislador. els. 9 y 10 . takólla , v. enviar/mandar a alguien; o botúk ku e oríi i tyé a la - a baitta ba mmaa  el jefe de 308 / takóm todos los pueblos envía a todos los gobernadores. Pret. takóm, takuessi. takóm, pret. v. o takólla ; n bo - o boebba  he mandado al vinatero. takue''eem,pret. v. o takuella ; o boták kí to bo - elako  al criado le encargábamos un trabajo. takuella , v. encargar; o la - o bulla lotóbboo  tú encargas un reca do a la doncella. Pret. takuem, takue''eem. takuem, pret. v. o takuella ; n-o MlIá elabba  yo encargué un asunto al chico. takuessi, pret. v. o takólla ; to ba - a bayolla ba etelle e bilabba bi áó  nosotros mandábamos a los ancianos para que intercedieran', NULL, 'Fuente: bubi-español', 'import-script'),
