  ('tátyi', 'pI. ganchos metálicos. CI. 1 0 . Tb. bitádyi . tatyíi, pret. v. o tatáa ; n-o booné l Í l  corté mi dedo, n bo -  lo corté. te, morf neg. no. Se usa en la conjugación de los ver bos: a batyo ba - poa no han venido las personas. té, 1. morf numo uno; neppí - un músico. Sólo se usa para las palabras de la CI. 9. 2. morf de nega ción; to - ráa no hemos comido, to - rá''a toda vía no vamos a comer. 3. prono otro/s, otra/s. Concuerda con las palabras de las Cls. 9 y 10; elo nabba, e - este animal, el otro, ilo nabba, i estos animales, los otros. Cfr. te. te''a , v. consolar, calmar, apaciguar; n la - a batyo ba lá ba o ólalla bo ba  yo apaciguo a las personas que se están pegando. Pret. te''i, te''essi. te''essi, pret. v. o te''a ; to ba - a batyo ba bé''essi ba  nosotros consolábamos a las personas que lloraban. te''i, pret. v. o te''a ; o oberíi a o bollá áí  la madre calmó a su hijo.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('te''o', 'sing. y pi. mesas. mostradores. Cls. 9 y 10 . Tb. tébiilW. te''ólessi, pret. v. o te''ólla ; e sibólló si e -  la pobreza nos des consolaba. te''ólla , v. desconsolar; e roppá ri la e -  el dolor nos desconsuela. Pret. te''óri, te''ólessi. te''óri, pret. v. o te''ólla ; e riwéi ri áí ri e -  su muerte nos des consoló. tealessi, pret. v. o tealla ; e isaké n ri - o botté bi''o  el machete lo apoyaba en el árbol. tealla , v. apoyar; n la - e eho''o e eteppe bi''o  apoyo el poste en la pared. Pret. teari, tealessi. teari, pret. v. o tealla ; o ri - e isaké o  tú apoyaste tu machete. tébaam, pret. v. o téballa ; o bue''iáa e le pooe to - o buppá bU áó  cuando llegó el maestro pusimos fin a nuestro alboroto. tébaIessi, pret. v. o téballa ; to bo - o buppá bo áó  nosotros poníamos fin a nuestro alboroto. tébaIla , v. dejar de incordiar, poner fin; e nokonoko o - e tu alboroto, ponle fin . Pret. tébaam, tébalessi. tébba , v. callar, cesar; e neppí e lá - kóri a batyo ba tyí''a la oátyera  el músico se ca', NULL, 'Fuente: bubi-español', 'import-script'),
