  ('teppo', 'sing. y pI. nivel, grado. els. 9 y 10 . tételessi, pret. v. o tétella ; o bonánna a - i kollo  la abuela debilitaba a las sardinas por medio de una sustan cia vegetal. tétella , v. debilitar por medio de alguna sustancia vegetal o química atraer por medio de cualesquiera argucias con objeto de despistar o desorientar a una persona o a un animal. Pret. téteri, tételessi. téteri, pret. v. o tétella ; i kollo to i  nosotros debilitamos las sardinas. tétessi, pret. v. o tétta ; o liibinno lo - e bimpa  la apiso nadora tritura las piedras. Pret. tétyi, tétessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tetto', 'sing. y pI. glandes, cabezas del penes. els. 9 y 10. tetya, 1. s. sing. y pI. color, colores. els. 9 y 10 ; e - killó el color negro, e - tolla el color rojo o granatc, e - obo el color ocre, e - peppa color gris. 2. - , v. dibujar, colorear, pintar; n la - yo dibujo. Pret. tetyi, te tyessi. Tb . o dibuhalla. tetya , v. imponer, condecorar; o la - esokka  tú impones una medalla. Pret. tetyía., te tyesiia. tetyesiia, pret. v. o tetya ; e kobinna a - a batyo ba mmaa bá''a buéi ba e ebéló e ko''e  el gobierno condecoraba a todas las personas que murieron en tiempos del gallo . tetyessi, pret. v. o tetya ; a bokútta ba pi''o  los médicos dibu jaban riñones. tetyi, pret. v. o tetya ; o bue''iáa a - i nab ba kubbaa i é eriia wela  el maestro dibujó todos los animales del pueblo. tétyi, pret. v. o tétta ; e emasíín e - a bate  la máquina trituró las piedras. tetyía, pret. v. o tetya ; o botúkku bote a - a abitábítta el gran jefe condecoró a los militares.', NULL, 'Fuente: bubi-español', 'import-script'),
