  ('tó''ólló', 'pI. lenguas, idiomas, hablas. CI. 13 . to''óm, pret. v. o to''ólla ; mpári 10 - e etyo  ayer hablasteis el bubi. tó''óra , v. interpelar; o buatébisapá a la - e kobinna  el juez interpela al gobierno. Pret. tó'' óriia, tó''óresiia. tó''óresiia, pret. v. o tó''óra ; o bu até bisapá a - e eriia  el juez interpelaba al pueblo. tó''óriia, pret. v. o tó''óra ; o buatébi sapá a - e eriia  el juez interpeló al pueblo. to''otya, aqj. pI. primeros, primeras. CI. 13 . Concuerda con las palabras de la CI. 13; o topotto - las primeras pimientas negras. to''ú, 1. s. sing. facultad, autorización, energía, fuerzas, vigor, beneplácito, potestad, potente. CI. 13 ; -la ri''uá a ta bá pala'' e la fuerza y la suerte son incompatibles. 2. ad). dificil; e ehMmero é -  la res puesta es dificil. toáán, pret. v. o toánna ; e bilabba bi  los hechos están mezclados.', NULL, 'Fuente: bubi-español', 'import-script'),
