  ('tyatyá', 'sing. dados, el juego de los dados. Cls. 9 y 10 . tyátya , v. brillar, relucir; i nalle i lá - sóté el mármol brilla mucho. Pret. tyátyi, tyátyessi. tyátyessi, pret. v. o tyátya ; o bossó biS áí bo -  su cara brillaba. tyátyi, pret. v. o tyátya ; o bobba bo - el suelo brilló. tyatyiiUa , v. fundirse, derretirse; a butá ba lá -la e itóhí  el aceite se derrite con el Sol. Pret. tyatyorei, tyatyueseei. tyatyiira , v. fundir, derretir; e itóhí ri lá - a butá  el Sol derrite el aceite. Pret. tyatyoriia, tyatyuesiia. tyatyiirei, pret. v. o tyatyolla ; a butá ba -  el aceite se derritió. tyatyiiriia, pret. v. o tyatyora ; e itóhí ri - a butá  el Sol derritió el aceite. tyatyueseei, pret. v. o tyatyolla ; a butá ba -la e húé  el aceite se derretía con el calor. tyatyuesiia, pret. v. o tyatyora ; m ba - a butá mpári  derretía el aceite ayer.', NULL, 'Fuente: bubi-español', 'import-script'),
