  ('tyetyélle', 'sing. y pi. molusco univalvo pequeño. Cls. 9 y 10 ; i - i serí o sá boroo  los moluscos univalvos son muy ricos. tyetyéra , v. freír, secar. Pret. tyetyéria, tye tyéresiia. Tb . o parabia. tyetyéresiia, pret. v. o tyetyéra ; i kollo n i -  las sardinas las freía.', NULL, 'Fuente: bubi-español', 'import-script'),
