  ('tyí', 'sing. y pI. calamar/es. Cls. 9 y 10; to la na''a o olla - yé mpa  que remos comprar dos calamares. tyí''a , v. dejar atrás, abandonar. depo sitar; to la - e robbo  dejamos la escalera, lüe le - tyuíi no me dejéis atrás por favor. Pret. tyí''i, tyí''essi. tyí''essi, pret. v. o tyí''a ; n -yo dejaba atrás, o - tú dejabas atrás, a - él deja ba atrás, to - nosotros dejábamos atrás, 10 vosotros dejabais atrás, ba - ellos dejaban atrás. tyí''i, pret. v. o tyí''a ; to mmaaó ob(i''ó a batyo ba e -  pongámonos de pie, que la gente nos ha dejado atrás.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyía', 'sing. y pI. hiel/es. Cls. 9 y 10. tyiáán, pret. v. o tyiálla ; i nokkolÍl i''a - e ehurú weJa  mis oj os se han quedado en el aire . tyiálelessi, pret. v. o tyiálella ; o botúkku a le -  el alcalde me perdonaba. tyiálella , v. disculpar, perdonar, anmistiar. Pret. tyiáleri, tyiálelessi. tyiáleri, pret. v. o tyiálella ; o buatébisapá a - i húbbé el juez perdonó a los ladrones. tyiálessi, pret. v. o tyiálla ; e puá e - o bOllá  el perro se quedaba con el niño. tyiálla , v. quedar, alojarse, quedarse con; o botyo quedarse con alguien que está físicamente impedido. Pret. tyiáán, tyiálessi. tyibaan, pret. v. o tyibanna ; nne n ka - e sille sa botyíó  yo estoy harto del frío de la noche. tyilelessi I 325 tyibanessi, pret. v. o tyibanna ; to - e sibólló  nosotros nos hartábamos de la pobreza. tyibanna , v. estar harto de; to la - e ribiityo  nos hartamos de la vida. Pret. tyibaan, tyibanessi. tyibbáa , v. cansarse, agotarse, fatigarse. Pret. tyíbbi, tyibessi. Tb. o tuppa. tyíbbi, pret. v. o ty', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyíbbo', 'pI. sartas de conchas. CI. 10 . tyíbelessi, pret. v. o tyíbella ; o bonatú''o Ól a -la a bi''ó  mi hermano mayor temblaba de fiebre. tyíbella , v. temblar, tiritar. Pret. tyíberi, tyíbe lessi. Tb . o kokobbia. tyíberi, pret. v. o tyíbella ; n-yo temblé, o - tú temblaste, a - él tembló, to - noso tros temblamos, lo - vosotros temblasteis, ba ellos temblaron. tyibessi, pret. v. o tyibbáa ; n sessí lá ripotto n- cuando iba a la ciudad me cansaba. Tb. tupessi. tyibiesüa, pret. v. o tyibbia ; a bi''ó ba le -  la fiebre me agotaba. tyie''eem, pret. v. o tyiella ; to - e ello bó biityíó  aplazábamos el día anoche. tyieem, pret. v. o tyiella ; o biiheppoo a ta le - bOra''o  el huésped no me dejó comida. tyíelessi, pret. v. o tyíella ; a batyo n ba - a lokko lábbO  a las personas les dejaba sus cosas. Tb. tyie''eem. tyiella , v. legar, dejar , aplazar; to la - e ello  aplazamos el día. Pret. tyieem, tyielessi . tyíella , v. dejar algo para alguien; n la - o buityíi Ól eruua  dejo sitio a mi hermano m', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyiétyié', 'sing. y pi. estornudo/s. Cls. 9 y 10 . tyihébbia , v. estornudar; o tokollo to la - a batyo los picantes hacen estornudar a la gente. Pret. tyihébiia, tyihébiesiia. tyihébiesiia, pret. v. o tyihébbia ; lo vosotros estornudabais. tyihébiia, pret. v. o tyihébbia ; i puá i - los perros estornudaron. tyikela , v. 1. pinchar. 2. fornicar. Pret. tyike ri, tyikelessi.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyikeIeelé', 'sing. y pi. talón, talones. Cls. 9 y 10. tyikelessi, pret. v. o tyikela ; n - yo pinchaba, o - tú pinchabas, a - él/ella pin chaba, to - nosotros pinchábamos, 10 - vosotros pinchabais, ba -  ellos pinchaban. tyikeri, pret. v. o tyikela ; n yo pinché, o - tú pinchaste, a - él/ella pinchó, to - nosotros pinchamos, lo - vosotros pinchasteis, ba -  ellos pincharon.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyikk', 'disco', NULL, 'Fuente: español-bubi', 'import-script'),
  ('tyikkó', 'sing. y pI. fruto silvestre redondo, pequeño, utilizado para fines rituales. disco. Cls. 9 y 10. tyikólessi, pret. v. o tyikólla ; to - a bakobbe  nosotros derrumbábamos las plantas del plátano. tyikólla , v. talar, derrumbar; n la - o Mtté  yo talo el árbol. Pret. tyikóri, tyikólessi. tyikóri, pret. v. o tyikólla ; to ba - a batté nosotros derrumbamos los árboles. tyilálessi, pret. v. o tyilálla ; n-yo cava ba con, o - tú cavabas con, a -él/ella cavaba con, to - nosotros cavábamos con, 10 - vosotros cava bais con, ba -  ellos cavaban con. tyilálla , v. cavar con; n la - isaké yo cavo con un machete, n tyi''a - isaké yo no cavo con ma chete. Pret. tyilám, tyilálessi. tyilám, pret. v. o tyilálla ; a batyele mán ba - o bobba la e bie''e bi ábO  los presos cava ron la tierra con sus bocas. tyilelessi, pret. v. o tyilella ; n-yo ente rraba, o - tú enterrabas, a - él/ella enterraba, to - nosotros enterrábamos, lo - vosotros enterra bais, ba -  ellos enterraban. 326 / tyUeIla tyUella , v. ente', NULL, 'Fuente: bubi-español', 'import-script'),
