  ('tyio', 'sing. y pi. gancho/s, garfio/s trai dor/es. Cls. 9 y 10 . tyiOlea , v. peinarse, cepillarse el pelo; n la me peino, me cepillo el pelo. Pret. tyiOlei, tyio leseei. tyiOlei, pret. v. o tyiolea· ; n-me peiné, o - te peinaste, a - se peinó, etc., n ta -  no me peiné, o ta -  no te peinaste, a ta -  no se peinó, etc., n ka -  me he peina do, o''a -  te has peinado, a''a -  se ha peinado, etc. tyiOleseei, pret. v. o tyiolea ; n-la e bene lÍl  me peinaba con mis dedos, o Mllá a - kóri a séi beakki  el niño se peinaba porque tenía piojos. tyiOlessi, pret. v. o tyiolla ; n-o MUá  yo peinaba al niño, o - e besup pa IÍlla e tyiori  peinabas mis trenzas con el peine.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyioIla', 'sing. y pI. huérfano/s; i - yá e eriia lÍl  los huérfanos de mi país/pueblo. Clases 9 y 10 . tyiOlla , v. peinar; n la - e esilla o  peino tu pelo. Pret. tyiori, tyiolessi. tyiOlOlessi, pret. v. o tyiololla ; n-e sipóssi lÍl  yo despeinaba a mi gato. tyiolOlla , v. desgreñar, despeinar; to la - o bulla  nosotros despeinamos a la doncella. Pret. tyiolori, tyiololessi. tyiOlori, pret. v. o tyiololla ; n-e bisílla bi o boyolla lÍl  yo despeiné los cabellos de mi abuelo. tyiOri, 1. s. sing. y pi. peines, cepillo de púas. Cls. 9 y 10 . Tb. kónna. 2. pret. v. o tyiolla ; elo ebari n-e esílla lÍl  esta mañana peiné mi pelo. tyipóbba , v. fracasar; n la sélla o -  no hago más que fracasar. Pret. tyipób bi, tyipóbessi. tyipóbbi, pret. v. o tyipóbba ; n-yo fra casé, o - tú fracasaste, a - él fracasó, to - noso tros fracasamos, 10 - vosotros fracasasteis, ba  ellos fracasaron. tyipóbessi, pret. v. o tyipóbba ; n-yo fracasaba, o - tú fracasabas, a - él/ella fracasaba, to - nosotros fracasábamos, 1', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyiolla', 'huérfano', NULL, 'Fuente: español-bubi', 'import-script'),
  ('tyippa', 'sing. y pi. jineta/s, gato/s salvaje/s. Cls. 9 y 10. tyíri, pret. v. o tyílláa ; n-me fui, o - te fuiste, a - se fue, to - nos fuimos, lo - os fu isteis, ba - se fueron. tyíríi, pret. v. o tyilIáa ; n-e bekokkó rula e billo ru  arranqué de la tierra mis malangas y mis ñames. tyitá , v. manchar; Iii la - e etapóllo  vosotros mancháis la lona. Pret. tyití, tyitessi. tyitessi, pret. v. o tyitta ; n-yo arrasaba, o - tú arrasabas, a - él arrasaba, to - nosotros arrasábamos, lo - vosotros arrasabais, ba -  ellos arrasaban. tyitessi, pret. v. o tyitá ; n-e ribatyu r ula biitá  mancha ba mi braga con aceite. tyití, pret. v. o tyitá ; o - e sotte o  manchaste tu camisa. tyitobia , v. empujar; we le tyitobie no me empujes. Pret. tyitobiia, tyitobiesiia. tyitobiesiia, pret. v. o tyitobia ; tue ammaa to - o motóo  todos nosotros empujábamos el coche. tyitobiia, pret. v. o tyitobia ; m bo - o bokoé ee ké taa a kuerí é empujé al bracero por eso cayó. tyitóra , v. atormentar, perturbar; elo elabba e ', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyítyá', 'sing. y pI. genital/es fe menino/s. Cls. 9 y 10; e mme ká tyu i ikíria é [e mme ká tJúíkíriá él? tyúíkíríá bale''é, la batyapotyapo, i - í óóri señora, ¿qué hemos movido? Hemos movido los testículos, y los penes, los genitales femeninos están ya maduros. tyo, mor! numo cinco; tyekkú yé - cinco ombli gos. Se usa sólo para la clase 10.', NULL, 'Fuente: bubi-español', 'import-script'),
