  ('tyobbó', 'sing. y pI. iguana/s, reptil/es comesti ble/s. Cls. 9 y 10.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyóbbo', 'sing. y pi. casas, moradas, hogares. Cls. 9 y 10; e - í kaaí la casa de las enfermedades, el hospital, i - yí kaaí las casas de las enfermeda des, los hospitales. tyokaam, pret. v. o tyókalla ; o motóii bo le -  el coche chocó conmigo. tyokalessi, pret. v. o tyókalla ; e kobinna a - a batyo e riallá  el gobernador chocaba la mano a las personas. tyokalIa , v. chocar, colisionar; o motóo bo lá - a batté  el coche choca contra los árboles. Pret. tyókaam, tyó kalessi.', NULL, 'Fuente: bubi-español', 'import-script'),
