  ('tyoom', 'sing. y pi. vergüenza, rubor. Cls. 9 y 10. E} . expr. o tyí o''áa -  no tienes vergüenza. tyopálessi, pret. v. o tyopálla ; e kólló ne - néri  yo pinchaba la rata de bosque con un clavo. tyopálIa , v. pinchar con algo; to la - o bora''o tokko  nosotros pin 328 / tyopári chamos la comida con un clavo. Pret. tyopári, tyopálessi. tyopári, pret. v. o tyopálla ; n pinché con algo, o - pinchaste con algo, a - pinchó con algo, to - pinchamos con algo, 10 - pinchas teis con algo, ba -  pincharon con algo. tyopessi, pret. v. o tyoppáa ; n-yo pinchaba, o - tú pinchabas, a - él pinchaba, to - nosotros pinchábamos, 10 - voso tros pinchabais, ba -  ellos pin chaban.', NULL, 'Fuente: bubi-español', 'import-script'),
