  ('tyotyo', 'sing. y pi. leña candente, tizón. Cls. 9 y ID. tyütyóbia , v. sorber, chupar; e sipórí sí la - a abelle bá e puá  el cabrito chupa las ubres de la perra. Pret. tyotyóbiia, tyotyóbiesiia. tyotyóbiesiia, pret. v. o tyotyóbia ; n-yo chupaba, o - tú chupabas, a - él chupa ba, to - nosotros chupábamos, 10 - vosotros chupabais, ba - ellos chupaban. tyotyóbüa, pret. v. o tyotyóbia ; n- sorbí, o - sorbiste, a - sorbió, to - sorbimos, lo - sorbisteis, ba - sorbieron.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyotyounó', 'sing. y pi. planta/s que forma/n matas y de hojas elíptico-lanceoladas dispuestas helicoidalmente . Clases 9 y 10 . tyu''úbba , v. medrar, enriquecerse; a batyo ba lá - la e bilako  las personas se enriquecen con los traba jos. Pret. tyu''úbbi, tyu''úbessi. tyu''úbbi, pret. v. o tyu''úbba ; a batyo ba - las personas se han enri quecido. tyu''úbbia , v. enriquecer. Pret. tyu''úbiia, tyu ''úbiesiia. tyu''úbessi, pret. v. o tyu''úbba ; e kobinna e - la e bilako bi a batyo  el gobier no se enriquecía con los trabajos de las personas. tyu''úbiesiia, pret. v. o tyu''úbbia ; 10 ba - a baísso vosotros enriquecíais a las mujeres. tyu''úbüa, pret. v. o tyu''úbbia ; o bo - tú le enriqueciste.', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyua', 'pi. lavabos, pilas. bañeras. lava doras. Cl. 10 . tyuáán, pret. v. o tyuánna ; o mmé o ata lá -  tu madre no lo permitió. tyuánessi, pret. v. o tyuánna ; o ri - e ripukké  tú permitías la falta de respeto. tyuánna , v. permitir, tolerar, propiciar; we a batyo ba ori o  no per mitas que las personas mueran .', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyuapp', 'cruce', NULL, 'Fuente: español-bubi', 'import-script'),
  ('tyuappo', 'pI. cruce. Cl. 13. * 0-pua  en el cruce. tyuára , v. facilitar, promover, permitir; e tyok kó e lá - ná a batyo ba lá hMmabi''o  el verano permite que las personas se alegren. Pret. tyuáría, t y uáresiia. tyuáresiia, pret. v. o tyuára ; e kobinna a - ná e bilabba bi lá etta lelle  el gobierno permitía que las cosas funcionaran bien. tyuária, pret. v. o tyuára ; o boie lÍl a ta - na n heri obitábítta  mi padre no permitió que yo fu era militar. tyúbiera , v. pedir, suplicar, rogar. Pret. tyú bieriia, tyúbieresiia. tyúbieresiia, pret. v. o tyúbiera ; oboie a - o botúkku  el hombre suplicaba al alcalde. tyúbieriia, pret. v. o tyúbiera ; a le - o waíssolÍl me suplicó mi esposa. tyuuri / 329', NULL, 'Fuente: bubi-español', 'import-script');
