  ('tyue', 'acá', NULL, 'Fuente: español-bubi', 'import-script'),
  ('tyué', 'sing. y pI. peces, pescado. els. 9 y 10. tyuhela , v. regalar; o wetta ID a la - o bOllá  mi hermana regala algo al niño. dar. ofrecer. Pret. tyuheri, tyuhelessi. tyuhelessi, pret. v. o tyuhela ; a balako láko to ba - lokko mpári a los trabajadores les regalábamos cosas ayer. tyuheri, pret. v. o tyuhela ; m bo - o bollá regalé algo al niño.', NULL, 'Fuente: bubi-español', 'import-script'),
