  ('tyuíune', 'pI. cines, locales de cine, películas. el. 13 . tyukea , v. enturbiarse ; a boppé ba lá -la o lóllá  el agua se enturbia con la lluvia. Pret. tyukei, tyukeseei. tyukei, pret. v. o tyukea ; e bilabba bi - mpári los hechos se enturbiaron ayer. tyukeseei, pret. v. o tyukea ; a bo''á ba - la e pullá  las aguas del mar se enturbiaban con la tormenta. tyukessi, pret. v. o tyukka ; a bOllá ba a boppé  los niños revolvían el agua. tyukka , v. revolver . Pret. tyukki, tyukessi. tyukki, pret. v. o tyukka ; n-revolví, o - revolviste, a - revolvió, to - revolvimos, 10 revolvisteis, ba -  revolvieron. tyulessí, pret. v. o tyuulá ; n-yo tiraba al suelo, o - tú tirabas al sue lo, a - él tiraba al suelo, to - nosotros tirábamos al suelo, 10 - vosotros tirabais al suelo, ba - ellos tiraban al suelo. tyupaera , v. apuntalar; n la - apuntalo, o la apuntalas, etc. Pret. tyupaeriia, tyupaeresiia. Tb. o petyobaera. tyupaeresiia, pret. v. o tyupaera ; n apuntalaba, o - apuntalabas, etc. tyupaeriia, pret. v. o', NULL, 'Fuente: bubi-español', 'import-script'),
  ('tyussú', 'sing. y pI. hormiga roja. els. 9 y 10 . tyútya , v. ayudar a caminar o a avanzar, ani mar. Pret. tyútyía, tyútyesiia. tyutyera , v. arrimarse; - le bi''o arrímate a mÍ. Pret. tyutyeriia, tyutyeresiia. tyutyeresiia, pret. v. o tyutyera ; a batyo ba le - bi''o  las personas se arrimaban a mÍ. tyutyeriia, pret. v. o tyutyera ; n ta bó - bi''o tyommaa no me arrimé a él nunca. tyútyesiia, pret. v. o tyútya ; e bilabba n bi -  los asuntos, yo ayudaba a que avanzaran. tyútyía, pret. v. o tyútya ; 010 botyo n ka bii - sé sibélló esta persona le ayudé a caminar hace un momen tito.', NULL, 'Fuente: bubi-español', 'import-script'),
