  ('Url', 'que ofrece dos significados. En primer lugar, se referirá a alguien que reúne si tenemos en cuenta el pret. del v. o ulla . En segun do lugar, úrí significa "lugar". Se localiza en Rebola. url, pret. v. o ulla ; n bi - e bireótya  cogí las naranjas, reuní las naranjas. uríi, pret. v. o ulláa ; ba - o bolláa bo e eriia  ellos juzgaron el pro blema del pueblo. usólla , v. nombrar, mencionar, mentar, pronunciar; o mmása lÍl a la - a balak{}láko ba be  mi jefe nombra a los nuevos trabajadores. desig nar. Pret. usóri, usuessi. usóri, pret. v. o usólla ; o mmása lÍl a ba - a balak{}láko ba he  mi jefe nom bró a los nuevos trabajadores. usuessi, pret. v. o usólla ; n - yo nombraba, o - tú nombrabas, a - él nombra ba, to - nosotros nombrábamos, lO - vosotros nombrabais, ba - bá úsúeessi] ellos nombraban. utaelessi, pret. v. o utaella ; a abitábítta ba - e eriia  los mili tares rodeaban el pueblo. utaella , v. rodear; a abitábítta ba la - a batyo  los militares rodean a la gente. Pret. utaeri, ', NULL, 'Fuente: bubi-español', 'import-script'),
